INSERT INTO `rdtom_comments` (`ID`, `Question_ID`, `User_ID`, `Timestamp`, `Text`, `Type`) VALUES
(1, 1633, 1, 1475095161, 'Question Edited \n\nFrom: \n \nVrai ou faux : un joueur a le droit de décorer son casque même si les décorations en question peuvent être confondues avec une étoile de jammer ou une bande de pivot.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (author-id) 3, (tag) Test Question, (difficulty) Intermediate, (difficulty) Beginner\n \nTo: \n\nVrai ou faux : un joueur a le droit de décorer son casque même si les décorations en question peuvent être confondues avec une étoile de jammer ou une bande de pivot.\n\n[Correct] Faux\n\nTerms: (language) English, (author-id) 3, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(2, 1083, 1, 1475095742, 'Question Edited \n\nFrom: \n \nAu cours d\'un passage de l\'étoile, le statut de jammer est transféré quand ...\n\n          le passage d\'étoile commence.\n          le jammer a enlevé son couvre-casque.\n          le pivot tient dans sa main le couvre-casque de jammer.\n          le pivot porte le couvre-casque de jammer sur son casque, peut importe la visibilité des étoiles.\n[Correct] le pivot porte le couvre-casque de jammer sur son casque et que les étoiles sont visibles.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Beginner, (difficulty) Intermediate, (tag) Test Question\n \nTo: \n\nAu cours d\'un passage de l\'étoile, le statut de jammer est transféré quand ...\n\n[Correct] le pivot porte le couvre-casque de jammer sur son casque et que les étoiles sont visibles.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(3, 11, 1, 1475181026, 'Question Edited \n\nFrom: \n \nParmi les surface de piste suivantes, laquelle est acceptable ?\n\n          Béton brut\n          Herbe\n[Correct] Terrain de sport\n[Correct] Bois\n[Correct] Béton poli\n[Correct] Béton peint\n          Bois brut\n          Tapis\n          Béton rugueux\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nParmi les surface de piste suivantes, laquelle est acceptable ?\n\n          Béton rugueux\n          Tapis\n          Bois brut\n[Correct] Béton peint\n[Correct] Béton poli\n[Correct] Bois\n[Correct] Terrain de sport\n          Herbe\n          Béton brut\n          Un chat\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
