(7, 1494, 1, 1475257656, 'Question Edited \n\nFrom: \n \nA skater receives a 7th Major penalty and Fouls Out. Who serves their penalty time once the current jam is over?\n\n          They do, before leaving the track\n          Nobody, the Fouled Out skater must leave the track immediately\n[Correct] Another skater, the Fouled Out skater must leave the track immediately\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nA skater receives a 7th Major penalty and Fouls Out. Who serves their penalty time once the current jam is over?\n\n          They do, before leaving the track\n          Nobody, the Fouled Out skater must leave the track immediately\n[Correct] Another skater, the Fouled Out skater must leave the track immediately\n\nTerms: \n', 1),
