(101, 1648, 1, 1475439297, 'Question Edited \n\nFrom: \n \nUn contact sur un adversaire en utilisant les mains en gênant la mobilité de cet adversaire  ...\n\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n[Correct] entraîne une pénalité.\n          entraîne une exclusion du match.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Beginner, (tag) Changed Rule, (language) English, (author-id) 3\n \nTo: \n\nUn contact sur un adversaire en utilisant les mains en gênant la mobilité de cet adversaire  ...\n\n          entraîne une expulsion du match.\n[Correct] entraîne une pénalité.\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n\nTerms: (language) English, (author-id) 3, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(102, 1347, 1, 1475439307, 'Question Edited \n\nFrom: \n \nUne situation de No Pack est créée sans impact mesurable sur le déroulement du jeu, la situation ...\n\n[Correct] n\'entraîne pas de pénalité, No Impact/No Penalty.\n          entraîne une pénalité.\n          entraîne une exclusion du match.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Beginner, (difficulty) Intermediate, (tag) Test Question\n \nTo: \n\nUne situation de No Pack est créée sans impact mesurable sur le déroulement du jeu, la situation ...\n\n          entraîne une expulsion du match.\n          entraîne une pénalité.\n[Correct] n\'entraîne pas de pénalité, No Impact/No Penalty.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(103, 535, 1, 1475439596, 'Question Edited \n\nFrom: \n \nQuand aucun joueur ou aucune équipe ne peut être clairement définie comme responsable de la destruction illégale du pack, qui reçoit la pénalité ?\n\n[Correct] Personne\n          Le patineur le plus proche d\'un des deux arbitres "Pack Referees".\n          Le pivto le plus proche d\'un des deux arbitres "Pack Referees".\n          Le pivto le plus éloigné du pack.\n          Le joueur le plus en avant du pack.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Intermediate, (difficulty) Expert, (tag) Test Question\n \nTo: \n\nQuand aucun joueur ou aucune équipe ne peut être clairement définie comme responsable de la destruction illégale du pack, qui reçoit la pénalité ?\n\n          Le pivot le plus éloigné du pack.\n          Le pivot le plus proche d\'un des deux arbitres "Pack Referees".\n          Le patineur le plus proche d\'un des deux arbitres "Pack Referees".\n[Correct] Personne\n          Le joueur le plus en avant du pack.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(104, 1064, 1, 1475439670, 'Question Edited \n\nFrom: \n \nSi un patineur s\'aligne dans la position de départ du pivot, dans quelle condition sera-t-il considéré étant pivot ?\n\n          Seulement s\'il porte ou tient dans sa main le couvre-casque du pivot.\n          Du moment qu\'il se place au poste de pivot sur la piste.\n[Correct] Seulement s\'il porte sur son casque le couvre-casque du pivot.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Beginner, (difficulty) Intermediate, (language) English\n \nTo: \n\nSi un patineur s\'aligne dans la position de départ du pivot, dans quelle condition sera-t-il considéré étant pivot ?\n\n          Seulement s\'il porte ou tient dans sa main le couvre-casque du pivot.\n          Du moment qu\'il se place au poste de pivot sur la piste.\n[Correct] Seulement s\'il porte sur son casque le couvre-casque du pivot.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(105, 1064, 1, 1475439709, 'Question Edited \n\nFrom: \n \nSi un patineur s\'aligne dans la position de départ du pivot, dans quelle condition sera-t-il considéré étant pivot ?\n\n          Seulement s\'il porte ou tient dans sa main le couvre-casque du pivot.\n          Du moment qu\'il se place au poste de pivot sur la piste.\n[Correct] Seulement s\'il porte sur son casque le couvre-casque du pivot.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nSi un patineur s\'aligne dans la position de départ du pivot, dans quelle condition sera-t-il considéré étant pivot ?\n\n          Seulement s\'il porte ou tient dans sa main le couvre-casque du pivot.\n          Du moment qu\'il se place au poste de pivot sur la piste.\n[Correct] Seulement s\'il porte sur son casque le couvre-casque du pivot.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(106, 1668, 1, 1475439787, 'Question Edited \n\nFrom: \n \nLe patineur de l\'équipe rouge sort des limites de la piste après avoir reçu un blocage par un adversaire puis revient sur la piste devant cet adversaire. Avant qu\'il ne revienne sur la piste, l\'initiateur du blocage tombe par terre. Le joueur rouge ...\n\n[Correct] ne reçoit pas de pénalité, No Pass/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (language) English, (author-id) 3, (tag) Changed Rule, (tag) Test Question, (difficulty) Beginner, (difficulty) Intermediate\n \nTo: \n\nLe patineur de l\'équipe rouge sort des limites de la piste après avoir reçu un blocage par un adversaire puis revient sur la piste devant cet adversaire. Avant qu\'il ne revienne sur la piste, l\'initiateur du blocage tombe par terre. Le joueur rouge ...\n\n[Correct] ne reçoit pas de pénalité, No Pass/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (author-id) 3, (difficulty) Intermediate, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(107, 1542, 1, 1475439839, 'Question Edited \n\nFrom: \n \nA quel moment les points gagnés par un jammer sont-ils annoncés ?\n\n          Chaque point est annoncé dès qu\'il est gagné.\n          Une fois que le jammer a dépassé le joueur adverse le plus en avant.\n          Une fois que le jammer a dépassé le joueur du pack le plus en avant.\n[Correct] Une fois que le jammer a dépassé l’avant de la zone d’engagement.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nA quel moment les points gagnés par un jammer sont-ils annoncés ?\n\n[Correct] Une fois que le jammer est sorti de la zone d\'engagement par l\'avant.\n          Une fois que le jammer est sorti du pack par l\'avant.\n          Une fois que le jammer a dépassé le joueur adverse le plus en avant.\n          Chaque point est annoncé dès qu\'il est gagné.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(108, 1542, 1, 1475439870, 'Question Edited \n\nFrom: \n \nA quel moment les points gagnés par un jammer sont-ils annoncés ?\n\n[Correct] Une fois que le jammer est sorti de la zone d\'engagement par l\'avant.\n          Une fois que le jammer est sorti du pack par l\'avant.\n          Une fois que le jammer a dépassé le joueur adverse le plus en avant.\n          Chaque point est annoncé dès qu\'il est gagné.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nA quel moment les points gagnés par un jammer sont-ils annoncés ?\n\n[Correct] Une fois que le jammer est sorti de la zone d\'engagement par l\'avant.\n          Une fois que le jammer est sorti du pack par l\'avant.\n          Une fois que le jammer a dépassé le joueur adverse le plus en avant.\n          Chaque point est annoncé dès qu\'il est gagné.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(109, 1336, 1, 1475439902, 'Question Edited \n\nFrom: \n \nUn joueur qui rejoint la penalty box accélère en étant en dehors des limites. Il ...\n\n[Correct] ne reçoit pas de pénalité, c\'est une action de jeu légal.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Beginner, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nUn joueur qui rejoint la penalty box accélère en étant en dehors des limites. Il ...\n\n[Correct] ne reçoit pas de pénalité, c\'est une action de jeu légal.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(110, 1526, 1, 1475439933, 'Question Edited \n\nFrom: \n \nA quel moment un jammer gagne-t-il des points sur des adversaires absents de la piste ?\n\n          Dès qu\'il entre dans le pack.\n          Dès qu\'il sort de la zone d\'engagement par l\'avant.\n[Correct] Dès qu’il marque un premier point sur un blocker adverse.\n          Jamais.\n          Dès qu\'il entre dans la zone d\'engagement par l\'arrière.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nA quel moment un jammer gagne-t-il des points sur des adversaires absents de la piste ?\n\n          Dès qu\'il entre dans le pack.\n          Dès qu\'il sort de la zone d\'engagement par l\'avant.\n[Correct] Dès qu’il marque un premier point sur un blocker adverse.\n          Jamais.\n          Dès qu\'il entre dans la zone d\'engagement par l\'arrière.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(111, 1432, 1, 1475439997, 'Question Edited \n\nFrom: \n \nVrai ou faux : Le chronomètre de la pénalité démarre quand le patineur quitte la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Beginner, (language) English\n \nTo: \n\nVrai ou faux : Le chronomètre de la pénalité démarre quand le patineur quitte la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (language) English, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(112, 1644, 1, 1475440220, 'Question Edited \n\nFrom: \n \nAu coup de sifflet de départ de jam, que n\'a pas le droit de faire un jammer ?\n\n[Correct] Accélerer\n          Se déplacer.\n          Être en roue libre.\n          Freiner.\n\nTerms: (rule-set) WFTDA7, (language) English, (author-id) 3, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nAu moment du coup de sifflet de départ de jam, que n\'a pas le droit de faire un jammer ?\n\n[Correct] Accélerer\n          Se déplacer.\n          Être en roue libre.\n          Freiner.\n\nTerms: (language) English, (author-id) 3, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(113, 1644, 1, 1475440255, 'Question Edited \n\nFrom: \n \nAu moment du coup de sifflet de départ de jam, que n\'a pas le droit de faire un jammer ?\n\n[Correct] Accélerer\n          Se déplacer.\n          Être en roue libre.\n          Freiner.\n\nTerms: (language) English, (author-id) 3, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nAu moment du coup de sifflet de départ de jam, que n\'a pas le droit de faire un jammer ?\n\n[Correct] Accélerer\n          Se déplacer.\n          Être en roue libre.\n          Freiner.\n\nTerms: (language) English, (author-id) 3, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(114, 1624, 1, 1475522536, 'Question Edited \n\nFrom: \n \nSi le couvre-casque de Pivot tombe au sol dans des limites de la piste, comment peut-il être récupéré ?\n\n[Correct] En restant sur la piste.\n          En patinant sur ou en dehors de la piste.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nSi le couvre-casque de Pivot tombe au sol dans des limites de la piste, comment peut-il être récupéré ?\n\n[Correct] En restant sur la piste.\n          En patinant sur ou en dehors de la piste.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(115, 283, 1, 1475522603, 'Question Edited \n\nFrom: \n \nVrai ou faux : Un patineur ou un groupe de patineurs est toujours responsable des conséquences de ses actes.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Beginner, (tag) Test Question\n \nTo: \n\nVrai ou faux : Un patineur ou un groupe de patineurs est toujours responsable des conséquences de ses actes.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(116, 1584, 1, 1475522694, 'Question Edited \n\nFrom: \n \nUn numéro au dos d\'un uniforme est en police lisible si\n\n          il peut être facilement lu et distingué des autres numéros de patineurs par les autres patineurs.\n          il est écrit dans une des polices citées dans les règles.\n[Correct] il peut être facilement lu et distingué des autres numéros de patineurs par les officiels, les autres patineurs et les membres du public.\n          il peut être lu à une distance de 6 mètres (20 pieds).\n          en mettant deux joueurs  à côté l\'un de l\'autre, on peut faire la différence entre les deux numéros.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (language) English\n \nTo: \n\nUn numéro au dos d\'un uniforme est en police lisible si\n\n          il peut être facilement lu et distingué des autres numéros de patineurs par les autres patineurs.\n          il est écrit dans une des polices citées dans les règles.\n[Correct] il peut être facilement lu et distingué des autres numéros de patineurs par les officiels, les autres patineurs et les membres du public.\n          il peut être lu à une distance de 6 mètres (20 pieds).\n          en mettant deux joueurs  à côté l\'un de l\'autre, on peut faire la différence entre les deux numéros.\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(117, 1414, 1, 1475523113, 'Question Edited \n\nFrom: \n \nAu coup de sifflet de départ de jam moins de la moitié des blockers d\'une équipe se situent entre la ligne de pivot et celle de jammer. L\'équipe en question a aligné un pivot. Qui reçoit la pénalité ?\n\n          Les joueurs qui ne sont pas en position au départ du jam.\n[Correct] Le pivot.\n          Personne.\n          Le capitaine.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert, (author-id) 3, (language) English\n \nTo: \n\nAu coup de sifflet de départ de jam moins de la moitié des blockers d\'une équipe se situent entre la ligne de pivot et celle de jammer. L\'équipe en question a aligné un pivot. Qui reçoit la pénalité ?\n\n          Les joueurs qui ne sont pas en position au départ du jam.\n[Correct] Le pivot.\n          Personne.\n          Le capitaine.\n\nTerms: (language) English, (author-id) 3, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(118, 793, 1, 1475523253, 'Question Edited \n\nFrom: \n \nQui peut inscrire des points pour son équipe ?\n\n          Seulement les joueurs portant le couvre-casque à bande, cette dernière devant être visible.\n[Correct] Seulement les joueurs portant le couvre-casque à étoiles, ces dernières devant être visibles.\n          Tous les patineurs\n          Seulement les joueurs portant le couvre-casque à étoiles, que ces dernières soient visibles ou non.\n\nTerms: (rule-set) WFTDA7, (difficulty) Beginner, (tag) Test Question, (language) English\n \nTo: \n\nQui peut inscrire des points pour son équipe ?\n\n          Seulement les joueurs portant le couvre-casque à bande, cette dernière devant être visible.\n[Correct] Seulement les joueurs portant le couvre-casque à étoiles, ces dernières devant être visibles.\n          Tous les patineurs\n          Seulement les joueurs portant le couvre-casque à étoiles, que ces dernières soient visibles ou non.\n\nTerms: (language) English, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(119, 1289, 1, 1475523298, 'Question Edited \n\nFrom: \n \nUn joueur initie un contact qu\'il continue alors qu\'un de ses patins touche le sol en dehors de la piste. L\'adversaire bloqué ne tombe pas et ne perd pas sa position relative. L\'initiateur du contact ...\n\n[Correct] ne reçoit pas de pénalité, No Impact/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (tag) Changed Rule, (difficulty) Intermediate, (language) English, (difficulty) Expert\n \nTo: \n\nUn joueur initie un contact qu\'il continue alors qu\'un de ses patins touche le sol en dehors de la piste. L\'adversaire bloqué ne tombe pas et ne perd pas sa position relative. L\'initiateur du contact ...\n\n[Correct] ne reçoit pas de pénalité, No Impact/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(120, 1350, 1, 1475523371, 'Question Edited \n\nFrom: \n \nSi deux blockers ne tentent pas immédiatement de retourner dans la zone d’engagement après avoir été avertis, que se passe-t-il ?\n\n          Le joueur le plus éloigné de la zone d\'engagement reçoit une pénalité.\n[Correct] Les deux joueurs sont pénalisés.\n          Le joueur le plus proche de la zone d\'engagement reçoit une pénalité.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (tag) Test Question, (difficulty) Intermediate, (difficulty) Beginner\n \nTo: \n\nSi deux blockers ne tentent pas immédiatement de retourner dans la zone d’engagement après avoir été avertis, que se passe-t-il ?\n\n          Le joueur le plus éloigné de la zone d\'engagement reçoit une pénalité.\n[Correct] Les deux joueurs sont pénalisés.\n          Le joueur le plus proche de la zone d\'engagement reçoit une pénalité.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(121, 1444, 1, 1475523431, 'Question Edited \n\nFrom: \n \nLe chronomètre de pénalité démarre quand ...\n\n[Correct] le joueur est assis dans le penalty box.\n          le joueur entre dans le penalty box\n          le joueur quitte la piste.\n          le joueur reçoit la pénalité.\n\nTerms: (rule-set) WFTDA7, (difficulty) Intermediate, (tag) Test Question, (language) English, (difficulty) Beginner\n \nTo: \n\nUn joueur reçoit une pénalité ; le chronomètre de pénalité démarre quand ...\n\n          il reçoit la pénalité.\n          il quitte la piste.\n          il entre dans le penalty box\n[Correct] il est assis dans le penalty box.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(122, 1680, 1, 1475523512, 'Question Edited \n\nFrom: \n \nUn patineur initie un contact envers un adversaire après le quatrième coup de sifflet de fin de Jam, ce qui déséquilibre sévèrement cet adversaire. L\'initiateur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (difficulty) Intermediate, (language) English, (author-id) 3, (tag) Test Question, (difficulty) Beginner\n \nTo: \n\nUn patineur initie un contact envers un adversaire après le quatrième coup de sifflet de fin de Jam, ce qui déséquilibre sévèrement cet adversaire. L\'initiateur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (author-id) 3, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(123, 1347, 1, 1475524130, 'Question Edited \n\nFrom: \n \nUne situation de No Pack est créée sans impact mesurable sur le déroulement du jeu, la situation ...\n\n          entraîne une expulsion du match.\n          entraîne une pénalité.\n[Correct] n\'entraîne pas de pénalité, No Impact/No Penalty.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nUne situation de No Pack est créée sans impact mesurable sur le déroulement du jeu, la situation ...\n\n          entraîne une expulsion du match.\n          entraîne une pénalité.\n[Correct] n\'entraîne pas de pénalité, No Impact/No Penalty.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(124, 1218, 1, 1475524376, 'Question Edited \n\nFrom: \n \nUn joueur entre habituellement dans la penalty box sans prendre de précautions habituelle. A chaque entrée, une défaillance de la structure du siège et non pas par l’entrée du patineur entraîne un contact entre la chaise et une autre personne. Le joueur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (tag) Changed Rule, (difficulty) Intermediate, (difficulty) Expert, (author-id) 1304, (language) English\n \nTo: \n\nUn joueur entre de manière habituelle en penalty box sans prendre de précautions particulière. A chaque fois, une défaillance de la structure du siège entraîne un contact entre une chaise et une autre personne. Le joueur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est exclu du match.\n\nTerms: (language) English, (author-id) 1304, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1);
