(125, 1695, 1, 1475524521, 'Question Edited \n\nFrom: \n \nVrai ou faux : A team may have three blockers serving penalties in the penalty box at one time.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert, (language) English\n \nTo: \n\nVrai ou faux : Une équipe peut avoir trois blockers présents dans la penalty box en même temps.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(126, 572, 1, 1475525388, 'Question Edited \n\nFrom: \n \nOn dit qu\'un joueur chevauche la limite de la piste [straddling] quand ...\n\n[Correct] il touche le sol à la fois à l\'intérieur et à l\'extérieur de la piste.\n          il touche alternativement le sol à l\'intérieur puis à l\'extérieur de la piste.\n          il touche le sol uniquement à l\'extérieur de la piste.\n          il touche le sol uniquement à l\'intérieur de la piste.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nOn dit qu\'un joueur chevauche la limite de la piste [straddling] quand ...\n\n[Correct] il touche le sol à la fois à l\'intérieur et à l\'extérieur de la piste.\n          il touche alternativement le sol à l\'intérieur puis à l\'extérieur de la piste.\n          il touche le sol uniquement à l\'extérieur de la piste.\n          il touche le sol uniquement à l\'intérieur de la piste.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(127, 1527, 1, 1475525612, 'Question Edited \n\nFrom: \n \nL\'équipe rouge a un blocker pénalisé alors que le jammer de l\'équipe noire est dans un passage marquant mais sans avoir marqué de point. Le jammer noir prend un tour d\'avance sur le jammer rouge qui est à l\'arrière du pack. Combien de point le jammer noir gagne-t-il ?\n\n[Correct] 1\n          2\n          3\n          0\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nL\'équipe rouge a un blocker pénalisé alors que le jammer de l\'équipe noire est dans un passage marquant mais sans avoir marqué de point. Le jammer noir prend un tour d\'avance sur le jammer rouge qui est à l\'arrière du pack. Combien de point le jammer noir gagne-t-il à quand il double le jammer adverse ?\n\n          3\n          2\n[Correct] 1\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(128, 1527, 1, 1475525685, 'Question Edited \n\nFrom: \n \nL\'équipe rouge a un blocker pénalisé alors que le jammer de l\'équipe noire est dans un passage marquant mais sans avoir marqué de point. Le jammer noir prend un tour d\'avance sur le jammer rouge qui est à l\'arrière du pack. Combien de point le jammer noir gagne-t-il à quand il double le jammer adverse ?\n\n          3\n          2\n[Correct] 1\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nL\'équipe rouge a un blocker pénalisé alors que le jammer de l\'équipe noire est dans un passage marquant mais sans avoir marqué de point. Le jammer noir prend un tour d\'avance sur le jammer rouge qui est à l\'arrière du pack. Combien de point le jammer noir gagne-t-il à quand il double le jammer adverse ?\n\n          3\n          2\n[Correct] 1\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(129, 1528, 1, 1475525748, 'Question Edited \n\nFrom: \n \nVrai ou faux : un jammer marque des points d’absence de la piste quand il dépasse le jammer adverse.\n\n[Correct] Faux\n          Vrai\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert, (language) English\n \nTo: \n\nVrai ou faux : un jammer marque des points d’absence de la piste quand il dépasse le jammer adverse.\n\n[Correct] Faux\n          Vrai\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
