(131, 523, 1, 1475526315, 'Question Edited \n\nFrom: \n \nVrai ou faux : Un arbitre n\'a pas besoin de donner un avertissement à un joueur hors-jeu (Out of play) qui fait un blocage avant de lui donner une pénalité.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Beginner, (difficulty) Intermediate, (author-id) 3, (language) English\n \nTo: \n\nVrai ou faux : Un arbitre n\'a pas besoin de donner un avertissement à un joueur hors-jeu (Out of play) qui fait un blocage avant de lui donner une pénalité.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (author-id) 3, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
