(134, 854, 1, 1475526778, 'Question Edited \n\nFrom: \n \nLe Scoreboard Operator a pour rôle ...\n\n          d\'enregistrer les points signalés par les jammer referees.\n          d\'enregistrer les pénalités signalées par les arbitres.\n          de garder la trace de l’enregistrement officiel des pénalités.\n          de chronomètrer les pénalités.\n          d\'assister les arbitres en s’assurant qu’une équipe joue avec des patineurs en moins quand elle le doit.\n[Correct] d\'afficher les scores et les pénalités.\n          de siffler le début des jams.\n          de chronométrer 30 secondes entre les jams.\n          de mettre fin auxjams qui durent les deux minutes complètes.\n\nTerms: (rule-set) WFTDA7, (difficulty) Intermediate, (tag) Test Question, (language) English, (difficulty) Beginner\n \nTo: \n\nLe Scoreboard Operator a pour rôle ...\n\n          d\'enregistrer les points signalés par les jammer referees.\n          d\'enregistrer les pénalités signalées par les arbitres.\n          de garder la trace de l’enregistrement officiel des pénalités.\n          de chronomètrer les pénalités.\n          d\'assister les arbitres en s’assurant qu’une équipe joue avec des patineurs en moins quand elle le doit.\n[Correct] d\'afficher les scores et les pénalités.\n          de siffler le début des jams.\n          de chronométrer 30 secondes entre les jams.\n          de mettre fin auxjams qui durent les deux minutes complètes.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
