(136, 1539, 1, 1475526881, 'Question Edited \n\nFrom: \n \nVrai ou faux : quand un jammer inscrit son premier point lors d\'un passage marquant, il gagne un point pour chaque adversaire revenant de la penalty box devant lui.\n\n[Correct] Faux\n          Vrai\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nVrai ou faux : quand un jammer inscrit son premier point lors d\'un passage marquant, il gagne un point pour chaque adversaire revenant de la penalty box devant lui.\n\n[Correct] Faux\n          Vrai\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
