(139, 1438, 1, 1475527080, 'Question Edited \n\nFrom: \n \nUne équipe n\'aligne qu\'un seul blocker au cours d\'un jam et il reçoit une pénalité. Il y a de la place dans la penalty box, le joueur ...\n\n          est dirigé en dehors de la piste.\n[Correct] doit rester sur la piste.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert, (language) English\n \nTo: \n\nUne équipe n\'aligne qu\'un seul blocker au cours d\'un jam et il reçoit une pénalité. Il y a de la place dans la penalty box, le joueur ...\n\n[Correct] doit rester sur la piste.\n          doit rejoindre la penalty box.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(140, 1439, 1, 1475527230, 'Question Edited \n\nFrom: \n \nUne équipe n\'aligne qu\'un seul blocker au cours d\'un jam et il reçoit une pénalité. Il y a de la place dans la penalty box, le joueur est envoyé en penalty box ...\n\n[Correct] dès qu\'un autre joueur de son équipe rejoint le pack.\n          Immédiatement.\n          dès que les trois autres blockers de son équipe sont de retour sur la piste.\n          dès qu\'un autre joueur de son équipe est de retour sur la piste.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Expert, (language) English\n \nTo: \n\nUne équipe n\'aligne qu\'un seul blocker au cours d\'un jam et il reçoit une pénalité. Il y a de la place dans la penalty box, le joueur est envoyé en penalty box ...\n\n          dès que les trois autres blockers de son équipe sont de retour sur la piste.\n          immédiatement.\n[Correct] dès qu\'un autre joueur de son équipe rejoint le pack.\n          dès qu\'un autre joueur de son équipe est de retour sur la piste.\n\nTerms: (language) English, (difficulty) Expert, (tag) Test Question, (rule-set) WFTDA7\n', 1),
