(148, 1154, 1, 1475606436, 'Question Edited \n\nFrom: \n \nUn patineur fait une une tentative puissante et délibérée de bloquer un adversaire à l’arrière de manière flagrante mais manque cet adversaire. L\'initiateur du contact ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n          est pénalisé.\n[Correct] est expulsé.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Intermediate, (tag) Test Question, (difficulty) Expert\n \nTo: \n\nUn patineur fait une une tentative puissante et délibérée de bloquer un adversaire dans le dos mais manque cet adversaire. L\'initiateur du contact ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n          est pénalisé.\n[Correct] est expulsé.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(149, 1170, 1, 1475606515, 'Question Edited \n\nFrom: \n \nA partir de quel moment, un joueur qui fait tomber un adversaire à cause de sa manière de patiner sera-t-il pénalisé ?\n\n          Dès la première fois.\n          La deuxième fois lors du déroulement d’un match.\n[Correct] La troisième fois lors du déroulement d’un match.\n          La quatrième fois lors du déroulement d’un match.\n          Il n\'y a pas de limite.\n[Correct] Dès que cela devient "habituel"\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nA partir de quel moment, un joueur qui fait tomber un adversaire à cause de sa manière de patiner sera-t-il pénalisé ?\n\n          Dès la première fois.\n          La deuxième fois lors du déroulement d’un match.\n[Correct] La troisième fois lors du déroulement d’un match.\n          La quatrième fois lors du déroulement d’un match.\n          Il n\'y a pas de limite.\n[Correct] Dès que cela devient "habituel"\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
