(152, 1216, 1, 1475606666, 'Question Edited \n\nFrom: \n \nVrai ou faux : Un joueur entre habituellement dans la penalty box sans prendre de précautions habituelle. A chaque entrée, une défaillance de la structure du siège et non pas par l’entrée du patineur entraîne un contact entre la chaise et une autre personne. Le joueur reçoit une pénalité de misconduct.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Beginner, (tag) Changed Rule, (author-id) 1304\n \nTo: \n\nVrai ou faux : Un joueur entre habituellement dans la penalty box sans prendre de précautions particulière. A chaque fois, une défaillance de la structure du siège entraîne un contact entre la chaise et une autre personne. Le joueur reçoit une pénalité de la famille des Misconduct.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (author-id) 1304, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
