(165, 1519, 1, 1475609358, 'Question Edited \n\nFrom: \n \nUn jammer a marqué un point sur tous les blockers adverses et a quitté la zone d\'engagement, mettant fin à son passage marquant. Un blocker adverse chasse le jammer et se met devant le jammer. A quel moment ce dernier est-il autorisé à marquer sur le blocker de manière légale ?\n\n          Il marque un nouveau point immédiatement.\n          Immédiatement.\n[Correct] Quand le jammer est rentré dans la zone d\'engagement par l\'arrière et que le blocker est retourné dans la zone d\'engagement (sans lui prendre un tour d\'avance).\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Expert\n \nTo: \n\nUn jammer a marqué un point sur tous les blockers adverses et a quitté la zone d\'engagement, mettant fin à son passage marquant. Un blocker adverse chasse le jammer et se met devant le jammer. A quel moment ce dernier est-il autorisé à marquer sur le blocker de manière légale ?\n\n          Il marque un nouveau point immédiatement.\n          Immédiatement.\n[Correct] Quand le jammer est rentré dans la zone d\'engagement par l\'arrière et que le blocker est retourné dans la zone d\'engagement (sans lui prendre un tour d\'avance).\n\nTerms: (language) English, (difficulty) Expert, (tag) Test Question, (rule-set) WFTDA7\n', 1),
