(170, 18, 1, 1475610714, 'Question Edited \n\nFrom: \n \nQuelle est la définition de « haut contraste » au-delà de tout doute pour la surface de patinage ?\n\n          La surface de patinage est de couleur claire et les délimitations sont en rouge.\n[Correct] Il existe une grande différence visible entre la ligne de délimitation et la couleur principale de la surface du sol de façon à ce que la ligne de bordure de la piste ressorte de la surface de patinage.\n          La surface de patinage et les délimitations de la piste sont de la même couleur mais de teinte différente.\n          Il y a peu de différence viuselle entre la surface patinage et les délimitations de la piste afin que ces dernières ne soient visibles que depuis la piste.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nQuelle est la définition de « haut contraste » au-delà de tout doute pour la surface de patinage ?\n\n          Il y a peu de différence visuelle entre la surface patinage et les délimitations de la piste afin que ces dernières ne soient visibles que depuis la piste.\n          La surface de patinage est de couleur claire et les délimitations sont en rouge.\n[Correct] Il existe une grande différence visible entre la ligne de délimitation et la couleur principale de la surface du sol de façon à ce que la ligne de bordure de la piste ressorte de la surface de patinage.\n          La surface de patinage et les délimitations de la piste sont de la même couleur mais de teinte différente.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
