(172, 100, 1, 1475611079, 'Question Edited \n\nFrom: \n \nA quel moment est ce que le chronomètre redémarre après un temps-mort ?\n\n          A la fin du temps-mort en question\n[Correct] Au début du jam suivant\n          Le chronomètre ne s\'arrête pas\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nA quel moment est ce que le chronomètre de période redémarre après un temps-mort ?\n\n          A la fin du temps-mort en question\n[Correct] Au début du jam suivant\n          Le chronomètre ne s\'arrête pas\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(173, 1182, 1, 1475611173, 'Question Edited \n\nFrom: \n \nUn joueur réalise un blocage avec un coude qui s\'avère être un contact puissant atterrissant au-dessus des épaules. L\'adversaire ne tombe pas. L\'action ...\n\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n[Correct] entraîne une pénalité.\n          entraîne une expulsion\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nUn joueur réalise un contact puissant avec son coude au-dessus des épaules d\'un adversaire ; ce denier, ne tombe pas. L\'action ...\n\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n[Correct] entraîne une pénalité.\n          entraîne une expulsion\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(174, 1062, 1, 1475611287, 'Question Edited \n\nFrom: \n \nOù peut être le couvre-casque d\'un pivot avant le début d\'un jam ?\n\n          Sur le casque du joueur\n[Correct] Sur le casque du joueur ou dans sa main\n          N\'importe où sur la piste\n          Dans la main d\'un joueur de l\'équipe.\n          Dans la main du pivot ou dans celle du jammer\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Beginner\n \nTo: \n\nOù peut être le couvre-casque d\'un pivot avant le début d\'un jam ?\n\n          Dans la main d\'un joueur de l\'équipe.\n          N\'importe où sur le track.\n[Correct] Sur le casque du pivot ou dans sa main.\n          Sur le casque d\'un joueur.\n          Dans la main du pivot ou dans celle du jammer.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(175, 1062, 1, 1475611324, 'Question Edited \n\nFrom: \n \nOù peut être le couvre-casque d\'un pivot avant le début d\'un jam ?\n\n          Dans la main d\'un joueur de l\'équipe.\n          N\'importe où sur le track.\n[Correct] Sur le casque du pivot ou dans sa main.\n          Sur le casque d\'un joueur.\n          Dans la main du pivot ou dans celle du jammer.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nOù peut être le couvre-casque d\'un pivot avant le début d\'un jam ?\n\n          Dans la main d\'un joueur de l\'équipe.\n          N\'importe où sur le track.\n[Correct] Sur le casque du pivot ou dans sa main.\n          Sur le casque d\'un joueur.\n          Dans la main du pivot ou dans celle du jammer.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(176, 1658, 1, 1475611501, 'Question Edited \n\nFrom: \n \nUne situation de No Pack se crée car tous les blockers d\'une équipe se trouvent à plus de 3 mètres (10 pieds) des blockers de l\'autre équipe. Que doivent faire les patineurs du groupe arrière jusqu\'à ce qu\'un pack soit à nouveau formé ?\n\n          Avancer vers l\'avant à la vitesse qu\'ils veulent.\n          Freiner ou se mettre en roue libre.\n          Freiner.\n          Se mettre en roue libre.\n[Correct] Accélerer dans le sens horaire anti horaire.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (tag) Changed Rule, (author-id) 3, (language) English, (difficulty) Intermediate\n \nTo: \n\nUne situation de No Pack se crée car tous les blockers d\'une équipe se trouvent à plus de 3 mètres (10 pieds) des blockers de l\'autre équipe. Que doivent faire les patineurs du groupe arrière jusqu\'à ce qu\'un pack soit à nouveau formé ?\n\n          Se mettre en roue libre.\n          Freiner.\n          Freiner ou se mettre en roue libre.\n          Avancer vers l\'avant à la vitesse qu\'ils veulent.\n[Correct] Accélérer dans le sens anti-horaire.\n\nTerms: (language) English, (author-id) 3, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(177, 1525, 1, 1475611625, 'Question Edited \n\nFrom: \n \nVrai ou faux : un jammer peut marquer des points sur des blockers en dehors des limites de la piste.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (difficulty) Intermediate, (language) English, (tag) Test Question, (difficulty) Beginner\n \nTo: \n\nVrai ou faux : un jammer peut marquer des points sur des blockers qui sont en dehors des limites de la piste.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(178, 798, 1, 1475649372, 'Question Edited \n\nFrom: \n \nSi un jammer commet une action illégale au cours d\'un dépassement et ne reçoit pas de point, que peut-il faire ?\n\n          Rien jusqu\'à son prochain pass.\n[Correct] Tant qu\'il n\'a pas quitté la zone d\'engagement, il est autorisé à tenter de redépasser et marquer le point.\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Intermediate, (tag) Test Question\n \nTo: \n\nSi un jammer commet une action illégale au cours d\'un dépassement et ne reçoit pas de point, que peut-il faire ?\n\n          Rien jusqu\'à son prochain pass.\n[Correct] Tant qu\'il n\'a pas quitté la zone d\'engagement, il est autorisé à tenter de redépasser et marquer le point.\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(179, 2555, 1, 1475649549, 'Question Edited \n\nFrom: \n \nA skater is sent to the penalty box. This is their 7th penalty and thus they have now Fouled Out. They are told to remove themselves from the track area after the jam ends. They were sat in the penalty box for 35 seconds. How long does their substitute have to sit in the penalty box?\n\n[Correct] 25 seconds\n          10 seconds\n          no time\n          35 seconds\n          60 seconds\n\nTerms: \n \nTo: \n\nA skater is sent to the penalty box. This is their 7th penalty and thus they have now Fouled Out. They are told to remove themselves from the track area after the jam ends. They were sat in the penalty box for 35 seconds. How long does their substitute have to sit in the penalty box?\n\n          60 seconds\n          35 seconds\n          no time\n          10 seconds\n          25 seconds\n\nTerms: \n', 1),
(180, 1458, 1, 1475649653, 'Question Edited \n\nFrom: \n \nOù un joueur sortant de pénalisé doit-il retourner en jeu après une pénalité ?\n\n          Derrière le joueur adverse du pack le plus en arrière.\n          Derrière le joueur du pack le plus en avant.\n[Correct] Derrière le joueur du pack le plus en arrière.\n          Derrière le joueur adverse du pack le plus en avant.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (language) English, (difficulty) Expert\n \nTo: \n\nA quel endroit un joueur sortant de penalty box doit-il retourner en jeu après une pénalité ?\n\n          Derrière le joueur adverse du pack le plus en avant.\n[Correct] Derrière le joueur adverse du pack le plus en arrière.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1);
INSERT INTO `rdtom_comments` (`ID`, `Question_ID`, `User_ID`, `Timestamp`, `Text`, `Type`) VALUES
(181, 1458, 1, 1475649664, 'Question Edited \n\nFrom: \n \nA quel endroit un joueur sortant de penalty box doit-il retourner en jeu après une pénalité ?\n\n          Derrière le joueur adverse du pack le plus en avant.\n[Correct] Derrière le joueur adverse du pack le plus en arrière.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n \nTo: \n\nA quel endroit un joueur sortant de penalty box doit-il retourner en jeu après une pénalité ?\n\n          Où il veut.\n[Correct] Derrière le joueur adverse du pack le plus en arrière.\n          Derrière le joueur adverse du pack le plus en avant.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(182, 1172, 1, 1475649714, 'Question Edited \n\nFrom: \n \nUn joueur utilise un langage ou de gestes obscènes, outrageants ou injurieux dirigés à l’égard d’une mascotte, d’un présentateur, d’un spectateur ou de toute autre personne faisant partie de l’organisation d’un événement. Le joueur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est expulsé.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (author-id) 1304, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nUn joueur utilise un langage ou des gestes obscènes, outrageants ou injurieux dirigés à l’égard d’une mascotte. Le joueur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est expulsé.\n\nTerms: (language) English, (author-id) 1304, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(183, 699, 1, 1475649743, 'Question Edited \n\nFrom: \n \nA skater pulls on the helmet of another skater. This is a/an:\n\n          No Impact/No Penalty\n          Minor Penalty\n          Major Penalty\n[Correct] Expulsion\n\nTerms: (rule-set) WFTDA5, (tag) Test Question, (language) English\n \nTo: \n\nA skater pulls on the helmet of another skater. This is a/an:\n\n          Major Penalty\n          Minor Penalty\n          No Impact/No Penalty\n          Expulsion\n\nTerms: \n', 1),
(184, 369, 1, 1475649757, 'Question Edited \n\nFrom: \n \nA skater makes contact with the head of another skater who is not wearing a helmet. This is a/an:\n\n          Major Penalty\n          Minor Penalty\n          No Impact/No Penalty\n[Correct] Expulsion\n\nTerms: (rule-set) WFTDA5, (tag) Test Question, (language) English\n \nTo: \n\nA skater makes contact with the head of another skater who is not wearing a helmet. This is a/an:\n\n          No Impact/No Penalty\n          Minor Penalty\n          Major Penalty\n          Expulsion\n\nTerms: \n', 1),
(185, 518, 1, 1475649773, 'Question Edited \n\nFrom: \n \nA player skates clockwise and gets distracted by somebody in the crowd. They accidentally forcefully block a fellow teammate. This is a/an:\n\n[Correct] No Impact/No Penalty\n          Minor Penalty\n          Major Penalty\n          Expulsion\n\nTerms: (rule-set) WFTDA5, (tag) Test Question, (language) English\n \nTo: \n\nA player skates clockwise and gets distracted by somebody in the crowd. They accidentally forcefully block a fellow teammate. This is a/an:\n\n          Major Penalty\n          Minor Penalty\n          No Impact/No Penalty\n          Expulsion\n\nTerms: (language) English, (rule-set) WFTDA5\n', 1),
(186, 2450, 1, 1475649789, 'Question Edited \n\nFrom: \n \nA skater habitually enters the penalty box without showing proper precaution. Each time they do, structural failure of the seat, not the entry of the skater, causes contact by the skater\\\'s seat to another person. This can result in a/an:\n\n[Correct] Major Penalty\n          No Impact/No Penalty\n          Expulsion\n\nTerms: (language) English, (author-id) 1304, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA6\n \nTo: \n\nA skater habitually enters the penalty box without showing proper precaution. Each time they do, structural failure of the seat, not the entry of the skater, causes contact by the skater\'s seat to another person. This can result in a/an:\n\n          No Impact/No Penalty\n          Major Penalty\n          Expulsion\n\nTerms: (rule-set) WFTDA6\n', 1),
(187, 673, 1, 1475649803, 'Question Edited \n\nFrom: \n \nA skater chooses not to leave the floor after fouling out. This is a/an:\n\n          No Impact/No Penalty\n          Minor Penalty\n          Major Penalty\n[Correct] Expulsion\n\nTerms: (rule-set) WFTDA5, (tag) Test Question, (language) English\n \nTo: \n\nA skater chooses not to leave the floor after fouling out. This is a/an:\n\n          Major Penalty\n          Minor Penalty\n          No Impact/No Penalty\n          Expulsion\n\nTerms: (rule-set) WFTDA5\n', 1),
(188, 1157, 1, 1475649841, 'Question Edited \n\nFrom: \n \nTout contact au-dessus des épaules d’un adversaire ne portant pas de casque ...\n\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n          entraîne une pénalité.\n[Correct] entraîne une expulsion\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (language) English\n \nTo: \n\nTout contact au-dessus des épaules d’un adversaire ne portant pas de casque ...\n\n          n\'entraîne pas de pénalité, No Impact/No Penalty.\n          entraîne une pénalité.\n[Correct] entraîne une expulsion\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(189, 2391, 1, 1475649884, 'Question Edited \n\nFrom: \n \nA skater illegally blocks a star pass. This is a/an:\n\n          Expulsion\n[Correct] Major Penalty\n          No Impact/No Penalty\n\nTerms: (difficulty) Intermediate, (rule-set) WFTDA6, (tag) Test Question, (difficulty) Beginner, (language) English\n \nTo: \n\nA skater illegally blocks a star pass. This is a/an:\n\n          No Impact/No Penalty\n          Major Penalty\n          Expulsion\n\nTerms: (rule-set) WFTDA6\n', 1),
(190, 1537, 1, 1475663928, 'Question Edited \n\nFrom: \n \nVrai ou faux : lors d\'un passage marquant, quand un jammer inscrit son premier point, il marque également un point pour tous les adversaires revenant de la penalty box derrière lui.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Beginner\n \nTo: \n\nVrai ou faux : lors d\'un passage marquant, quand un jammer inscrit son premier point, il marque également un point pour tous les adversaires revenant de la penalty box derrière lui.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(191, 291, 1, 1475663984, 'Question Edited \n\nFrom: \n \nVrai ou faux : aucune règle n\'impose un ordre particulier d\'alignement des blockers entre les lignes de jammer et de pivot, du moment que le pivot ne se trouve pas sur la ligne de pivot.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (difficulty) Intermediate, (language) English, (tag) Test Question, (difficulty) Beginner\n \nTo: \n\nVrai ou faux : aucune règle n\'impose un ordre particulier d\'alignement des blockers entre les lignes de jammer et de pivot, du moment que le pivot ne se trouve pas sur la ligne de pivot.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(192, 1535, 1, 1475664587, 'Question Edited \n\nFrom: \n \nUn blocker contre qui le jammer n\'a pas encore inscrit de point est envoyé en pénalité. Le jammer adverse inscrit son premier point sur un blocker adverse, combien de points remporte-t-il ?\n\n          1\n[Correct] 2\n          3\n          4\n          5\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nUn blocker contre qui le jammer n\'a pas encore inscrit de point est envoyé en pénalité. Le jammer adverse remporte son premier point sur un blocker adverse, combien de points inscrit-il automatiquement ?\n\n          1\n[Correct] 2\n          3\n          4\n          5\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(193, 1169, 1, 1475664662, 'Question Edited \n\nFrom: \n \nAvec un de ses patins, un joueur initie un contact en dessous des zones cibles légales provoquant le déséquilibre d’un adversaire ce qui le fait tomber. L\'initiateur ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est expulsé.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (difficulty) Beginner, (tag) Test Question\n \nTo: \n\nAvec un de ses patins, un joueur initie un contact en dessous des zones cibles légales provoquant le déséquilibre d’un adversaire ce qui le fait tomber. L\'initiateur ...\n\n[Correct] reçoit une pénalité.\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n          est expulsé.\n\nTerms: (language) English, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(194, 1660, 1, 1475664932, 'Question Edited \n\nFrom: \n \nUne situation de No Pack se crée car tous les blockers d\'une équipe se trouvent hors des limites. L\'autre équipe doit ...\n\n[Correct] accélerer jusqu\'à ce qu\'un membre de l\'équipe adverse puisse rentrer légalement sur la piste.\n          s\'arrêter et attendre jusqu\'à ce qu\'un membre de l\'équipe adverse puisse rentrer légalement sur la piste.\n          patiner dans le sens horaire afin d\'empêcher les joueurs  adverses  de revenir sur la piste.\n\nTerms: (rule-set) WFTDA7, (language) English, (author-id) 3, (tag) Changed Rule, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nUne situation de No Pack se crée car tous les blockers d\'une équipe se trouvent hors des limites. L\'autre équipe doit ...\n\n[Correct] accélerer jusqu\'à ce qu\'un membre de l\'équipe adverse puisse rentrer légalement sur la piste.\n          s\'arrêter et attendre jusqu\'à ce qu\'un membre de l\'équipe adverse puisse rentrer légalement sur la piste.\n          patiner dans le sens horaire afin d\'empêcher les joueurs  adverses  de revenir sur la piste.\n\nTerms: (language) English, (author-id) 3, (difficulty) Expert, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(195, 1369, 1, 1475665070, 'Question Edited \n\nFrom: \n \nUn joueur debout et patinant retourne complètement dans les limites de la piste (après avoir été hors des limites) en améliorant sa position par rapport à un adversaire à terre. Le joueur ...\n\n[Correct] ne reçoit pas de pénalité, No Pass/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question\n \nTo: \n\nUn joueur debout et patinant retourne complètement dans les limites de la piste (après avoir été hors des limites) en améliorant sa position par rapport à un adversaire à terre. Le joueur ...\n\n[Correct] ne reçoit pas de pénalité, No Pass/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(196, 1445, 1, 1475665485, 'Question Edited \n\nFrom: \n \nVrai ou faux : le chronomètre de pénalité ne tourne que quand le chronomètre de jam tourne.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (difficulty) Beginner, (tag) Test Question, (difficulty) Intermediate, (language) English\n \nTo: \n\nVrai ou faux : le chronomètre de pénalité ne tourne que quand le chronomètre de jam tourne.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(197, 1556, 1, 1475665544, 'Question Edited \n\nFrom: \n \nVrai ou faux : à la fin d\'un jam, le jammer reçoit un point par blocker adverse situé devant la zone d\'engagement et surlequel il n\'a pas encore inscrit de point lors du passage marquant.\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nVrai ou faux : à la fin d\'un jam, le jammer reçoit un point par blocker adverse situé devant la zone d\'engagement et surlequel il n\'a pas encore inscrit de point lors du passage marquant.\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(198, 1506, 1, 1475665718, 'Question Edited \n\nFrom: \n \nAvec qui le Head Referee doit discuter avant d\'expulser un joueur ?\n\n[Correct] Le capitaine de l\'équipe du joueur.\n          Personne.\n          L\'entraîneur de l\'équipe du joueur.\n          Les joueurs.\n          Les autres arbitres.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nAvec qui le Head Referee doit discuter avant d\'expulser un joueur ?\n\n          Les joueurs.\n          L\'entraîneur de l\'équipe du joueur.\n[Correct] Personne.\n          Le capitaine de l\'équipe du joueur.\n          Les autres arbitres.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(199, 474, 1, 1475665901, 'Question Edited \n\nFrom: \n \nVrai ou faux : il n\'est pas possible de bloquer de manière légale un joueur ayant sauté et ne touchant plus la piste.\n\n[Correct] Faux\n          Vrai\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Intermediate, (tag) Test Question\n \nTo: \n\nVrai ou faux : il n\'est pas possible de bloquer de manière légale un joueur ayant sauté et ne touchant plus la piste.\n\n[Correct] Faux\n          Vrai\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(200, 1177, 1, 1475666024, 'Question Edited \n\nFrom: \n \nUn joueur tente de frapper un adversaire afin de le faire tomber mais manque son action. Il ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n          est pénalisé.\n[Correct] est expulsé.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert\n \nTo: \n\nUn joueur tente de frapper un adversaire afin de le faire tomber mais manque son action. Il ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n          est pénalisé.\n[Correct] est expulsé.\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(201, 1337, 1, 1475669254, 'Question Edited \n\nFrom: \n \nVrai ou faux : si un joueur quitte la piste en raison d\'une blessure, il sera pénalisé pour avoir patiné en dehors de la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Beginner\n \nTo: \n\nVrai ou faux : si un joueur quitte la piste en raison d\'une blessure, il sera pénalisé pour avoir patiné en dehors de la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (language) English, (difficulty) Beginner, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(202, 1464, 1, 1475669437, 'Question Edited \n\nFrom: \n \nVrai ou faux : si un jammer est éligible pour marquer des points, il gagne immédiatement les points de dépassement des blockers qui sont hors de la zone d’engagement, derrière le jammer, au moment de son retour sur la piste\n\n[Correct] Vrai\n          Faux\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (difficulty) Expert, (language) English\n \nTo: \n\nVrai ou faux : si un jammer est éligible pour marquer des points, il gagne immédiatement les points de dépassement des blockers qui sont hors de la zone d’engagement, derrière le jammer, au moment de son retour sur la piste\n\n[Correct] Vrai\n          Faux\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(203, 1448, 1, 1475669543, 'Question Edited \n\nFrom: \n \nSi un patineur en penalty box se met debout sur ses patins avant qu’il ne lui reste 10 secondes sur le chronomètre de pénalité, ...\n\n          le chronomètre de pénalité continue quand même.\n[Correct] le chronomètre de pénalité est arrêté jusqu’à ce que le patineur soit assis.\n          il reçoit une nouvelle pénalité.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Intermediate, (language) English\n \nTo: \n\nSi un patineur en penalty box se met debout sur ses patins avant qu’il ne lui reste 10 secondes sur le chronomètre de pénalité, ...\n\n          le chronomètre de pénalité continue quand même.\n[Correct] le chronomètre de pénalité est arrêté jusqu’à ce que le patineur soit assis.\n          il reçoit une nouvelle pénalité.\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(204, 176, 1, 1475783150, 'Question Edited \n\nFrom: \n \nVrai ou faux : un jammer qui est pénalisé au cours de son initial pass peut devenir lead jammer quand il retourne sur la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (rule-set) WFTDA7, (language) English, (difficulty) Intermediate, (difficulty) Expert, (tag) Test Question\n \nTo: \n\nVrai ou faux : un jammer qui est pénalisé au cours de son passage initial [initial pass] peut devenir lead jammer quand il retourne sur la piste.\n\n          Vrai\n[Correct] Faux\n\nTerms: (language) English, (difficulty) Expert, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(205, 1343, 1, 1476004910, 'Question Edited \n\nFrom: \n \nUn joueur coupe à travers la zone intérieure de la piste d\'une manière qui raccourcit substantiellement la distance du tour. Il ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (tag) Test Question, (difficulty) Beginner, (tag) Changed Rule, (language) English, (difficulty) Intermediate\n \nTo: \n\nUn joueur coupe à travers la zone intérieure de la piste de telle sorte qu\'il raccourcit substantiellement la distance du tour. Il ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (difficulty) Intermediate, (difficulty) Beginner, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(206, 1351, 1, 1476005000, 'Question Edited \n\nFrom: \n \nUn patineur hors-jeu (Out of play) touche un adversaire ce qui fait osciller ce dernier sur ces patins mais sans qu\'il ne tombe ou perde sa position établie. L\'initiateur du contact ...\n\n[Correct] ne reçoit pas de pénalité, No Impact/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nUn patineur hors-jeu (Out of play) touche un adversaire ce qui le fait vaciller sur ces patins mais sans qu\'il ne tombe ou perde sa position établie. L\'initiateur du contact ...\n\n[Correct] ne reçoit pas de pénalité, No Impact/No Penalty.\n          reçoit une pénalité.\n          est exclu du match.\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Test Question, (rule-set) WFTDA7\n', 1),
(207, 1151, 1, 1476005050, 'Question Edited \n\nFrom: \n \nUn patineur touche le dos d\'un adversaire ce qui fait osciller ce dernier sur ces patins puis sortir de la piste sans qu\'il tombe. L\'initiateur du contact ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est expulsé.\n\nTerms: (rule-set) WFTDA7, (language) English, (tag) Changed Rule, (tag) Test Question, (difficulty) Intermediate\n \nTo: \n\nUn patineur touche le dos d\'un adversaire ce qui le fait vaciller puis sortir de la piste sans qu\'il ne tombe. L\'initiateur du contact ...\n\n          ne reçoit pas de pénalité, No Impact/No Penalty.\n[Correct] est pénalisé.\n          est expulsé.\n\nTerms: (language) English, (difficulty) Intermediate, (tag) Changed Rule, (tag) Test Question, (rule-set) WFTDA7\n', 1);
INSERT INTO `rdtom_forum_posts` (`ID`, `Thread_ID`, `Topic_ID`, `Text`, `Timestamp`, `Creator_User_ID`, `Edited_Timestamp`) VALUES
(14, 8, 2, 'Hark, a forum!\r\n\r\nFinally, after days of work and several cups of coffee, the Test O\\\'Matic\\\'s forum now exists. A place for everyone to chat about the rules, the site, and derby in general. \r\n\r\nIt\\\'s custom-made by me to fit the site, and it\\\'s very bare-bones right now. My goal is to update it as we go, taking feedback from you lot on what you want sorted soonest. What do we need first; embedded pictures of kittens, editing posts, allowing quotes, hyper-links, email reminders, nice formatting etc. I want to add all these things eventually, but they have to be done in an order.\r\n\r\nThese updates will also be completed alongside the larger updates to the site in general, and I\\\'m hoping the forum will become a very useful feedback mechanism for all that.\r\n\r\nPlus, we can use the forum for rules clarifications and questions. We\\\'re all learning as we go, and I\\\'d like this forum to become a space where asking stupid questions is the norm.\r\n\r\nSo, hi! I\\\'m Sausage Roller, the guy who made the site. Welcome to the forum.\r\n\r\nIntroduce yourself here: http://rollerderbytestomatic.com/forum/who-are-you', 1363625261, 3, 1364058868),
(15, 9, 3, 'There\\\'s a few things I really want to get into the forum asap, but I\\\'m just me, is there anything you\\\'d like to see added?\r\n\r\n- Ability to edit posts [Done!]\r\n- Allow hyper-links [Done!]\r\n- Embedded images\r\n- Signatures\r\n- Fancy formatting, things like bold, italics, lists etc.', 1363625555, 3, 1364059121),
(16, 10, 4, 'Avatars used on the forum use the Gravatar system. You need an email address registered with the site (in your profile), then use gravatar.com to get your avatar set up.\r\n\r\nThis is way easier than the RDTOM server hosting all the avatar images.', 1363626033, 3, 0),
(17, 11, 8, 'Hello!\r\n\r\nI\\\'m John Kershaw, aka Sausage Roller. I made the Test O\\\'Matic when I was learning the rules, getting ready for my first min-skills assessment. I\\\'m pleased to say I passed first time (but only just, I got the lowest score possible that could be classed as a \\"pass\\").\r\n\r\nI\\\'m the current Training Manager for Manchester Roller Derby, the UK\\\'s first co-ed derby league and one of the biggest leagues in the country, plus we\\\'re and one of only two MRDA leagues in the UK. \r\n\r\nI skate for New Wheeled Order (men\\\'s A team) and played in the first ever inter-continental merby game in Nov 2012 (NWO vs NYSE). I\\\'m predominately a pivot/loud-mouth-blocker and get very few penalties. At our league\\\'s scrimmages there\\\'s a \\"Sausage Award\\" for the skater who gets the fewest penalties. I can still count on two hands ever Major I\\\'ve got in every public game I\\\'ve played. I\\\'ve also now just jinxed myself by writing that and will proceed to foul out of every game ever.\r\n\r\nI\\\'m a freelance web developer with a procrastination problem; hence this site existing.\r\n\r\nSup!', 1363626944, 3, 0),
(18, 9, 3, 'Oh also, there\\\'s no pagination. Meaning if the forum gets busy we\\\'ll get loooong pages, until I sort that.', 1363627280, 3, 0),
(19, 12, 8, 'I\\\'m Cornish Knocker. I skate for Manchester Roller Derby\\\'s Furies (women\\\'s B team). I am currently procrastinating as I am writing a job application...', 1363627506, 376, 0),
(20, 9, 3, 'I want view counts on posts, for narcissistic reasons.', 1363628739, 3, 0),
(21, 13, 8, 'Hiiiiiiiii :D', 1363643014, 601, 0),
(22, 13, 8, 'I know you!', 1363646519, 3, 0),
(23, 14, 6, 'Here\\\'s a (douchbag) tactic I think might work:\r\n\r\nIt\\\'s the start of your power jam and you\\\'ve got the majority of your power jam left. You give the Pivot panty to a blocker (let\\\'s call them Green #4) with a clean slate, and take the back line with your 4 blockers. Every blocker false-starts by standing on the line.\r\n\r\nWhistle!\r\n\r\nEvery blocker on your team has false-started and is thus a lap ahead. There can not be a pack. Penalty goes to the Pivot as per 6.13.37 (the rule which is pretty specific to this very instance).\r\n\r\nSimultaneous ref calls:\r\n\r\n\\"No Pack!\\"\r\n\\"Green #1 False start\\"\r\n\\"Green #2 False start\\"\r\n\\"Green #3 False start\\"\r\n\\"Green #4 Illegal Procedure Major\\"\r\n\r\nYour Jammer can not be touched by the opponents or it\\\'ll be Out of Play penalties for them. All your blocker skate off clockwise to avoid their False-start penalties becoming Majors. \r\n\r\nYou lose a Pivot to the bin, chances are opponents get a skater in the bin for OOP, plus be confused as hell.\r\n\r\nIf the opponents also just stand their being confused, there\\\'s a chance they\\\'ll get a failure to reform.\r\n\r\nOne case of a \\"worth it\\" penalty? If it wasn\\\'t such a dick move.', 1363875869, 3, 0),
(24, 15, 6, 'We\\\'re all used to the 4 wall v 4 wall, at the Jammer line, starts. What would happen if the front team swung round 90 degrees and lined up own the middle of the track.\r\n\r\nYour Jammer lets the other pick a side, then goes the other way. You wait until the Opposing Jammer has committed then sweep sideways. Your Jammer goes up against 2 or 3 opponents, their Jammer goes up against 4 of you and 1 or 2 trapped team-mates. Enough to give you that extra advantage you need to get lead.', 1363876493, 3, 0),
(25, 16, 8, 'And I\\\'m nowhere near Manchester. ', 1363894725, 3455, 0),
(26, 16, 8, 'I can\\\'t tell if we would work together, or become each other\\\'s arch nemesis, or swap depending on the circumstances.', 1364052539, 3, 0),
(27, 17, 3, 'After having the poll up on the site for a few weeks, the results to the question \\"Which new features would you most like to see added to the Roller Derby Test O\\\'Matic?\\" are:\r\n\r\n\r\n[12.3%] Other rule sets (e.g. USARS, WORD) \r\n \r\n[11.5%] An Android app \r\n\r\n[10.6%] Questions with images (ref hand signals, diagrams etc.) \r\n\r\n[10.1%] Filtering on what questions you\\\'re being given (difficulty, topic etc.) \r\n\r\n[10.1%] More detailed stats showing what sections you\\\'re good/bad at \r\n\r\n[9.3%] Discussion areas to discuss specific questions, rules, and the site in general \r\n\r\n[9.3%] User submitted (and moderated) questions \r\n\r\n[9.3%] An iPhone/iPad app \r\n\r\n[8.8%] Other languages \r\n\r\n[8.8%] Questions for officials (refs & NSOs) \r\n\r\n[0%] An updated page layout and design\r\n\r\n[0%] A support or donations page', 1364056105, 3, 1364057997),
(29, 16, 8, 'I vote option #3. Nemeses who go for beers afterwards. ', 1364156030, 3455, 0),
(30, 15, 6, 'I like it. I don\\\'t know if it would work, but I like it. ', 1364156139, 3455, 0),
(31, 18, 6, 'The situation:\r\n\r\nOpposing Jammer has got lead (oh noes!) and your jammer is stuck behind a wall still on their initial pass. You are in front of the wall. You turn around (skating backwards), reach through the wall, and grab your jammer. Your jammer goes limp. You drag them forwards, through the wall.\r\n\r\nYou can not block a downed skater. You can assist a downed team-mate. No-pass/no-penalty on the entire pack for your jammer and they\\\'re out!', 1364224651, 3, 0),
(32, 18, 6, 'Friction would be the enemy here. But if your jammer coated her kneepad(s) in non-stick cooking spray....', 1364228373, 3455, 0),
(33, 19, 2, 'Questions based on the USARS (USA Roller Sports) rules will soon be added to the Roller Derby Test O\\\'Matic\\\'s database of questions.\r\n\r\nAfter it became apparent that many people want the RDTOM to cover more rule sets (it was the #1 most requested new feature in our recent user poll) I started looking into our options, with USARS being the obvious next step.\r\n\r\nI\\\'m pleased to say that the green light has been lit and we can begin writing questions! If you are a USARS official or skater, and would to contribute, please get in touch via contact@rollerderbytestomatic.com.\r\n\r\nQuestions covering the rule set will appear on the site in the next few weeks and months.\r\n\r\nOn a personal note, the \\"Pivot out to Jam\\" hand signal (as found in the Hand Signals section of the rules) is my favourite ref hand signal + verbal cue combo.\r\n\r\nUSARS Roller Derby homepage: http://www2.teamusa.org/USA-Roller-Sports/Roller-Derby.aspx\r\nUSARS rule book: http://usars.info/rules/derby/2013/2013%20Roller%20Derby%20Rule%20Book.pdf', 1364233669, 3, 0),
(34, 18, 6, 'If they take a knee with weight on their wheels rather than their knee, pulling is easy enough.', 1364234151, 3, 0),
(35, 20, 9, 'It\\\'s not hard, and it\\\'s a really useful tactic for when you\\\'re jammer is broken/stuck/grumpy?', 1364234726, 3, 0),
(36, 20, 9, 'I\\\'ve asked that same question many a time. Then Mrs Cobra Kai tells me to stop being so obsessed with them and finish doing the dishes. ', 1364310266, 3455, 0),
(37, 21, 2, 'http://rollerderbytestomatic.com/api/\r\n\r\nVersion 0.1 is pretty much set in stone at this point, the only remaining update that may be coming is an optional parameter where you can say who you are and what you\\\'re app is called (for data tracking purposes). Failure to include this parameter might result in cached and thus inaccurate-but-still-functional.\r\n\r\nBut, other than that V0.1 is working well. It\\\'s what\\\'s being used on the happy/sad cat testing page: http://rollerderbytestomatic.com/cat', 1364399742, 3, 0),
(38, 22, 2, 'Specifically, at the end of this link:\r\n\r\nhttps://play.google.com/store/apps/details?id=com.rollerderbytestomatic.lite\r\n\r\nSource code for the app (HTML5 based) is here:\r\n\r\nhttps://github.com/RDTOM/RDTOM-AppLite\r\n\r\nIt\\\'s all built on PhoneGap, and is very basic. If you have any feedback, let me know!', 1365071579, 3, 1365081813),
(39, 23, 9, 'So there\\\'s this question in the database:\r\n\r\n\\"A skater accidentally blocks a member of their own team from out of play and causes the receiving skater to fall. This is a/an:\\"\r\n\r\nSomebody has pointed out (via a report) that a \\"block\\" is defined as between a skater and an opponent, so the wording in the question is wrong http://wftda.com/rules/20130101/section/11\r\n\r\nSo my question is; if you think the other skater is an opponent, but they\\\'re not, is your action a Block? If it\\\'s not a block, is it an \\"attempted\\" block, or something else?', 1365088528, 3, 0),
(40, 24, 2, 'There\\\'s not yet an iOS version of the app (there\\\'s plans, be patient!) but that doesn\\\'t mean you\\\'re stuck. \r\n\r\nIf you navigate to http://app.rollerderbytestomatic.com in Safari then select \\"Add to Home Screen\\" from the menu, you get something which is just as good as the real thing.', 1365093475, 3, 0),
(41, 23, 9, 'You\\\'re attempting to block, but ending up with a friendly-fire incident. ', 1365124234, 3455, 0),
(42, 25, 2, 'I\\\'m pleased to announce that the RDTOM App will soon be arriving on iOS!\r\n\r\nAndroid and iOS both require paid-for developer licenses (Android is £25 one off, iOS is $99 per year) and up until now I\\\'ve only had an Android licence. \r\n\r\nI was going to make a Kickstarter to get the required $99 needed for the iOS versions of the apps, but have scrapped that idea in favour of simply paying for it myself. Partly because I\\\'m a freelance developer (hire me!) so will use the license for other projects, partly because I\\\'ve paid for everything so far and why change, and partly because it prevents anyone feeling owed, or me feeling indebted. \r\n\r\nWhich brings me to the second part of this news: There will soon be TWO apps:\r\n\r\nThe \\"Roller Derby Test O\\\'Matic Lite\\" app, which we\\\'re all currently using, will continue to get a few small feature updates and remain FREE. A second \\"Roller Derby Test O\\\'Matic\\" app with all the features of the website (and possibly more) will soon be available on all devices, and priced at around £1.49 ($2.49ish).\r\n\r\nProfit made will go back into developing more features, as well as supporting the website, API and my coffee addiction. Anything made beyond that will cover the cost of my private jet & underground lair.\r\n\r\nThe app is built using HTML5 and a service called PhoneGap which allows you to port apps built like this to a bunch of different devices really easily. The Lite app will remain Open Source & continue to use the public API. The new, paid-for app will use a more advanced version of the API, able to provide your user accounts and tests.\r\n\r\nLinks:\r\nSource code for the \\"Lite\\" app: https://github.com/RDTOM/RDTOM-AppLite\r\nAPI Documentation: http://rollerderbytestomatic.com/api/\r\nKittens: http://www.tumblr.com/tagged/kitten%20gifs\r\nPhoneGap: http://phonegap.com/\r\nRDTOM\\\'s Facebook page: https://www.facebook.com/RollerDerbyTestOMatic\r\nMy portfolio: http://jkershaw.com/', 1365442927, 3, 1365444076),
(43, 26, 2, 'The site\\\'s been a bit sluggish recently, namely the database is creaking. This is pretty much entirely down to the fact every response on the web is saved for stats gathering purposes, and the number of responses is HUGE. You can see some basic stats on the data here: http://rollerderbytestomatic.com/stats/\r\n\r\nWith more than 3.5 million responses, trawling that data is getting slow. To alleviate the issues, all responses older than 60 days will be archived. The data is there and can still be used, but in most day-to-day operations on the site only the last couple of month\\\'s of your data will be available.', 1366098606, 3, 0),
(44, 27, 2, 'A few people have reported the correct answer being missing from questions. After several hours of head-scratching I\\\'ve worked out it\\\'s caused by bad data being downloaded from the server. Probably.\r\n\r\nThe fix: As soon as you next let the app update itself with the latest versions of all the questions (as happens automatically whenever you\\\'re online and the app starts) it\\\'ll sort itself out.', 1366139324, 3, 0),
(45, 28, 3, 'I would love to be able to search the question pool by keyword and filter by difficulty.', 1366208102, 3313, 0),
(46, 28, 3, 'Ooh, good idea!\r\n\r\nJust to see the questions, or so you can be tested on only questions with the keyword listed in them?', 1366275385, 3, 0),
(47, 29, 2, 'Exciting times indeed! The Android App has been updated to V0.3, which brings a couple of noticeable improvements (and a bunch of unnoticeable ones):\r\n\r\n- The related section of the rules is now shown next to the correct answer\r\n- The App loads much faster\r\n\r\nThis version of the App (0.3) is also the first iOS Release Candidate. Meaning if there\\\'s no major bugs found in it, this will be the version which makes its way over to iPhones and the like in a few days.\r\n\r\nPlans for the next version are already in place, and it will likely be version 1.0 (not 0.4), completing the \\"Lite\\" App. Following this I\\\'ll be continuing to work on the paid Minimum Skills multi-platform App (no updates on that currently), and the paid RDTOM App which will have all the fancy-pants features you want.\r\n\r\nThese future updates will go hand-in hand with version 0.2 of the API. Documentation on the API available at http://rollerderbytestomatic.com/API and if you\\\'d like to use it, drop me an email (contact@rollerderbytestomatic.com).', 1366978508, 3, 0),
(48, 21, 2, 'The documentation now has API V0.2 details on it. These are subject to change, and not completed.', 1367079651, 3, 0),
(49, 28, 3, 'Sometimes Im trying to think of a question me and other refs are debating and have no way to find it!', 1367239930, 3313, 0),
(50, 30, 3, 'Easy\r\nIntermediate\r\nHard\r\nMixed\r\n\r\n?', 1367239998, 3313, 0),
(51, 14, 6, 'You could have all 4 blockers line up behind the jammers and have the same effect with a longer \\"no pack\\" time. WFTDA confirmed to me that \\"yielding skaters\\" cannot be called for out of play or failure to reform/return.', 1367252016, 3313, 0),
(52, 28, 3, 'I have a search facility on the Admin page, but it\\\'s really clunky to use, hence it not being public. Worse case as a temp fix, you can load up http://rollerderbytestomatic.com/questions which lists every question in the database, and do a ctrl-F5 for search.', 1367273525, 3, 0),
(53, 14, 6, 'Who would the blockers be yielding to?', 1367274027, 3, 0),
(54, 14, 6, 'Green #1, 2, & 3 would have to yield to the blockers on the other team. aka they cannot skate forward until they are passed.', 1367332153, 3313, 0),
(55, 28, 3, 'thanks!', 1367332233, 3313, 0),
(56, 14, 6, 'By having green 1,2,3 & 4 line up behind the jammers, it would take longer for the other team to reform the pack, allowing the jammer to skate longer untouched.', 1367332422, 3313, 0),
(57, 14, 6, 'If you stand on the line, after the jammers pass you, your yield is complete (maybe 10 seconds)and you must then join the pack.\r\n\r\nIf you stand behind the jammers the \\"yield\\" would take longer and thus take longer to reform.\r\n\r\nI\\\'m assuming that yeilding must be to all skaters behind the offending skater.', 1367332653, 3313, 0),
(58, 14, 6, 'Jammers included.', 1367332904, 3313, 0),
(59, 14, 6, 'If you\\\'re a Blocker false starting by being behind the Jam line, you can\\\'t yield as you\\\'re effectively a lap ahead. Instead you must either stand still and wait for the pack to catch up, or skate clockwise to rejoin. Meaning it\\\'ll take even longer!', 1367332907, 3, 0),
(60, 14, 6, 'In other words, skaters can be anywhere on the track that isn\\\'t between the pivot and jammer line to do this strategy.', 1367333652, 3313, 0),
(61, 14, 6, 'You want it to take longer....the longer there is a no pack, the longer your jammer can accrue points untouched.', 1367333829, 3313, 0),
(62, 14, 6, 'I\\\'m not entirely sure that false starting blockers are a lap ahead, because if they were they would not be able to enter the EZ from the rear, which I see them do, which means they are not a lap ahead. At least thats how I see it.', 1367334136, 3313, 0),
(63, 14, 6, 'When I see a false start called on a blocker on the jam line, they freeze, then join the pack from the rear after the yield. If they were a lap ahead, they would not be able to do this.', 1367334289, 3313, 0),
(64, 14, 6, 'Related rule: \\"6.13.22 - A false start by a Jammer or Blocker who does not yield advantage. The Jammer or Blocker who committed the false start must stop all forward motion until the opposing Jammer or Blocker(s) takes the lead by passing the false-starting Blocker or Jammer.\\"\r\n\r\nFor blockers at the start of the jam, the lap starts and ends at the jam line. So, they have to wait their until an opposing blocker has taken a lead. Hence most blockers when they false start skate clockwise & passed one opposing blocker, to yield.\r\n\r\nIf a false starting blocker is warned, then skates even a fraction forwards before an opposing blocker has passed them, that\\\'s a Major IP. If Blockers and standing there for a few seconds, then carrying on skating forwards, the refs should be issuing IP Majors.\r\n\r\nThis gets fun for this tactic, because if everyone on a team false-starts, everyone on the team can then suddenly skate off in the clockwise direction.', 1367336096, 3, 1367348947),
(65, 31, 2, 'Have fixed a bug preventing editing posts on the forum.', 1367348976, 3, 0),
(66, 14, 6, 'Looks like your right. Didn\\\'t know the jam line put you ahead of the pack. I retract all of my suggestions! :)\r\n\r\nWhen you say \\"skate off\\" I\\\'m assuming you mean on the track, because if it is off you are still subject to skating out of bounds even while yielding and going clockwise.', 1367412011, 3313, 1367412062),
(67, 30, 3, 'Sausage Roller!', 1367421579, 3313, 1367421609),
(68, 30, 3, 'I\\\'ve genuinely no idea. I\\\'m not part of a WFTDA league (though am with an MRDA team). I know the sample test they put out was super easy, but I\\\'ve no idea about the real test. Personally, I\\\'d go for Mixed as that\\\'s probably about right.', 1367425054, 3, 0),
(69, 14, 6, 'I mean\\\'t clockwise, reverse direction. If everyone skated off the track, that\\\'d be a whole other tactic!', 1367425112, 3, 0),
(70, 28, 3, 'It would also be handy to sort the questions by rule section. If a person knows they need more work on penalties, for example, they can opt to answer random questions from only that section. ', 1367488578, 3443, 0),
(71, 30, 3, 'Sausage Roller, I think Loredo is referring to the skater minimum skills written test on WFTDA.com. It\\\'s not just a sample test, it\\\'s the actual test. You may be thinking of the referee certification test, which is solely for certification purposes. \r\n\r\nI would however agree with your assessment that mixed is the best to prepare for the skater test. ', 1367512930, 339, 0),
(72, 30, 3, 'Ah that figures, I assume you can only see that test if you\\\'re a WFTDA member.', 1367521082, 3, 0),
(73, 14, 6, 'I have been pondering this for a couple of days. We have our very first bout coming up next sat, but many of our girls have been skating derby for several years.  This would not only confuse the other team, but our refs wouldn\\\'t know how to handle it either.  What would be my best option for making sure the refs know how to call the \\"yield\\" if we start behind our own jammer?\r\n\r\nBy \\"yielding\\" will our pivot be penalized for a false start?  Would everyone be penalized? \r\n\r\nAlso, if we are \\"yielding\\" would we be required to skate clockwise to \\"reform the pack\\"?  Or, is it legal for us to stand there and make them come to us? \r\n\r\nIf we are required to \\"reform the pack\\" from the front (by skating clockwise) do we have to do it quickly, or will a snail pace be sufficient? \r\n\r\nI like this tactic! Let’s see if we can pull it off! \r\n \r\nCheat To Win!\r\nCheat To Win!\r\nCheat To Win! \r\n', 1367805221, 3443, 0),
(74, 32, 4, 'Aloha!\r\n   The login clicky-do box isn\\\'t connected to it\\\'s rememberal. So, even if we clicked the box the last time, we still have to enter our logon and password every time. \r\n\r\n   Also, the question count doesn\\\'t seem to be updating.  I have been on 1908 questions for several days now (since I started paying attention - I don\\\'t know how long it has been going on). It is still tracking the questions themsleves on my stats page, but the question count isn\\\'t recognizing them. \r\n\r\nMahalo!\r\n~Cheat\r\n', 1367807445, 3443, 1367807739),
(75, 32, 4, 'Currently, the \\"remember\\" jobby saves your IP address as part of the stuff it remembers, so if your IP address changes frequently it\\\'ll forget you.\r\n\r\nAlso, right now you can only log into one device at a time. Do you use the mobile site at all?\r\n\r\nI\\\'ve added both of these to the To Do list.\r\n\r\nWith the Question Count, it may cache it and not update for about an hour... I think. Though if you\\\'ve been on that for several days, it\\\'ll be a bug. Will see what I can fix now.', 1367832996, 3, 1367833065),
(76, 14, 6, 'Bring it up in the Captain\\\'s meeting at the start of the game as a hypothetical. In the past I know some teams (or so the rumour mill goes) would message each ref individually to ask how they would call a tactic they want to use. Sneaky, and avoided the their team hearing about it before they did it.\r\n\r\nAnyone who false starts, false starts. Previously a Minor, now a NI/NP.\r\n\r\nThe Pack Speed is never established, so by standing still you could be seen to be failing to reform (which is a Major) as you\\\'re not actively decreasing the distance between you and the other team. \r\n\r\nThough, some head refs would likely just whistle the jam dead as soon as they realise everyone false started. Ref\\\'s first job is to keep the game safe, second job to keep it fair ;)', 1367833312, 3, 0),
(77, 32, 4, 'I had a nosey at the code, and by my tests it shouldn\\\'t be updating for about an hour (that\\\'s how long it takes to update sometimes). I\\\'ve shortened the time it takes to update to about 10 mins, let me know if the bug is still there and i can tinker more.', 1367834025, 3, 0),
(78, 14, 6, 'Thanks for the tips! What else you got? ;) ', 1367897359, 3443, 0),
(79, 33, 2, 'I have just received the following message from Apple:\r\n\r\n\\"We found the following issues with the user interface of your app:\r\n\r\n- Users just keep answering question. Lacks sufficient game play experience.\r\n\r\nThese examples identify types of issues discovered in your app but may not represent all such issues. It would be appropriate to thoroughly evaluate your app to address these types of issues.\\"\r\n\r\nI\\\'m not all that sure where to go from here. Thoughts?\r\n', 1367913043, 3, 0),
(80, 33, 2, 'I found a way to go; I\\\'m adding a \\"time attack\\" mode where you answer as many questions as you can in 60 seconds. It\\\'s annoying to have to build in a slightly rubbish feature (it\\\'s rushed and pointless, to be frank), but there you go.', 1367924441, 3, 0),
(81, 33, 2, 'Or hangman, derby style! For every question you get right your jammer scores a point, and every incorrect answer it adds a new part to the skater until you have collected a full roster of zombie skaters. O.O', 1367983529, 3443, 0),
(82, 33, 2, 'The rules don\\\'t say skaters have to be living!', 1368001589, 3, 0),
(83, 34, 2, 'There\\\'s a couple of big changes in the new version: \r\n\r\nThe main one you\\\'ll notice is the 60s Time Attack mode, where you answer as many questions as you can in 60 seconds. This was added after iTunes refused the App on the grounds it didn\\\'t have enough game play (http://rollerderbytestomatic.com/forum/news/ios-app-refused-by-apple ). Apple have since got back to me, and I may not have had to make that in the end, but it\\\'s there now, and quite fun. It doesn\\\'t remember high scores, and you can\\\'t post on Facebook, but it\\\'s not bad for a day\\\'s work. If anyone has any requests on edits & improvements (like a Facebook share button, or high scores), please let me know.\r\n\r\nAn update you may not notice is that I\\\'ve removed the ability for the app to get the latest questions from the website. The way previous versions were doing this was to try to download all the questions whenever the app started. This works, but is clunky, slow and uses up half a meg of data every time. Given the questions don\\\'t change all that often, data is expensive and most of the time the update didn\\\'t work, I\\\'ve scrapped the feature in 0.4.\r\n\r\nHowever, the auto-updating will come back soon. Only instead of re-downloading the database of questions, only the changes will be sent. This will be way less data, much faster, and if I make it properly; it\\\'ll happen in the background without an annoying loading screen.\r\n\r\nVersion 0.4 also edges the app closer to full compatibility with the Amazon App store (hello Kindles!), Android tablets and iTunes.', 1368001976, 3, 1368001984),
(84, 14, 6, 'So... Three days till bout day... I have been going through all the scenarios, and rules, and here\\\'s what I came up with:\r\n\r\nRules:\r\n6.13.36 - Skaters who begin in an intentionally taken starting position which purposefully prolongs that skater’s ability to return to an in-play position or a team’s ability to reform a pack (e.g., intentionally starting on one’s back, intentionally starting in a dog-pile), as this represents an intentional and immediate prolonged failure to rejoin/failure to reform. One penalty will be applied to a single skater per team, if applicable, who seems most responsible or the Pivot (further penalties should be assessed as laid out by rules 6.10.12 and 6.10.16).\r\n\r\n6.10.12 - A skater who, after being warned, does not immediately attempt to re-enter the Engagement Zone. A major penalty must be applied to each offending Blocker who does not attempt to return to the Engagement Zone.\r\n \r\n6.10.16 - No pack: After a warning, a sustained failure to reform a pack will result in a major penalty. This penalty includes a sustained failure to reform a pack by returning to in bounds from out of bounds. One penalty will be applied to a single skater per team, if applicable, who seems most responsible, or the Pivot (see Section 7.1.4).\r\n\r\nScenario 1:\r\nIf the blockers all line up touching the Jam line during their own power jam, and they all yield advantage to their own jammer, it is self defeating since you would always yield to your own jammer anyway, but since you cant make any forward motion, you also can\\\'t block opposing blockers for her. \r\n\r\nIf however, scenario 2, you position your blocker wall in front of the opposing blockers and encroach (legally) on them, they will be more likely to false start without being aware of it and will have to yield to your jammer or take the penalty.\r\n\r\nNow, scenario 3, starting with all of your blockers behind your jammer in your own power play: you sacrifice your pivot to the bin. Once the \\"No Pack\\" is called penalties will be given out if there is a \\"sustained failure to reform\\". So,since the blockers are \\"a lap ahead\\" of the pack, they would need to quickly skate clockwise on the track to reform or penalties will be called for \\"failure to reform\\". Each skater who doesn\\\'t immediately start skating \\"back to the pack\\" will get penalized. If they do go back right away, but the refs think it takes to long, only the most responsible person will be penalized.\r\n\r\n\r\nEssentially, the lineup would need to know exactly what is going on, and going over the rules with the refs at the beginning of the bout will be important so that it gives them  the opportunity to process what just happened. I hope!', 1368090228, 3443, 1368090670),
(85, 35, 2, 'After initially refusing the app, one small update later Amazon have approved the Android app for Kindle Fire devices. The free RDTOM App is now available via the Amazon App Store: http://www.amazon.com/gp/product/B00CMNI6QI', 1368091651, 3, 1368091667),
(86, 36, 6, 'So the rules mention a skater being \\"waived off\\" a full penalty box (eg 6.13.11). But is the phrase not  \\"waved off\\", which is also used in the rules in some places (eg 7.2.2.3)? Or are both fine, but used differently in different contexts?\r\n\r\nThere\\\'s a discussion here which suggests \\"wave off\\" is correct http://english.stackexchange.com/questions/39507/what-does-waive-off-mean\r\n\r\nPedantic +1', 1368345525, 3, 0),
(87, 36, 6, 'http://grammar.about.com/od/alightersideofwriting/a/Waive-And-Wave-glossary.htm is interesting:\r\n\r\nThe verb waive means to defer, dispense with, or give up (a claim or right) voluntarily.\r\n\r\n[...] The phrasal verb wave off means to dismiss, refuse, or cancel. \r\n\r\nWhich I think means you could \\"waive\\" (defer) a skater\\\'s penalty time, meaning the NSO would \\"wave off\\" (refuse) the skater\\\'s entry to the full box.', 1368345813, 3, 0),
(88, 37, 3, 'Although they aren\\\'t in the rules (I don\\\'t think!) they\\\'re officially defined in this WFTDA release: \r\n\r\nhttp://wftda.com/rules/wftda-official-hand-signals.pdf\r\n\r\nQuestions could take the form either of \r\n-an image of the signal being performed/a description of the signal, followed by options on what the signal represents, or;\r\n-a statement of the event being signalled with the possible answers being descriptions of various actions.\r\n\r\nI don\\\'t know if it\\\'d be necessary for more experienced players, but I think it would be really helpful for those of us just starting out! There are so many of them and during jams these things tend to happen faster than I can keep up with.', 1368466747, 3385, 0),
(89, 38, 2, 'The free iPhone and iPad version of the Test O\\\'Matic app is now available worldwide! \r\n\r\nhttps://itunes.apple.com/us/app/roller-derby-test-omatic-lite/id642903652\r\n\r\nFeaturing the new Time Attack mode (as found on the most recent Android version) the app allows you to test and expand your rules knowledge on the go!', 1368533195, 3, 0),
(90, 39, 9, 'In relation to the test-o-matic question #1401, how many support staff, or coaches are allowed on the bench during a game? Typically, there is one Jam Coach and one Line Coach, but I can\\\'t find a rule that states a specific number of coaches allowed in the WFTDA rules. Can someone point that out to me? Thanks! \r\n\r\n~Cheat', 1368569274, 3443, 0),
(91, 39, 9, 'Rule 2.1.4 : Up to two support staff per team are allowed in this area [team area] during a bout.', 1368612937, 4002, 0),
(92, 39, 9, 'I\\\'ve had a running idea (never attempted) that if you get a good Line Up system the skaters can all understand, you could have two Bench Managers/Jam Coaches and the skaters can line themselves up.', 1368631108, 3, 0),
(93, 40, 6, 'Quite often the same rule, or subject, is reported as incorrect due to people having assumptions about the rules. What are common misconceptions you find?\r\n\r\nTwo I get a lot: \r\n\r\nAssuming Cutting the Track rules apply when returning from the penalty box (they don\\\'t, meaning if there\\\'s a No Pack you can hop on the track anywhere).\r\n\r\nAssuming a ref doesn\\\'t need to issue an Out of Play warning before the penalty. Because everyone \\"knows\\" a ref doesn\\\'t need to issue a warning, they skip over the fact a Failure the Reform is issued for ignoring a warning, so one must be given. Same for False Starts.', 1369048846, 3, 0),
(94, 40, 6, 'Ooh, another classic: Initiation! If I\\\'m barrelling down the inside and somebody moves into my established path and I back-clock them unavoidably, I don\\\'t get a penalty because they initiated it. Same for clockwise. \r\n\r\nIt seems every game somebody initiates, then gets mad that a penalty wasn\\\'t called on the opponent.', 1369049091, 3, 0),
(95, 37, 3, 'The Excuse: Just before the new rules came out, I took a load of pics of my league\\\'s HR doing all the signals. New rules brought new hand signals, and before I had chance to take more pics I got busy doing the App & API (which can\\\'t have images, yet).\r\n\r\nI think this is a fantastic idea and I really want images to form part of the test. Diagrams of skater positions to aid with pack definition questions would also be ace.\r\n\r\nHave you seen the Ref Calling app by Major Madness? There\\\'s a link up on Zebra Huddle: http://www.zebrahuddle.com/index.php?action=downloads;sa=view;down=45', 1369052379, 3, 0),
(96, 28, 3, 'There\\\'s now a search page (linked in the footer)! It\\\'s pretty  basic, but should suffice. let me know if you find any bugs.', 1369132129, 3, 0),
(97, 37, 3, 'Ah, I see! That\\\'s fair enough, it doesn\\\'t seem to be the only inconvenience that the new rules caused folks. It\\\'s not something that I had thought of but pack definition questions would also be awesome.\r\n\r\nI hadn\\\'t seen the app - it sounds like it would be a great learning tool but unfortunately I don\\\'t have a smart phone (boo!). I\\\'ll see if any friends would mind me borrowing theirs to give it a try.', 1369338435, 3385, 0),
(98, 37, 3, 'That app is for PCs, I\\\'m not sure if there is a smart pone version yet... Ooh, I could prioritise these pictures and maybe add them to the Test O\\\'Matic app.', 1369386872, 3, 0),
(99, 41, 3, '::Grin::', 1369401397, 3313, 0),
(100, 14, 6, 'I have asked wftda, they said you can NOT be called for out of play until your yield is complete.\r\n\r\nAlso all of the leagues in my area are allowing players that false start on the jam line to enter the EZ from the rear and not the front like you and wftda has told me to do.', 1369401607, 3313, 0),
(101, 14, 6, 'Remember \\\'Cheat\\\' Jammers only have to yield to jammers and blockers only have to yield to at least one pack member.\r\n\r\nIf you are a blocker your yield would be complete when one pack member on the other team passes you.', 1369401836, 3313, 0),
(102, 30, 3, 'Thanks!', 1369402106, 3313, 0),
(103, 41, 3, 'Short version: \r\nEventually!\r\n\r\nLong version:\r\nEventually there will be two Test O\\\'Matic apps: A paid \\"full\\" one and the free \\"lite\\" one. The lite app is the one that everyone is using right now and probably won\\\'t have log-ins, at at least not for a little while. There\\\'s updates planned (hence it being at version 0.4 not version 1), but nothing major at this point.\r\n\r\nThe \\"full\\" app is coming, and will have all the fancy features everyone is waiting for: tests, logging in, Facebook integration, preferences, score tracking, stats etc. and will cost a few bucks.\r\n\r\nThe RDTOM \\"lite\\" was used so I could learn how to make apps, allowing me to then build the Minimum Skills paid app (available on Android: https://play.google.com/store/apps/details?id=com.rollerderbytestomatic.ms  and available on iOS as soon as I\\\'ve solved an Apple-ruin-everything bug), which if it sells well, will fund/justify development of the full RDTOM app.\r\n\r\nI\\\'m only one guy, so everything has to wait for everything else to be completed. But, it\\\'s getting there. I\\\'m on a slight break from my proper job (freelance web developer) to concentrate on these apps. Hopefully I can get them finished and earning me food-money before I go bankrupt!', 1369419103, 3, 0),
(104, 14, 6, 'Just re-read your scenario 2 Cheat, I think if you force an opponent over the Jam line so they false start, that\\\'s the same as gently nudging them off-track; a Blocking before the whistle IP Major, as they\\\'ve lost established position. Also, what LaredoHK said.', 1369419308, 3, 0),
(105, 14, 6, 'LaredoHK, you said \\"...you can NOT be called for out of play until your yield is complete.\\" Does this mean an out of play penalty must be called, or are you referring to possible separate infractions? ', 1369524001, 3443, 0),
(106, 14, 6, 'Out of play cannot be called on a skater who is yielding properly. Properly would be waiting, or skating backwards. If the yielding skater is outside of the Engagement Zone, they cannot be called for outofplay until their false start yield is complete (when one pack member passes them).', 1369701548, 3313, 0),
(107, 41, 3, 'I didn\\\'t know that was in the works. I know your a one guy operation. This is the forum for suggestions and didn\\\'t know you were working it.', 1369701672, 3313, 0),
(108, 30, 3, 'http://wftda.com/resources/wftda-rules-test.pdf\r\n\r\nThis is the test Sausage Roller. Check it out and let me know which difficulty is closest.', 1369701800, 3313, 0),
(109, 42, 12, 'This forum is for any and all questions regarding the Minimum Skills app.\r\n\r\nAvailable on Google Play here:\r\nhttps://play.google.com/store/apps/details?id=com.rollerderbytestomatic.ms\r\n\r\nComing soon to iPhones and iPads.', 1369755788, 3, 0),
(110, 43, 9, 'This comes from a report about a question asking \\"How many seconds (minimum) must be on the period clock at the end of a jam for a new jam to start [...]\\"\r\n\r\nThe rule: 2.3.4 - If 30 seconds or fewer remain on the period clock when a jam ends, there will not be another jam started [...]\r\n\r\nThe question: assuming your period clock only has seconds, this is fine, but what if you have an ace NSO who uses the lap-timer feature to get the exact time the four whistles end. What if they look down and see a time of 30.5? Is the cut off for \\"30 seconds or fewer\\" 30.00, or 30.99, or you you round? \r\n\r\nI\\\'d be inclined to think the cut off is 30.00, but if so why isn\\\'t it simply worded \\"fewer than 30 seconds\\"?\r\n\r\nLikly to happen? No. Pedantic? Very. ', 1370029297, 3, 0),
(111, 43, 9, 'It is worded that way because the rules were written by Americans. (there\\\'s a joke to be made there about English being their second language)\r\n\r\nRealistically, though, it has to be \\\'30 or less\\\' because the time between jams is supposed to be exactly 30 seconds. At 30.00 seconds there isn\\\'t enough time to start a new jam. At 30.01 there is. In theory. ', 1370031834, 3455, 0),
(112, 37, 3, 'Pictures, or even better gifs, would be a great help to people. \r\n\r\nIt\\\'s quite frustrating that WFTDA refuses to do any kind of animated image of the signals. What with them being arm motions, rather than static poses and all. \r\n\r\nAside from that, a glossary section would be nice as well. ', 1370032089, 3455, 0),
(113, 43, 9, 'I agree there, but by that interpretation if the clock reads 30, we go again. Which, seems counter-intuitive to the rule.', 1370040893, 3, 0),
(114, 41, 3, 'And suggestions are more than welcome :) I don\\\'t tend to chat about what I\\\'ve got planned as it changes so much. It\\\'s nice for me when people suggest stuff I\\\'ve thought about myself, it\\\'s quite affirming.', 1370041065, 3, 0),
(115, 44, 6, 'Rules say refs dont need to warn skaters before issuing a warning (official rules test agees). But, \\"Failure to Return\\" penalty can only be issued once an Out of Play warning has been issued. What is going on?\r\n\r\nSimply, the \\"Out of Play\\" warning is NOT a warning that the skater is about to get a FTR penalty. It just happens to come before you get an FTR penalty.\r\n\r\nIf a penalty did have to be issued, you\\\'d hear \\"out of play!\\" \\"Failure to reform\\" \\"whistle (colour) (number) Failure to reform Major\\".', 1370077215, 3, 1370125662),
(116, 30, 3, 'Having read the test, I\\\'d say about 10% of the questions are on par with Hard ones here, and the rest are an even split between Easy and Intermediate. So your best difficulty setting is either Mixed or Intermediate. \r\n\r\nKnowing what the test is like, I might try making a test difficulty level thats as balanced as that test.', 1370077862, 3, 0),
(117, 45, 2, 'The site has now recorded more than 4,000,000 responses from people! In celebration (and the fact I\\\'ve just had a super tasty coffee and don\\\'t want to do any real work today) here\\\'s some stats, accurate as of 3rd June 2013.\r\n\r\nTotal questions answered on the web: 4,000,000+\r\nPeople (or IP addresses at least) who\\\'ve answered questions: 17,000+\r\nTest O\\\'Matic Accounts: 4,100+\r\n\r\nIn the last 12 months...\r\n\r\nVisitors: 47,000+\r\nCountries with at least a dozen people using the Test O\\\'Matic: 41\r\nPeople using a mobile device: 38%\r\nRules Tests generated: 8,500+\r\n\r\nRegarding the app (available via links at the bottom of this page):\r\n\r\nAndroid installs: 1,800+ (currently adding 20ish per day)\r\niOS installs: 750+ (currently adding 30ish per day)\r\nKindle installs: 37 (currently adding 1ish per day)\r\n\r\nAnd because I\\\'m kinda nerdy, regarding the website only:\r\nDatabase size: 339 MiB\r\nOf which responses account for: 337 MiB\r\nFiles: 70\r\nLines of code: 12,000+\r\n\r\nAnd don\\\'t forget, full source code for the website is available here, if ever you want a nosey: https://github.com/RDTOM/RDTOM-Source\r\n\r\nYou can see some of the stats here: http://rollerderbytestomatic.com/stats/', 1370255540, 3, 1370255816),
(118, 43, 9, 'If the clock reads 30 then there is only exactly enough time to have the time between jams, not enough time to start a new jam. \r\n\r\nI\\\'m sure there is some kind of science person term for the uncertainty of not knowing what the decimal place is when your measuring device isn\\\'t accurate enough. ', 1370274175, 3455, 0),
(119, 43, 9, 'After re-reading that first sentence a few times, that\\\'s a perfect way to put it.', 1370339084, 3, 0),
(120, 30, 3, 'Good idea. Thats basically what leagues are looking for. A way to generate a equally hard test that the skaters cannot memorize.', 1370450549, 3313, 0),
(121, 30, 3, 'After an afternoon of tinkering, there\\\'s a new default difficulty setting of \\"Balanced\\". Kind of makes \\"Mixed\\" redundant, but there\\\'s no harm in it being there.\r\n\r\nhttp://rollerderbytestomatic.com/test/\r\n\r\nIt\\\'s 45% Beginner, 10% Expert, and the rest Intermediate. Though, there\\\'s always going to be some variation in difficulty levels as most questions fall into more than one difficulty setting.\r\n\r\nWhich, for anyone wondering, is based on % of people who get the question right:\r\n\r\nBeginner 80% - 100%\r\nIntermediate 40% - 90%\r\nExpert 0% - 60%', 1370460818, 3, 0),
(122, 44, 6, 'Well, they\\\'ve only gone and updated the rules to specify Failure to reform, and failure to return DO have warnings associated... But apparently not False Starts, which is odd.\r\n\r\nhttp://www.wftda.com/rules/change-summary/rules-2013-06-15', 1370985233, 3, 1370985266),
(123, 46, 2, 'The log in page for the Test O\\\'matic is now finally secured through SSL to add a little more security when logging in and signing up.\r\n\r\nIn addition, API calls can now be made via https as we ll as http. Not sure useful right now, but future API version will allow you to log in, and before we do that we best get our security in order!\r\n\r\nIf you spot any errors with the security, please let me know.', 1371033519, 3, 0),
(124, 47, 3, 'http://wftda.com/rules/wftda-rules-june-2013-change-detail.pdf', 1371047047, 3313, 0),
(125, 47, 3, 'I\\\'ve been having a nosey at some of the updates, and the majority are clarifications (which is never a bad thing). All the relevant questions will be updated on the Test O\\\'Matic in the next few days. if you find any, feel free to Report them to save me looking :P', 1371056213, 3, 0),
(126, 47, 3, 'Also, 6.10.13.4 is craziness!', 1371058992, 3, 0),
(127, 47, 3, 'Actually, re-reading 6.10.13, is this the end of the stationary power jam!? :D I\\\'ve started a thread specifically for this, I\\\'m intrigued http://rollerderbytestomatic.com/forum/general/the-end-of-the-stationary-power-jam', 1371059370, 3, 1371059618),
(128, 36, 6, 'The updated rules have sorted this, and settled on \\"A skater, after being waved off of a full penalty box [...]\\"', 1371059564, 3, 0),
(129, 48, 6, 'Have a read of the new 6.10.13 and tell me I\\\'m wrong.\r\n\r\nIn a No Pack:\r\n- Team at the front only needs to coast (where previously they had to slow down)\r\n- Team at the back must accelerate until sprinting to reform\r\n- If there\\\'s only one team on track, they have to sprint\r\n\r\nAwesome :D', 1371059596, 3, 1371060295),
(130, 48, 6, 'Pack speed can still go to zero during a pack situation, stationary should still be present.', 1371062272, 3313, 0),
(131, 47, 3, 'I am trying to understand 6.10.13.4, but the wording is meh.', 1371063368, 3313, 0),
(132, 47, 3, 'This is how it was explained to me on ZHuddle\r\n\r\nDuring a no-pack scenario, if all of one team is out of bounds, \r\n[if the previous conditions happens then]\r\nthe team on the track must skate forward, accelerating [the team must skate forward, and accelerate if possible]\r\n\r\nuntil [one of the following happens]\r\n-they are sprinting, [they can\\\'t accelerate anymore]\r\n-a pack has reformed, [the no-pack situation ended]\r\n-or a member of the opposing team may legally return to the track behind them.', 1371067750, 3313, 0),
(133, 47, 3, 'Which fits with a nice way I found to explain it: if there\\\'s a team behind you, coast. If there\\\'s nobody behind you, sprint :)', 1371071204, 3, 0),
(134, 48, 6, 'It\\\'s possible, but far more difficult to maintain now the front group doesn\\\'t need to slow, only coast. ', 1371071296, 3, 0),
(135, 49, 3, 'There\\\'s a beta version of the Test Builder out now, which you can access by logging in and going to http://rollerderbytestomatic.com/test/builder/\r\n\r\nFrom here you can make custom tests, specifying what questions appear as well as the order of the answers.\r\n\r\nThere\\\'s a few remaining bugs I\\\'m in the process of ironing out, and some missing features, but I\\\'m keen to see what you guys think of it. The more feedback I can get the better!', 1371136260, 3, 0),
(136, 49, 3, 'So far I like it. I can work on just the rules I am having trouble with. ', 1371144848, 3466, 0),
(137, 49, 3, 'That\\\'s an awesome use I\\\'d not even thought about before, nice! If you\\\'re wanting to focus on a particular section or topic, you can try the search page too: http://rollerderbytestomatic.com/search', 1371146442, 3, 0),
(138, 48, 6, 'I\\\'m coaching on Sunday, and plan on trying out some \\"new\\" power jams to see how they work.', 1371155184, 3, 0),
(139, 48, 6, 'There\\\'s a really fun drill you can do to show this in effect, and you only need two people: one person acts as the front group, the other as the rear. Using these rules and reffing yourself, have one person try to make the pack speed up and one slow down.\r\n\r\nLooks like the speed of power jams are now pretty much up to the defending team. Which is nice.', 1371629385, 3, 0),
(140, 48, 6, 'Sorry to burst the bubble, but going from skating to coasting is only a way to satisfy 6.10.13\\\'s required immediate ATTEMPT to reform. But if you\\\'ve gotten far enough in front of the other team, then that attempt is bound to fail to ACTUALLY reform the pack, so you\\\'ll still earn 6.10.16\\\'s sustained FtR. So while choosing to coast WILL keep you from earning FtR in limited circumstances (generally when the pack was barely split), it\\\'s NOT a panacea that\\\'s universally legal.\r\n\r\nThough I do agree, this wording change (meant to be a clarification, not actual rule-change) will probably have the effect of slightly speeding up some power-jams.', 1371637632, 4293, 0),
(141, 48, 6, 'Very true, and I imagine there\\\'s going to be a lot of variation as to what constitutes \\"sustained\\" as it\\\'s not in the glossary. \r\n\r\nI\\\'ve been running with the assumption it\\\'d be hard (but far from impossible) to get far enough ahead that coasting whilst the other team are accelerating to a sprint would cause a No Pack for more than a second or two. ', 1371640754, 3, 0);
INSERT INTO `rdtom_forum_posts` (`ID`, `Thread_ID`, `Topic_ID`, `Text`, `Timestamp`, `Creator_User_ID`, `Edited_Timestamp`) VALUES
(142, 48, 6, 'The \\\'only one team on the track must sprint counterclockwise\\\' part is what interests me. \r\n\r\nDoes that mean that under the January 2013 rules if team A blocked all members of team B off the track at the same time they could then skate clockwise to force team B to chase them down in the ref lane before reentering in order to avoid track cut penalties? \r\n\r\nAnd that, since there would be no pack and no engagement zone, they could keep going clockwise indefinitely until team B caught them? ', 1371657709, 3455, 0),
(143, 47, 3, 'Most of the questions have now been updated, any that have yet to be fixed (from around 6.10 onwards I think) will be sorted next week. The apps will be updated once this has been completed.', 1371765148, 3, 0),
(144, 48, 6, 'You\\\'d likely get a failure to reform, based on the fact you\\\'d be intentionally making it harder for the opposing skater/s to legally re-enter and form a pack, which is the opposite of what you\\\'re meant to do.\r\n\r\nSomething similar which does catch people out: when knocked out of bounds, sometimes it\\\'s better to just stand there and wait for the skater to move forwards (so you don\\\'t end up a goat, for example). If you\\\'re stood at a side of the track, then there\\\'s a \\"no pack\\", and you don\\\'t immediately move to re-enter, you get a failure to reform. \r\n\r\nBonus; the person stood off track likely is looking smug because they know if you\\\'re blocked off the track you don\\\'t need to re-enter. When smug people get penalties is the best.', 1371765404, 3, 0),
(145, 50, 9, 'In the line-by-line document it says they\\\'ve removed the \\"in-play\\" requirement for cutting skaters. Thus, cutting an OOP opponent is still a major. This isn\\\'t in the changes overview however. \r\n\r\nBut, it\\\'s also a change that\\\'s not reflected in the online rules, and is counter to this clarification (issued before the new update came in) http://wftda.com/rules/qa/jammers-cutting-a-down-out-of-play-or-out-of-bounds-skater\r\n\r\nSo, what\\\'s the call if a Jammer cuts that last blocker who\\\'s Out of Play? Or if a skater cuts one in-play and one out-of-play teammate? Old rules and online rules say its a No Pass/No Penalty, but changes document says its now a Major?\r\n\r\nLine-by-line document here: http://wftda.com/rules/wftda-rules-june-2013-change-detail.pdf\r\n', 1371897755, 3, 1371897784),
(146, 50, 9, 'They removed in-play I believe so that during a no-pack situation, it is more clear that you cannot cut people during this type of out of play, not because the NI/NP/NP is now a major. At least that is my understanding.', 1372077750, 3313, 0),
(147, 50, 9, 'Yes, Laredo is correct. Remove of the words \\"in-play\\" from the Majors was NOT meant to be a substantive change, only a typographical one. And yes, it\\\'s because everyone\\\'s OOP during No Pack, but Cutting penalties still apply.  You do need to edit or delete Q 1661. Further discussion here: http://www.zebrahuddle.com/index.php?topic=3520', 1372115401, 4293, 0),
(148, 50, 9, '...and to back up our interpretation of what the authors meant: Note that 6.11 doesn\\\'t get ANY mention in their change summary.\r\nhttp://wftda.com/rules/change-summary/rules-2013-06-15', 1372115547, 4293, 0),
(149, 50, 9, 'Thanks for the clarification there guys. I guess the fact \\"in-play\\" is still listed in the official rules is a typo.', 1372234251, 3, 0),
(150, 47, 3, 'The Test O\\\'Matic is now fully updated with the new rules. The Apps will be getting updates in the next few weeks to get the latest questions.\r\n\r\nIf you\\\'d like to test yourself on the new updates, have a go at this test: http://rollerderbytestomatic.com/test/14', 1372443584, 3, 0),
(151, 51, 4, 'Link to Manchester Roller Derby site is broken. URL is missing .com and an \\\'L\\\' in the word roller.', 1372701441, 4347, 0),
(152, 51, 4, 'Oh weird, no idea how I missed that one. Thanks!', 1372752258, 3, 0),
(153, 52, 6, 'I\\\'ve been pondering a short mission statement for the site. A one sentence phrase to bring the reason this site exists, and the direction the development goes, into focus. I was thinking something like \\"the rules are hard to learn\\". It gets to the point of why this place is here I think. What do you recon?', 1373531462, 3, 0),
(154, 53, 6, 'http://rollerderbyworldcup.com/2013/07/16/mercy-rule-jammer-penalty-changes-announced-for-2014-bt-roller-derby-world-cup/\r\n\r\nThis seems to be an odd choice of modifications. I get most of them, as it results in more people on track more of the time, but the mercy rule? I\\\'m not sure who gains from that.', 1374056316, 3, 0),
(155, 53, 6, 'If the purpose of a tournament is to figure out which is the best team on the day, a mercy rule makes sense. If the people in charge are organized about things it means the next bout can start sooner and the winning team is rewarded by being that much better rested for their next bout. \r\n\r\nI don\\\'t necessarily agree that 100 points is the best cutoff. \r\n\r\nIf the purpose of a tournament is for losing teams to gain the maximum of experience by playing to the bitter end of a blowout, then a mercy rule doesn\\\'t make sense. \r\n\r\nB&T have made their priorities clear. \r\n\r\nWhat do you think about the changes to the jammer penalty rules? I am very skeptical of any rule change that makes penalties less punitive, in that it has the potential to encourage more penalties to be committed. ', 1374076062, 3455, 1374076456),
(156, 53, 6, 'I agree with the dislike of penalties being less of a, well, penalty. I think they are 30 seconds so people spend more time on track? But, penalties are avoidable, they are not things you must get during a game, so I\\\'m not sure the logic.\r\n\r\nWith jammer penalties there\\\'s a bit more give, as power jams are a bit rubbish, but for blockers? I\\\'d be very curious to know the inner workings of who decided on the rules, and how they decided on them. Or in other words, I\\\'d like them to show their working, the problem, the goal, and how they see this planing out.\r\n\r\nAlso, there\\\'s already ambiguity; with the jammer release on a \\"full\\" pass, is the word \\"full\\" there to mean 5 points? Or just completing a pass? If they mean a full 5+ point pass, jammers can intentionally get No Impact No Penalties, which would be a weird addition.', 1374077042, 3, 1374077352),
(157, 53, 6, 'It seems like a rather ham-fisted attempt to minimize passive offense during power jams. \r\n\r\nBut I agree completely with you that the way to prevent power jams and/or box time in general is to skate cleaner and not get penalties. \r\n\r\nI think they would have more success by going the other way with it. Instead of making penalties less penaltous they should foul people out at 3 or 4 penalties. I bet that would result in less total penalty time than the 30 second rule. \r\n\r\nThe \\\'full pass\\\' thing is a problem. Add to that what my favorite PBM said about it, which was basically \\"and just who do they expect to keep track of that?\\". ', 1374080483, 3455, 0),
(158, 53, 6, 'My Dad once suggested putting a large spike in the center of everyone\\\'s car steering wheel, because everyone would drive incredibly carefully then.\r\n\r\nThey could alternatively have used the current rules set, specifically the bit where in a \\"No Pack\\" the front team can coast and the rear team must skate. If they clarified that \\"sustained\\" failure to reform would never be a penalty for the front team as long as the gap between the two teams is always closing, and that the rear team (as the rules say) MUST sprint, then we\\\'d see sprinting packs & goating during power jams; valid, currently used, and sensible tactics, and not terrible to watch.\r\n\r\nOr, now we\\\'re in crazy hypothetical back-seat rules committee land:\r\n\r\nDuring a Power Jam the pack is always defined as the foremost group of 2 or more skaters.\r\n\r\nBut, I think it depends what their goal is. If it\\\'s to make games look more interesting even during a super unbalanced game (and don\\\'t forget, the World Cup is probably the best exposure we get in the media) their solution, whilst clunky, might well work.', 1374086436, 3, 0),
(159, 53, 6, '\\"Clunky but possibly effective\\" is a good way to sum it up. \r\n\r\nYour dad was on to something. Making things too idiot-proof only serves to create more idiots in the long run. \r\n\r\nI keep coming back to MADE rules when thinking about this tournament. Everything it seems they\\\'re trying to prevent goes away when players aren\\\'t allowed to stop on the track. And when you give up a point every time you get a penalty. ', 1374087832, 3455, 0),
(160, 53, 6, 'So it looks like they\\\'ve backed down on the Mercy rule and have now said its optional, so that\\\'s good. They also explained a bit more about why they had the rule.\r\n\r\nI\\\'d love to try MADE, and plan on setting up a little group near me to explore all the non-WFTDA rule sets. I just get the impression, having played WFTDA, I\\\'ll just be stuck asking too many \\"yeah, but what if...\\" Questions.', 1374226618, 3, 1374226853),
(161, 54, 11, 'All the Test O\\\'Matic apps (Android, iOS & Kindle) have been updated to have the new June 2013 questions in.\r\n\r\nGoogle Play should get the update sorted in a few hours, iOS and Kindle both require manual approval, but they should be updated within a few days.', 1374239237, 3, 0),
(162, 54, 11, 'Amazon and iOS have green-lit the update, so everyone\\\'s apps should be getting the new questions in the next day or two.', 1374745130, 3, 0),
(163, 55, 6, 'This is a follow up to a post I made a few months ago about the new rules update: http://rollerderbytestomatic.com/forum/general/the-end-of-the-stationary-power-jam\r\n\r\nPlease always talk to your head ref, and never assume anything.\r\n\r\nHaving now played a few games, and now attempted to try this, it works. But, only if everyone on track knows what they\\\'re doing and you have clarified it with the head ref. and it never works that well for reasons I\\\'ll explain.\r\n\r\nIf you are the team who\\\'s jammer has been sent off, get to the front and start gradually skating (a rapid speed change = penalty). On the \\"no pack\\" call, coast. Do not skate. I hold my arms out and stand upright to make it clear, kinda like holding your arms to the side when bridging. Ultimately useless, but a helpful visual indicator of what you\\\'re trying,\r\n\r\nCoast whilst the other team reform. Chances are they\\\'re going to be playing old rules and not read the new ones, under the old ones they just need to make an effort. Be sure to remind your team you only need to coast and the opponents must sprint. If you\\\'ve not brought this up with HR, after this jam if your opponents don\\\'t sprint and don\\\'t get the penalty, it is a good time to bring it up via your bench.\r\n\r\nIf them failing to reform made no real impact on the game, refs might be lenient. This is fair enough.\r\n\r\nThis all means you can now speed the pack up during a Power jam. If there\\\'s one of you on track, the jammer is going to get past you regardless, so getting things rolling at least means the jammer takes longer to lap you.\r\n\r\nNow, this isn\\\'t as handy as you think for a few reasons. The main one being we\\\'ve all got damned good at really slow walls. If the jammer hits your team and you\\\'re moving, you need to be ok with this and be ready to bridge. The other team will be borderline 10\\\' and your awareness is vital. In a game, this isn\\\'t so hot. Also, this requires everyone on track to know what\\\'s going on. There\\\'s no point half the team doing it.\r\n\r\nSo, it works, but you need to be smart to make it effective.\r\n\r\nThoughts?', 1377907117, 3, 0),
(164, 55, 6, 'I\\\'m glad you\\\'ve been exploring the possibilities of this idea. To be honest I never really understood what you were talking about when you said it could be used to effectively counter passive offense before. \r\n\r\nIt makes sense now, but I can see how it would be very difficult to pull off in a bout. \r\n\r\nNow if only more cool kids would talk strategy here. ', 1378238767, 3455, 0),
(165, 56, 2, 'For the first time I can remember, I\\\'ve removed a feature from the website. Since January the site has had a link at the bottom of the page that says \\"Click here to be tested on only the rules which have been updated with the new WFTDA 2013 rule set\\". This made the site only ask, as suggested, those questions which changed between the current No Minors rule set, and the pre-2013 rules. \r\n\r\nGiven we\\\'ve had another rule set change since then, and given we\\\'ve been playing under the current rules for quite some time now, I thought it\\\'s probably worth removing.\r\n\r\nIn the last 30 days, the link has been clicked a few hundred times. However, I suspect very few of those clicks are actually the result of people wanting the desired outcome.\r\n\r\nIn place of that link I\\\'m making public some of the experimental features I\\\'ve been working on for the past, well, year? It\\\'s been a while anyway.\r\n\r\nThe first is the ability to submit your own question. This is a very controversial feature for me for a few reasons. Quality control and licensing, being two major issues I\\\'ve no idea how to solve.\r\n\r\nRight now you need to register to write your own questions. If you\\\'d like to do this, send me an email (contact@rollerderbytestomatic.com).\r\n\r\nThe second experimental feature is one I\\\'m super proud of: Build your own tests. This was built to help those leagues who use the Test O\\\'Matic for their official assessments. \r\n\r\nFinally, I\\\'ve added a link to the Stats page, which has existed for some time, but tucked out the way. It has loads of information in about the website, which is just kinda cool.\r\n\r\nThese experimental features are work in progress, and feedback is very much appreciated.', 1380702968, 3, 0),
(166, 49, 3, 'I tried it out and built a test. I saved after every few questions and when I cam back I don\\\'t think it was saved.', 1380834912, 3313, 0),
(167, 49, 3, 'Interesting... it looks like every time you\\\'ve saved it\\\'s saved a new test (which is a bug, and I\\\'ve deleted all but the most recent save from the database). If you go to http://rollerderbytestomatic.com/test/builder/ is anything listed? \r\n\r\nIf not, the data is in the database and safe, and I just need to work out what\\\'s with it not displaying properly.', 1380900315, 3, 1380900862),
(168, 49, 3, '(I\\\'ve just fixed the bug where multiple tests were created when you save multiple times after starting a new test)', 1380900764, 3, 0),
(169, 49, 3, 'I have only one test listed now, but I do not see any questions in it. I\\\'ll try to do another one.', 1380906712, 3313, 0),
(170, 49, 3, 'Turns out there was another bug there, stopping it being displayed. Questions with a new-line in them would cause the code to cry. I\\\'ve not fixed the bug yet, but I have removed the new-lines from the questions. Should be working now.', 1380911547, 3, 1380912698),
(171, 57, 2, 'I\\\'m now a software developer at a start-up networking company. aka I kinda build the internet.\r\n\r\nSo, my time and energy have been diverted of late, and are likely to remain diverted for some time.\r\n\r\nI\\\'m the only one at present who can edit the questions so reports have a few weeks lag on when you send them in and when I fix them. Sorry about that.\r\n\r\nAll work on the site\\\'s new features and apps have been suspended because who has time for that? I\\\'ll crack on with them soon, but for now, either deal with the fact I can afford new shoes, or fork the site\\\'s source code/use the API and build the features you want to see!\r\n\r\nIf you do want to do either, please let me know.', 1384898231, 3, 0),
(172, 58, 12, 'Is there anyway to share or print the info?', 1386108348, 4826, 0),
(173, 58, 12, 'What info are you wanting to print? \r\n\r\nIf you generate a test you can select non-interactive for the output format, which works well when printed.', 1386625212, 3, 0),
(174, 59, 12, 'Hey, love the concept for this Minimum Skills tracker, I will be recommending it to our new skaters. \r\n\r\nI would be extremely inclined to use it as my main assessment recording tool if the information could be backed up or exported regularly somehow. Not sure that it would be wise to use it to officially assess the skaters without that kind of functionality. \r\n\r\nIf this is already possible, and I just didn\\\'t figure out how to do it - please let me know! :)\r\n', 1388907915, 4901, 0),
(175, 59, 12, 'It\\\'s not currently possible, but when I get the time I\\\'m wanting to make a handy website you can visit to download all the data., or at least enable some kind of \\"send via email\\" button.\r\n\r\nThere\\\'s no universal way to get data out of apps at the moment, which is a bit rubbish, and why I\\\'m going to need to make my own. \r\n\r\n', 1388955256, 3, 0),
(176, 59, 12, 'That would be great. Thanks for the reply', 1389079830, 4901, 0),
(177, 60, 2, 'The Test O’Matic is back, and officially licensed by the WFTDA!\r\n\r\nThe licensing agreement covers the Test O’Matic website & app, and the Minimum Skills app.\r\n\r\nI\\\'ll be giving the site, and the apps, a spring clean over the next few weeks and months, and you can expect \\"officially licensed by the WFTDA\\" to be appearing on them.\r\n\r\nExciting times :D', 1392834077, 3, 0),
(178, 60, 2, 'I was just thinking yesterday that it was taking a long time and I should send you a message to find out how it was going. \r\n\r\nCongrats on being back!', 1392845844, 3455, 0),
(179, 60, 2, 'Great news for the Derby world! Thank you for your dedication!', 1393643511, 29, 0),
(181, 61, 2, 'I\\\'ll begin the process of updating RDTOM to the new 2014 rules shortly. In some unfortunate timing I\\\'ve been unable to update the site in the past few weeks as all my free time and energy is going into the Men\\\'s Derby World Cup online stuff as I\\\'m managing the website & live stats for the tournament.', 1394223717, 3, 0),
(182, 61, 2, 'Glad to know you still love us!', 1394225024, 4519, 0),
(183, 61, 2, 'Thanks, it\\\'s so good to know it\\\'s merely delayed. \r\nAny guestimate ?  ... couple of weeks ? ', 1394921060, 4396, 0),
(184, 61, 2, 'Likely a couple of weeks out. Tonight is the first night I\\\'ve been able to chill out after MRDWC, and I\\\'m remounting my skates and trying to catch up on emails.\r\n\r\nIt\\\'ll be soon, in the next few weeks hopefully.\r\n\r\nKind of related to this, over summer I\\\'ll be building in easier ways for people beside me to update things. ', 1395435787, 3, 0),
(185, 61, 2, 'Thank you for everything you do for the derby community. This is an invaluable tool for getting peeps to learn the rules. <3', 1395467648, 5112, 0),
(186, 61, 2, 'Aww thanks :)\r\n\r\nAll the nice things everyone has said about the Test O\\\'Matic in the past few months have really cheered me on.\r\n\r\nI\\\'ve now (finally) gone through the back-log of reports and clarification requests on the _current_ questions. Which means I\\\'m in a position to start cloning all the old rule-set, modifying them, and setting them up as new-rule-set questions. As soon as there\\\'s a handful of questions ready to go I\\\'ll see about updating the site to let people use them. It may not be a complete set of questions yet, but it lets people get their hands on them asap.', 1395585377, 3, 0),
(187, 55, 6, 'Hey there, I\\\'m Friski Digits, Head Ref with the Rez City Skate Troopers in Wetaskiwin, Alberta. I have seen many efforts made to eliminate Sausage or passive derby. There are counter measures such as your strategy mentioned, which is easily countered by getting a Goat which allows your opponents to control the pace and slow it down. I am glad there are new strategies developing every day and the rules are adapting to make the game more interesting for all. Sausage derby is now just another page in the growing playbook. \r\n\r\nCheers!', 1395724408, 5119, 0),
(188, 62, 2, 'The SSL certificate which allows the password page to be encrypted has been updated. This was just because the previous certificate expired. The Heartbleed SSL security issue doesn\\\'t impact RDTOM.\r\n\r\nhttp://status.mediatemple.net/incidents/851y3gd167d8', 1397500977, 3, 0),
(189, 63, 2, 'Updates are happening RIGHT NOW! I\\\'ll update this thread as things change so you can follow the progress.\r\n\r\nCurrent Progress:\r\n- Updates are added to the live site as they happen\r\n- Section numbers have been updated\r\n- \\"Major\\" has been removed from all answers\r\n- When you answer a question, links go to the correct rules\r\n\r\nSection update progress:\r\n1 - Done\r\n2\r\n3\r\n4\r\n5\r\n6\r\n7\r\n8\r\n9 - Done', 1400770823, 3, 1400771355),
(190, 63, 2, 'For a more detailed breakdown of the sections that have been updated, see: https://docs.google.com/document/d/1sp6YX9fifUBZ49BJVlcrIBCCwrGuChvC6foE9tOLZik/edit', 1400771433, 3, 0),
(191, 63, 2, 'And for anyone interested in the process of updating, it\\\'s a case of going through this document slowly: http://static.wftda.com/rules/wftda-rules-march-2014-change-detail.pdf', 1400772193, 3, 0);
