INSERT INTO `rdtom_questions` (`ID`, `Text`, `Section`, `Added`, `Notes`) VALUES
(237, 'Combien de patineurs peuvent au maximum être inscrits sur la liste de leur équipe pour participer à un match donné ?', '1.1', 1323273755, ''),
(2751, 'Les lignes de pivot et de jammer ...', '1.2.3.1', 1400766405, ''),
(2752, 'A combien de la ligne de jammer se situe la ligne de pivot ?', '1.2.3.1', 1400766491, ''),
(12, 'Au maximum, combien de patineurs peuvent être inscrits sur la liste de leur équipe pour participer à un match donné ?', '1.1', 1323273755, ''),
(11, 'Parmi les surfaces de piste suivantes, laquelle est acceptable ?', '1.2.2', 1323273755, ''),
(18, 'Quelle est la définition de « haut contraste » au-delà de tout doute pour la surface de patinage ?', '1.2.2.1', 1323273755, ''),
(17, 'Vrai ou faux : la surface de patinage et les lignes de limites du terrain ne doivent pas obligatoirement avoir une grande différence visible de contraste.', '1.2.2.1', 1323273755, ''),
(19, 'Vrai ou faux : la bordure de la piste doit être plate.', '1.2.3', 1323273755, ''),
(22, 'Vrai ou faux : tant que la bordure répond aux dimensions, elle n\'a pas besoin d\'être constante sur toute leur longueur que cela soit en épaisseur ou en largeur.', '1.2.3', 1323273755, ''),
(32, 'Vrai ou faux : les joueurs de l\'équipe qui ne sont pas inscrits sur la feuille de match peuvent être assis ou debout dans leurs camps respectifs.', '1.2.4', 1323273755, ''),
(31, 'Combien de personnes d’encadrement par équipe sont autorisées à se trouver dans leurs camps respectifs au cours d\'un match ?', '1.2.4', 1323273755, ''),
(36, 'Pourquoi est-ce que la la piste, les limites, la zone de sécurité et la Penalty Box [Prison] doivent être correctement éclairées ?', '1.2.6', 1323273755, ''),
(37, 'Les lignes matérialisant les limites, ainsi que la piste, sont considérées comme étant …', '1.2.7', 1323273755, ''),
(38, 'Vrai ou faux : Les lignes matérialisant les limites, ainsi que la piste, sont considérées comme étant en dehors des limites.', '1.2.7', 1323273755, ''),
(39, 'Tourne à ', 'N/A', 1323273755, ''),
(40, 'Combien de minutes de jeu y-a-t-il dans une période ?', '1.3.1', 1323273755, ''),
(41, 'Combien de minutes de jeu y-a-t-il dans un match ?', '1.3.1', 1323273755, ''),
(42, 'Combien de minutes de jeu y-a-t-il dans une période ?', '1.3.1', 1323273755, ''),
(43, 'Quelle équipe remporte la partie ?', '1.3.2', 1323273755, ''),
(46, 'Vrai ou faux : un "bout" et un match désigent la même chose', 'N/A', 1323273755, ''),
(2750, 'S\'il reste moins de 30 secondes sur le chronomètre officiel de période quand un Official Timeout [temps mort] est appelé ...', '1.4.3.1', 1400765983, ''),
(54, 'Vrai ou faux : Tant que le chronomètre officiel de période n\'indique pas 0:00 quand un jam est arrêté, un autre jam sera demarré au cours de cette même période (en considérant qu\'aucun temps mort n\'est appelé).', '1.4.3', 1323273755, ''),
(85, 'A partir de quel moment, il n\'y aura pas de nouveau jam démarré au cours d\'une période, en considérant qu\'aucun temps mort n\'est appelé ?', '1.4.3', 1323273755, ''),
