(1489, 'Jammer A has been sent to the penalty box to serve 2 minutes. Jammer A has served 1 minute and 45 seconds when Jammer B arrives at the penalty box and sits. What happens?', '6.3.10.1', 1356784096, 'Whilst the rules say each jammer should serve the same amount of time, that\\\'s on a per-penalty basis. So the 1 min 45 seconds is two penalties, only one is used in the calculation of time to sit.'),
