(37, '86.29.15.179', 1333733335, 818, 0, 'Question #818: I\\\'m reporting question #818 because ... hi, i\\\'m not sure if this example is getting at the right point of the rule 8.5.5.1, in that in the example for the question \\"jammer scores for the first time\\" so they are in the pack passing the first blocker, \\"they gain a piont for each opposing skater returning from the penalty box in front of them\\" the blockers couldn\\\'t legally do this, enter in front of the jammer,... rule 8.5.5.1 has the skaters reentering ahead of the jammer before they have started to score,. the point of the rule is about having to earn the points for the skaters returning from the bin ahead of them (opposed to earnng points for skaters sent off in front of them as they score there first point) so this is wrong because it just couldn\\\'t happen legally not just because they have to earn the points...', 2),
