(42, '71.79.33.24', 1333941899, 478, 0, 'Question #478: I\\\'m reporting question #478 because ... This questions asks about counter-blocking, the question is not about the blocker who initiated the block.  This questions states (A) is correct and then refers to 6.8.15.  But, 6.8.15 speaks about what the initiaing blocker has to do not what the counter-blocker has to do.  The player counter-blocking should be able to continue counter blocking until the initiating players stops her blocking.  This should be done if for nothing else the safety of the player being blocked. The counter blocker can\\\'t just stop counter blocking cause her skate went out of bounds when the initiating blocker is still engaged with the block and possibility get pounded into the ground.', 3),
