(54, '24.67.199.240', 1334209462, 198, 0, 'Question #198: I\\\'m reporting question #198 because ... \r\n\r\n\\"True or False: A Jammer can transfer the star if a they are returning from the penalty box and have not yet returned to play.\\"\r\n\r\nWith \\"a\\" removed should be..\r\n\r\n\\"True or False: A Jammer can transfer the star if they are returning from the penalty box and have not yet returned to play.\\"', 2),
(55, '12.13.14.15', 1334226078, 159, 0, 'Question #159: I\\\'m reporting question #159 because ... \r\nA misspelling of the word \\"their\\" in \\"some part of ther body\\" phrase.\r\n\r\n:)\r\n\r\nThis is a great review before a rules test - I just pointed 10 of our Newbies to your page yesterday. And I\\\'m finding holes in my rules knowledge, so your site has been recommended to everyone in the European officiating community. Thank you for making it available!\r\n\r\nDr. No-No, Referee\r\nBear City Roller Derby, Berlin, Germany', 2),
(56, '24.231.188.208', 1334340442, 237, 0, 'Question #237: I\\\'m reporting question #237 because ... \r\n\r\nTaken out of context, it\\\'s ambiguous whether the question is referring to a team\\\'s Charter (20) or their Roster for a bout (14). I realize that the question is a direct quote from the literal 1st rule in the book, but it only makes real-world sense when read in conjunction with 1.2.', 3),
(57, '24.231.188.208', 1334342057, 924, 0, 'Question #924: I\\\'m reporting question #924 because ... \r\n\r\n\\"Only\\" is NOT in 10.3.4, and that word totally changes the meaning of the sentence. That particular rule is *allowing* players to play with doctor\\\'s clearance. The only thing that would *disallow* previously-injured skaters from playing is the Head Ref\\\'s discretion. There\\\'s not an explicit rule against injured skaters playing.', 2),
(58, '24.231.188.208', 1334342685, 10, 0, 'Question #10: I\\\'m reporting question #10 because ... \r\n\r\nGrammar: \\"Are\\" should be \\"is\\". \\"Method\\" is the subject, and it\\\'s singular. It\\\'s wrong in the rulebook too, but two wrongs don\\\'t make a right. :-)', 2),
(59, '24.231.188.208', 1334343399, 707, 0, 'Question #707: I\\\'m reporting question #707 because ... \r\n\r\nI\\\'m nitpicky about this stuff, often asking NSOs to relabel the inside whiteboard to say \\"Minutes\\" instead of \\"Majors\\", but this question is needlessly confusing to the test-taker. If you want to press the point of whether a 4th-Minor-Minute is *called* a Major or not, then ask that question specifically.', 1),
(60, '76.184.101.69', 1334372159, 771, 0, 'Question #771: I\\\'m reporting question #771 because ... \r\n\r\n7.5.2.6 Coaches and managers are held to the same standard of sportsmanlike behavior as skaters. If a coach or manager is expelled (see Section 7.5.2.1), that team’s Captain will serve a one (1) minute penalty. However, that penalty does not count towards the skater’s penalty cap (see Section 7.5.1.1.1). \r\n\r\nIn the above case, the captain would be serving a major penalty but it does not count toward her fouling out. \r\n\r\nBTW, I really appreciate you putting this together- I know it must have been a TON of work.  I hope you take these corrections as my small contribution to make this more awesome, and not in a negative way.  Thanks so much!', 3),
