(63, '86.19.239.213', 1334769272, 311, 0, 'Question #311: I\\\'m reporting question #311 because ... \r\n\r\nIt should also be added that if there is a no pack situation when first whistle blows, the jammer whistle will be blown immediately after.', 3),
