(66, '71.23.91.114', 1335444933, 344, 0, 'Question #344: I\\\'m reporting question #93 because ... \r\n\r\nFirst there’s:\r\n\r\n2.6.4.1 If the officials call a time out during a jam in progress, the jam will end and a new jam will be run if there is time remaining on the official period clock (see Section 2.3.4).\r\n\r\nThere’s a distinct difference between “officials” and “referees” in the rules, thus the inclusion of “officials” in this rule allows for the possibility of a non-skating official to call a timeout. And also:\r\n\r\n2.8.2.3 Officials must stop the official period clock between jams when time exceeds thirty (30) seconds.\r\n\r\nThe official period clock is stopped only for timeouts (2.8.2.2), thus the officials can only stop the clock by calling an official timeout. \r\n\r\nBasically, non-skating officials may call timeouts, however they may only be official timeouts. Only referees may signal for a team timeout; they don’t actually call the timeout, the Captain or Designated Alternate from either team does. \r\n\r\nRDRotD', 3),
(67, '71.23.91.114', 1335445181, 640, 0, 'Question #640: I\\\'m reporting question #640 because ... \r\n\r\nThis rule should read:\r\n\r\n“... and re-enters the track in front of one *pack* skater”. This is …”\r\n\r\n6.13.11 - A skater, after addressing mid jam equipment malfunction, re-entering the track in front of one pack skater.\r\n\r\nAfter all, there is no penalty for returning from addressing an equipment malfunction in front of either or both Jammers. \r\n\r\nRDRotD', 3),
(68, '63.246.173.134', 1335445216, 316, 0, 'Question #316: I\\\'m reporting question #316 because ... I read that as the first set of four whistles, which would make the answer true, but since the correct answer is false, I assume you meant the first whistle blast of four.  Therefore, i think you should clarify the question to say first whistle blast of four to make it clearer.', 3),
(69, '71.23.91.114', 1335445493, 381, 0, 'Question #381: I\\\'m reporting question #381 because ... \r\n\r\nAlthough I understand the intent of this question, I don’t particularly agree with its wording. Technically, a skater gets a major penalty for habitually falling small in front of opponents after the third time. Meaning, she falls small a third time, and after it has happened the penalty is issued. So going by actual course of action, a skater can fall small three times before getting a major penalty for it, not twice. They can do so twice without getting a penalty at all, and then after the third time they get the penalty\r\n\r\nRDRotD', 2),
(70, '71.23.91.114', 1335469365, 54, 0, 'Question #54: I\\\'m reporting question #54 because ... Seems piddly but I would change \\"period timer\\" to \\"official period clock\\".\r\n\r\nRDRotD', 3),
(71, '71.23.91.114', 1335469472, 717, 0, 'Question #717: I\\\'m reporting question #717 because ... Nothing wrong with the question, but the Q says \\"penalized\\" but the answers all say \\"penalised\\".\r\n\r\nRDRotD', 3),
(72, '71.23.91.114', 1335469596, 18, 0, 'Question #18: I\\\'m reporting question #18 because ... More piddly grammar stuff, but you\\\'ve mixed \\"color\\" and \\"colour\\" in the answers here.\r\n\r\nRDRotD', 3),
(73, '72.15.28.210', 1335470145, 428, 0, 'Question #428: I\\\'m reporting question #428 because ... \r\n\r\nthe referenced rule states - 6.7.3 - Touching and assisting teammates that does not create a wall to impede an opponent or prevent receiving a block from an opponent is not a multi-player block.\r\n\r\nThe answer reads - Touching and assisting teammates to create a wall to prevent receiving a block from an opponent You Win! See rule 6.7.3 (view on WFTDA.com)\r\n\r\nthe question reads - Which of these is a multi-player block: \r\n\r\nThe rules states that touching and not creating a wall is NOT a penalty, but it does NOT state that the act of making a wall by doing this IS automatically a penalty.  Touching the arm of my team mate while in a wall, even if it impedes another skater is NOT a multi-player block.  I would have to be gripping their arm and the point where I am gripping them would have to be impeding the opposing skater.  Answer A in no inherently wrong, more detail needs to be provided for it to be a wrong answer.  \r\n\r\nThis issue has been discussed at length on Zebra huddle and the WFTDA has provided clarification on this.', 3),
