(78, '72.145.221.36', 1335551561, 675, 0, 'Question #675: I\\\'m reporting question #675 because ... As linked to the WFTDA rules website, Misconduct is listed as \\"Not Applicable\\" for expulsion. While true that a second occurrence of the same Misconduct penalty becomes a Gross Misconduct, it would be called as a Gross Misconduct, and the player would be removed for committing Gross Misconduct, not normal Misconduct. This question is technically False.', 2),
(79, '198.134.101.10', 1335554585, 805, 0, 'Question #805: I\\\'m reporting question #805 because ... the wording is misleading. to say the Jammer returns to her previous pass means she is able to score on players not previously scored on in the previous pass. we know this is untrue. the issue here is the ambiguity of the word \\\'pass\\\' in the rules, but the author of the question needs to be aware of this and adjust their wording accordingly.', 3),
