(89, '71.123.53.109', 1335845341, 104, 0, 'Question #104: I picked the correct answer of A not necessarily because it was right but because B didn\\\'t make any sense whatsoever. Of course you\\\'d need separate clocks for a separate game, but I believe 2.8.1 is specifies that you\\\'d have to have SEPARATE clocks for each of the 3 timings. Those 3 separate clocks can run multiple games. I suggest B should read, \\"1 clock may be used for all three purposes\\" or \\"each game may use a single clock for multiple purposes.\\" ~SmackTavish, Brandywine Roller Girls', 2),
