(100, '67.128.73.34', 1336267765, 286, 0, 'Question #286: I\\\'m reporting question #286 because all blockers must be on the track at the start of the jam. Legally, they need to be in front of the jammers and behind the pivots, but a blocker could also begin the jam ON the track, behind the jammers, and receive an IP minor while she still remains a part of the jam. This question should be altered to reflect the legality of the blockers.', 3),
(101, '94.193.254.29', 1336341611, 782, 0, 'Question #782: I\\\'m reporting question #782 because ... \r\n\r\nIntentional contact could be anything including the shaking of hands, the rule is badly worded by the WFTDA - Malice ;)', 1),
(102, '220.233.85.241', 1336382528, 730, 0, 'Question #730: Rule 7.3.2.3 Refers to BLOCKERS not Jammers.\r\n\r\nA Blocker can be waved off from the penalty box.  A Jammer must sit.', 1),
(103, '166.147.72.17', 1336497024, 44, 0, 'Question #44: I\\\'m reporting question #44 because ... Double = two, so how can it be more than 2 events.\r\n2 or more games combined into one event is a multi-header not a double header...', 3),
(104, '72.15.28.210', 1336592699, 583, 0, 'Question #583: Need to modify question to specify that it is NOT the foremost blocker for the opposing team, in which case it would be a major penalty.  As the questions stands now, it could be either a minor or a major.  \r\n\r\n6.11.9 - An upright skater straddling the track boundary who passes one in-play skater, and then ceases her out of bounds contact with the floor, which results in her having bettered her position.\r\n\r\nTrue\r\n\r\n6.11.15 - An in bounds, upright and skating skater who has re-entered the track from out of bounds in front of the foremost in-play opposing Blocker, which results in her having bettered her position.\r\n\r\ncould also be true, in which case the penalty would be a major', 2),
(105, '198.228.234.16', 1336679001, 357, 0, 'Question #357: I\\\'m reporting question #357 because ... Is the skater being pushed out of position skating counter-clockwise, but facing her opponent--that is, is she skating backwards? Then, wouldn\\\'t a legal target zone be available?', 3),
(106, '86.29.15.179', 1336680423, 568, 0, 'Question #568: I\\\'m reporting question #568 because ... false also because ; 6.11.1.2 - When the initiating skater goes out of bounds at any time after the initiating block.', 1),
(107, '128.174.192.159', 1336685064, 770, 0, 'Question #770: I\\\'m reporting question #770 because ... According to section 7.4, it states that \\"When the second Jammer is seated in the penalty box, the first Jammer, who has already been serving her time, is released back into play by the penalty box official. The exact amount of time the first Jammer served before she was released will be the exact amount of time the second Jammer will serve before she is released back into play.\\" The question states that Jammer A served 1 min 45 sec, but the correct answer indicates Jammer B must sit for 45 seconds...that is not correc. Jamber B must sit for 1 min 45 sec as well.', 1),
(108, '99.107.231.114', 1336688539, 286, 0, 'Question #286: I\\\'m reporting question #286 because ... \r\nI think \\"must\\" is too strong a term for a position that they do not, in fact, have to occupy.\r\nThey \\"Must!\\" however, be \\"(C) On the track\\" in order to participate in the jam. \r\n\r\nI\\\'d remove \\"On track\\" as an answer, and change the end of the question to \\"must all Blockers be to avoid penalties.\\"', 3),
(109, '99.51.101.67', 1336689220, 216, 0, 'Question #216: I\\\'m reporting question #216 because ... Cannot is one word.', 3),
(110, '99.107.231.114', 1336689305, 833, 0, 'Question #833: I\\\'m reporting question #833 because ... \r\nI think this is an unnecessarily tricky question. I think there are valid arguments for either (b) or (c) as the correct answer; certainly they can\\\'t score on blockers in the new initial pass, but there is no \\"list of blockers that the jammer can\\\'t score on, because she scored on them in the previous pass/jam\\", and I think the question implies that there is.\r\n\r\nIt\\\'s obtuse to say that she \\"can\\\'t score on any blockers because it\\\'s an initial pass\\", when \\"she can score on all of the blockers, as soon as she finishes her initial pass.\\"\r\n\r\nFranky, I\\\'d just kill this question, and devise a couple of new ones that are more specific.', 3),
(111, '129.97.124.80', 1336759307, 604, 0, 'Question #604: I\\\'m reporting question #604 because ... Foremost blocker escalates it form a minor to a major.', 1),
(112, '99.107.231.114', 1336775548, 867, 0, 'Question #867: I\\\'m reporting question #867 because ... \r\n\r\nor, until she loses Lead Jammer status.', 1),
(113, '99.107.231.114', 1336775883, 713, 0, 'Question #713: I\\\'m reporting question #713 because ... \r\n\r\n\\"When to major penalties on Blockers expire?\\" would be better.', 3),
(114, '99.107.231.114', 1336776123, 772, 0, 'Question #772: I\\\'m reporting question #772 because ... \r\n\r\nOkay, I admit that this is nitpicky, but if a skater fouls out with anything more than zero minors, then those minors \\"didn\\\'t count\\" towards her fouling out. For example, should could foul out (with her 7th trip to the box having been caused by a Major penalty) with 7 majors, and 3 minors. The 3 minors didn\\\'t count.\r\n\r\nThanks again for doing this project, it\\\'s been a huge help to me.', 3),
(115, '99.107.231.114', 1336776225, 942, 0, 'Question #942: I\\\'m reporting question #942 because ... \r\n\r\nWouldn\\\'t she also lose her Lead Jammer status when a teammate removed her cover? \r\n\r\nI think yes.\r\n', 1),
(116, '94.0.178.38', 1336782712, 312, 0, 'Question #312: I\\\'m reporting question #312 because ... option d. \\"Breaking\\" is incorrectly spelled; the correct spelling should be \\"Braking\\".', 2),
(117, '203.206.246.232', 1336912885, 257, 0, 'Question #257: I\\\'m reporting question #257 because ... It begins by asking about small characters (letters) but at the end it refers to them as digits(numbers)', 2),
(118, '203.206.246.232', 1336913734, 135, 0, 'Question #135: I\\\'m reporting question #135 because ... How can a player be a jammer and a pivot at the same time?  Are they cloned or something? lol', 1),
(119, '203.214.81.190', 1336982224, 583, 0, 'Question #583: I\\\'m reporting question #583 because ... If the one in-play skater is the front most blocker then it is a major!', 2),
(120, '203.214.81.190', 1336982319, 110, 0, 'Question #110: I\\\'m reporting question #110 because ... The answers are not worded properly and are not complete.', 1),
(121, '203.214.81.190', 1336983057, 607, 0, 'Question #607: I\\\'m reporting question #607 because ... Shouldn\\\'t it read \\"A skater is forced out of bounds by an opponents block\\" ?', 3),
(122, '203.214.81.190', 1336984245, 310, 0, 'Question #310: I\\\'m reporting question #310 because ... This is a tricky one.  The pack may start rolling before the first whistle but they may not pass the pivot line as there are no penalties for rolling before the first whistle, only for crossing the pivot line.  I guess WFTDA need to define what \\\'rolling\\\' is.', 4),
(123, '203.214.81.190', 1336990932, 207, 0, 'Question #207: I\\\'m reporting question #207 because ...\r\n 3.5.8.2 - A helmet cover may only be recovered in the normal course of counter-clockwise skating. Neither backwards nor forwards skating in the clockwise direction to retrieve a dropped helmet cover is allowed. The Jammer or Pivot may skate out of bounds to retrieve a dropped helmet cover.', 2),
(124, '203.214.81.190', 1336993584, 543, 0, 'Question #543: I\\\'m reporting question #543 because ...  the warning is optional.\r\n\r\n6.10.1 - A skater who is more than twenty (20) feet in front of or behind the pack may receive an out of play warning by a referee; however, a referee is not required to issue a warning prior to giving a penalty. Issuing penalties takes priority over issuing warnings. A warning does not have to be issued in order for a penalty to be given (see ).', 3),
(125, '66.87.4.234', 1337004218, 363, 0, 'Question #363: I\\\'m reporting question #363 because ... The question says unsuccessful, but rule 6.1.4 says \\"contact\\".', 3),
(126, '12.54.94.24', 1337007938, 25, 0, 'Question #25: I\\\'m reporting question #25 because ... \r\nHeight is spelled wrong :)', 3),
(127, '66.87.4.234', 1337019309, 774, 0, 'Question #774: I\\\'m reporting question #774 because ... I feel a wording change of \\"a skater serving as a... \\" would clarify the question.', 3),
(128, '203.214.81.190', 1337151517, 442, 0, 'Question #442: I\\\'m reporting question #442 because ... \r\nThis question is poorly worded.  Rule 6.8.1 refers to Out Of Bounds Blocking.\r\nAll the answers above may be right depending on the situation.', 3),
(129, '203.214.81.190', 1337151819, 520, 0, 'Question #520: I\\\'m reporting question #520 because ...\r\nThis question is not worded correctly.  The have incorrectly used the adverbs \\\'intentionally\\\' and \\\'illegally\\\'.\r\n\r\n\r\n 6.9.20 - Intentional, negligent, or reckless contact with an opponent while stopped on the track in an illegal manner.', 3),
(130, '203.214.81.190', 1337152905, 363, 0, 'Question #363: I\\\'m reporting question #363 because ...\r\nIt has to be successful or egregious.\r\n\r\nThe following egregious acts will be automatic game expulsions, and can be punished as a multi-game suspension (see Section 7.5.2.2). Expulsions will be issued for a conscious, forceful attempt to block an opponent in the back egregiously, whether or not the action was successful.\r\n\r\n\r\n6.1.4 - Intentional, negligent, or reckless illegal contact to the back of an opponent, back of an opponent’s legs, or back of an opponent’s booty.\r\n\r\ngre·gious&#8194; &#8194;[ih-gree-juhs, -jee-uhs]  Show IPA\r\nadjective\r\n1.\r\nextraordinary in some bad way; glaring; flagrant: an egregious mistake; an egregious liar.\r\n2.\r\nArchaic . distinguished or eminent.\r\n', 1),
(131, '203.214.81.190', 1337153611, 560, 0, 'Question #560: I\\\'m reporting question #560 because ... \r\nPoorly worded answers.\r\nMaybe it should say :When they return to an in-bounds position and the skater is upright and skating.', 3),
(132, '203.214.81.190', 1337153889, 60, 0, 'Question #60: I\\\'m reporting question #60 because ...\r\n\r\n2.4.2 - A jam may last up to two (2) minutes. Jams end on the FOURTH whistle of the jam-ending signal (see Section 2.9 - Whistles).', 1),
(133, '203.214.81.190', 1337154196, 704, 0, 'Question #704: I\\\'m reporting question #704 because ... What the hell has this got to do with roller derby?  It is funny tho but we have never heard of the term in our league.', 1),
(134, '203.214.81.190', 1337154473, 670, 0, 'Question #670: I\\\'m reporting question #670 because ... \r\nThis isn\\\'t worded very well.\r\n', 3),
(135, '75.110.192.108', 1337203560, 380, 0, 'Question #380: I\\\'m reporting question #380 because ... \r\n\r\nIt is wrong, rules say three times - also rules sat tripping an opponent. I\\\'m not sure if you\\\'d call tripping on a teammate.', 2),
(136, '71.204.215.103', 1337225790, 380, 0, 'Question #380: I\\\'m reporting question #380 because ... According to 6.3.8 it is only 3 or more times during the course of a bout that habitual contact during the normal course of skating may begun to be called as Major penalties.\r\n\r\n\\"6.3.8 - Habitual contact, three or more times during the course of a bout, between skates and wheels that is part of the normal skating motion that causes an opposing skater to stumble or fall or lose her relative position. The intent is to penalize skaters whose normal skating motion is dangerous to her opponents. A single skater who repeatedly trips other skaters, even with her normal skating motion is adversely affecting game play and safety.\\"', 2),
(137, '203.20.33.97', 1337234492, 144, 0, 'Question #144: I\\\'m reporting question #144 because ... Hi! Great work on quiz! Just thinking that it\\\'s not mandatory to field a pivot, but if u do, it must be a blocker as it could not be a jammer. Is it just enough to ask \\\'is is mandatory to field a pivot?\\\' thanks!', 3),
(138, '203.20.33.97', 1337234501, 144, 0, 'Question #144: I\\\'m reporting question #144 because ... Hi! Great work on quiz! Just thinking that it\\\'s not mandatory to field a pivot, but if u do, it must be a blocker as it could not be a jammer. Is it just enough to ask \\\'is is mandatory to field a pivot?\\\' thanks!', 3),
(139, '203.214.81.190', 1337245409, 326, 0, 'Question #326: I\\\'m reporting question #326 because ... \r\nPlayers can be SKATING or STEPPING in the counter clockwise direction.\r\n5.1.1.3\r\nOnly players who are stepping and/or skating in the counter-clockwise direction may execute a block. It is illegal to block while at a standstill and while moving in the clockwise direction—this includes positional blocking.', 1),
(140, '203.214.81.190', 1337246919, 873, 0, 'Question #873: I\\\'m reporting question #873 because ...\r\nNot worded properly.\r\n\r\n9.2.6.1.8 - Too many skaters on the track. After the jam has started referees will expeditiously pull any extra skaters so that the jam does not have to be called off (see Section 9.2.6.2.6).\r\n\r\n9.2.6.2.6 - Too many skaters on the track that gives that team a competitive advantage.', 3),
(141, '203.214.81.190', 1337247328, 929, 0, 'Question #929: I\\\'m reporting question #929 because ... \r\n\r\ncorrect link.\r\n\r\n7.3.7.3 - A skater may re-enter the track in front of opposing skaters who are out of play. If a Jammer is eligible to score (having completed her initial pass prior to being sent to the penalty box), she will immediately earn points for passing out-of-play Blockers that are behind her upon re-entry.', 3),
(142, '203.214.81.190', 1337247732, 421, 0, 'Question #421: I\\\'m reporting question #421 because ... \r\nRule 6.6 only addresses blocking with the head.  It does not address making contact with the head and a team mate.\r\n\r\nOnly INCIDENTAL contact will be considered No Impact/No Penalty.', 3),
(143, '203.214.81.190', 1337248071, 601, 0, 'Question #601: I\\\'m reporting question #601 because ... \r\n\r\nDid they pass any players while out of bounds?', 3),
(144, '12.145.65.167', 1337369163, 676, 0, 'Question #676: I\\\'m reporting question #676 because ...\r\n\r\nThe issue of misconduct against a teammate is controversial and still a bit of grey area until there is a clarification from WFTDA.\r\n\r\nhttp://www.zebrahuddle.com/index.php?topic=2513.0', 4),
(145, '24.92.69.107', 1337621232, 946, 0, 'Question #946: I\\\'m reporting question #946 because none of the answers are correct. The relevant rule is...\r\n\r\n6.8.9 --  If a skater jumps and ceases all contact with the ground, (their) prior in bounds/out of bounds status is maintained until contact with the ground re-establishes in bounds/out of bounds status.\r\n\r\n...so maybe a \\"depends\\" answer should be added as the correct one?\r\n\r\n- Ming the Merciless\r\nMilwaukee Blitzdkrieg / Paper Valley Roller Girls / Green Bay Smackers\r\n', 3),
(146, '24.92.69.107', 1337623718, 410, 0, 'Question #410: I\\\'m reporting question #410 because the term \\"hitting\\" zone is arbitrary. Suggest replacement with \\"target\\" zone.\r\n\r\n-- Ming the Merciless\r\nMilwaukee Blitzdkrieg / Paper Valley Roller Girls / Green Bay Smackers', 3),
(147, '46.64.94.168', 1337630842, 946, 0, 'Question #946: This question\\\'s really unclear.\r\n(Hello!) :)\r\nAnnette', 3),
(148, '124.170.96.182', 1337652689, 659, 0, 'Question #659: I\\\'m reporting question #659 because ... \r\n6.13.20 - Violations of the Passing the Star procedures outlined in Section 3.5 - Passing the Star. The initiator of the star pass receives the penalty for the illegal star pass.', 3),
(149, '124.170.96.182', 1337653557, 321, 0, 'Question #321: I\\\'m reporting question #321 because ... \r\nWhat is J blocking?\r\n  I can\\\'t find it in the rules.', 2),
(150, '124.170.96.182', 1337654020, 517, 0, 'Question #517: I\\\'m reporting question #517 because ...\r\nIt has to be an illegal block to be an expulsion. \r\n\r\n6.9.19 - Intentional, negligent, or reckless contact with an opponent while executing a clockwise block in an illegal manner.', 3),
(151, '124.170.96.182', 1337654167, 333, 0, 'Question #333: I\\\'m reporting question #333 because ... \r\n\r\nI am a reff, I am never in play, this should be worded more objectively.\r\neg\r\nIf a skater who is in play and either stepping or skating counter-clockwise, they may:', 3),
(152, '124.170.96.182', 1337654614, 333, 0, 'Question #333: I\\\'m reporting question #333 because ... \r\n\r\nI am a reff, I am never in play, this should be worded more objectively.\r\neg\r\nIf a skater who is in play and either stepping or skating counter-clockwise, they may:', 3),
(153, '63.163.61.3', 1337707965, 754, 0, 'Question #754: I\\\'m reporting question #754 because it states only one Jammer is sent to the penalty box, so the two Jammers in the box rules don\\\'t apply. That means that the Jammer would serve, at minimum, one minute for whatever sent her to the box. Make sense? 7.4.2 refers to situations where two Jammers are both sent to the box as it is under section 7.4. If you disagree or have any questions my email is pcasagrande@gmail.com.', 2),
(154, '97.89.245.31', 1337725697, 157, 0, 'Question #157: I\\\'m reporting question #157 because ... 3.4.2.1 - Any legal pass counts. If a jammer becomes ineligible for lead jammer by committing a foul or passing while out of bounds, she is allowed an opportunity to re-pass and regain eligibility for lead jammer status.', 3),
(155, '99.72.100.178', 1337745726, 754, 0, 'Question #754: I\\\'m reporting question #754 because ...  In a previous question and I wish I knew which, you needed to determine the minimum amount of time a jammer needs to spend in the box... which was 10 seconds.', 2),
(156, '99.239.11.59', 1337965500, 768, 0, 'Question #768: I\\\'m reporting question #768 because ... The exact amount of time the first Jammer served before she was released will be the exact amount of time the second Jammer will serve before she is released back into play. (Section 7.4.4 is still applicable.) I could be misunderstanding the question, forgive me if I have..', 3),
(157, '75.110.192.108', 1338001759, 946, 0, 'Question #946: I\\\'m reporting question #946 because ... if the skater is jumping from in bounds both their skates are off the track and they are still in bounds.', 3),
(158, '99.62.233.145', 1338003692, 659, 0, 'Question #659: I\\\'m reporting question #659 because ... \r\n\r\nWas it the intended receiver who violated star pass procedures?  \\"A skater\\" could mean anyone.  And who are you evaluating the penalty on?', 3),
(159, '99.62.233.145', 1338004072, 604, 0, 'Question #604: I\\\'m reporting question #604 because ... \r\n\r\nThis is unclear if the foremost opposing blocker is part of the pack or not.  The wording should be \\"During a No Pack scenario, a jammer straddling the track boundary passes passes the foremost opposing blocker then skates back in bounds\\".  This establishes that the no pack scenario exists prior to the pass.', 3),
(160, '99.62.233.145', 1338004500, 286, 0, 'Question #286: I\\\'m reporting question #286 because ... \r\n\r\nNeed to add a note about in front of the jammer line AND behind the pivot line.  In front of the pivot line, they\\\'re still directionally in front of the jammers and the question may be unclear.', 4),
(161, '99.62.233.145', 1338004895, 494, 0, 'Question #494: I\\\'m reporting question #494 because ... \r\n\r\nI\\\'m not sure what happened here.  6.9.2.1 clearly states:\r\n\r\n\\"6.9.2.1 - A stopped or counter-clockwise stepping/skating player may legally assist a stopped or downed teammate.\\"\r\n\r\nThe question does not specify an opposing skater or teammate, so the answer is impossible to verify since it could be a penalty or nothing.', 2);
INSERT INTO `rdtom_reports` (`ID`, `IP`, `Timestamp`, `Question_ID`, `User_ID`, `Text`, `Status`) VALUES
(162, '99.62.233.145', 1338005106, 603, 0, 'Question #603: I\\\'m reporting question #603 because ... \r\n\r\nThe \\"no pack scenario\\" needs to be declared in the question before the action to make it clear that it existed prior to the action.  It doesn\\\'t change the answer, but it makes the question wording more precise.', 3),
(163, '99.62.233.145', 1338005474, 97, 0, 'Question #97: I\\\'m reporting question #97 because ... \r\n\r\nNot really sure what this is asking.  Are you implying:\r\n\r\n-only referees can call official timeouts?\r\n-only referees can call timeouts?\r\n-the only time an official timeout can be called is between jams? (I think you mean this?)', 3),
(164, '66.188.107.3', 1338010053, 752, 0, 'Question #752: I\\\'m reporting question #752 because ... There is no correct answer with the information included.  Nothing in the scenario indicates that this is a 7.4.1 scenario where both jammers will remain in the box.  This appears to be a 7.4.3 scenario where jammer B arrives at the box between jams and jammer A\\\'s penalty service is considered complete at the end of the previous jam.  In that scenario both jammers start in the box but the first jammer has no required penalty time to serve.\r\n\r\nThe only way to correctly adjudicate the scenario as involving 7.4.1 and thus 7.4.1.1 as it is written is to use the lack of a 7.4.3 based answer to metagame the question and fill in the missing details.  The question lacks sufficient detail to prove that 7.4.1 is active.', 2),
(165, '66.188.107.3', 1338010499, 768, 0, 'Question #768: I\\\'m reporting question #768 because ... 0 seconds is a more technically correct answer.  Jammer B is required to enter the box and sit before her penalty is considered complete.  No time could be read to imply that she does not have to sit in the box and initiate timing of her penalty.', 3),
(166, '99.62.233.145', 1338019334, 754, 0, 'Question #754: I\\\'m reporting question #754 because ... \r\n\r\nI\\\'m not sure what this is asking.  The question specifically states only one jammer is sent to the penalty box, and the rule it\\\'s referencing specifically states it\\\'s only applicable if both jammers arrive in the box at the same time.', 2),
(167, '66.195.158.172', 1338065322, 791, 0, 'Question #791: I\\\'m reporting question #791 because ... This question is incorrect.  The question reads: \r\n\r\nA Fouled Out skater\\\'s 7th penalty timer begins when...\r\n\r\nA.The Fouled Out skater is sat in the penalty box You Win! See rule 7.5.5.1 (view on WFTDA.com) The correct answer. See rule 7.5.5.1 (view on WFTDA.com)\r\nB.The Fouled Out skater\\\'s substitute is sat in the penalty box Wrong!\r\n\r\nThe answer to this question is incorrect.  The fouled out skater never sits in the penalty box to serve her time.  The skater who foules out must leave the area and return to the locker room or staging area at once.  Thus she cannot be serving her time in a penalty box.', 2),
(168, '24.240.40.156', 1338126309, 771, 0, 'Question #771: I\\\'m reporting question #771 because ... There is one exception where a penalty is assigned to a skater but does not count towards their penalty total.\r\n\r\nIn 7.5.2.6 when a member of the bench staff is expelled the penalty is assigned to the captain but does not count towards their penalty cap for purposes of fouling out.', 3),
(169, '70.109.179.107', 1338141635, 770, 0, 'Question #770: I\\\'m reporting question #770 because ... \r\n\r\nThe answer choices are wrong. It should be \\"Jammer B is released and Jammer A must sit for 45 seconds.\\"', 3),
(170, '121.214.179.197', 1338341266, 770, 0, 'Question #770: I\\\'m reporting question #770 because ... \r\nUnless I’m reading it wrong, the rule that you refer to states that:  \r\n-Jammer B would be released immediately after sitting down, and Jammer A, who is serving more than one minute, would immediately have her time reduced down by 1 minute, leaving her with 45 seconds to serve before being released.\r\nIf Jammer B arrived when she had less than a minute, then normal rules would apply.\r\n\r\nBy the way, this site is AWESOME!! We’re a developing league, I see this site being an invaluable teaching tool for all of our members, thank you!! :D', 3),
(171, '24.218.46.28', 1338394603, 905, 0, 'Question #905: I\\\'m reporting question #905 because ... \r\nthis is misleading,  the number has no restrictions if you include your name but if you decide to be identified by ONLY a number then there are restrictions placed on it.', 4),
(172, '166.147.72.31', 1338395454, 929, 0, 'Question #929: I\\\'m reporting question #929 because ... \r\n\r\nUnder cutting penalties it clearly stages that out of play players can be cut on. See 6.11.12 and 6.11.18 thanks :)', 1),
(173, '114.74.156.161', 1338430310, 62, 0, 'Question #62: I\\\'m reporting question #62 because ... I believe the wording \\".. if ALL skaters..\\"  could be interpreted as refering to every skater intended to play in that jam IE there is not a single player on the track when the jam starts.', 3),
(174, '119.224.10.196', 1338524831, 292, 0, 'Question #292: I\\\'m reporting question #292 because ... \r\noption A and C are the same- merely worded differently ?', 4),
(175, '128.220.16.142', 1338562665, 246, 0, 'Question #246: I\\\'m reporting question #246 because ... \r\n\r\nThe question is vague. It\\\'s mandatory to be worn, but does not have to be worn on the arm (it can be on the uniform).\r\n\r\n3.7.2 - The team Captain must visibly display a “C” on her uniform or arm. The team Captain’s Designated Alternate must visibly display an “A” on his or her uniform or arm.', 3),
(176, '63.246.173.134', 1338563209, 718, 0, 'Question #718: I\\\'m reporting question #718 because ... Answer b (immediately) is spelled incorrectly.  Thanks!', 2),
(177, '63.246.173.134', 1338564058, 943, 0, 'Question #943: I\\\'m reporting question #943 because ... It would be a major if the the jammer falls over as a result of the back block, but the question does not make it clear that the falling was the result of the impact.  If the jammer just fell because she lost herbalance or was flopping, it would be a minor.', 3),
(178, '184.32.120.138', 1338564179, 157, 0, 'Question #157: I\\\'m reporting question #157 because ... In the event a Jammer has passed all blockers in bounds \\"Except\\" the foremost opposing blocker,(who also happens to be the foremost in-play blocker) who then illegally blocks the Jammer causing a lost of relative position(out of bounds). Once the Penalty has been observed (hopefully called by the front inside pack ref) the Jammer in question has satisfied the requirement to legally pass all Blockers while in bounds, and should be signaled Lead Jammer.', 3),
(179, '63.246.173.134', 1338564437, 466, 0, 'Question #466: I\\\'m reporting question #466 because ... Using the pronoun \\"their\\" implies that it refers to both skaters, but it is actually just referring to one skater\\\'s skate.  For the sake of clarity, it would probably be best to use colors to differentiate the blockers.\r\n\r\nAlso, \\"remember\\" as part of the \\"remember me\\" on the login page is spelled incorrectly.', 3),
(180, '98.192.201.41', 1338781307, 946, 0, 'Question #946: I\\\'m reporting question #946 because ... one of the answers \\"When both skates are off the track.\\" is slightly misleading.  My interpretation of this answer was potentially if the skater was airborne, which would not be an out-of-bounds status if the skater jumped while still in-bounds.', 3),
(181, '50.36.42.85', 1338986327, 71, 0, 'Question #71: I\\\'m reporting question #71 because it\\\'s poorly worded/confusing.\r\n\r\nWhen I read it, it seemed to me (through reading the options for answering) that it was actually implying not on the track.\r\n\r\n\r\nA.  They are subject to false start penalties - The correct answer. See rule 2.4.4.2 (view on WFTDA.com)\r\nB.  They must sit out this jam and the team skates down - Wrong!\r\nC.  There are no penalties', 3),
