(192, '134.156.105.24', 1339432190, 929, 0, 'Question #929: I\\\'m reporting question #929 because ... \r\n\r\nWhen there is a No Pack situation, skaters are still eligibel for track cutting penalties - \r\n\r\n6.11.12 An in bounds, upright and skating skater who has re-entered the track from out of bounds in front of one in-bounds skater during a No Pack scenario, which results... in her having bettered her position relative to that in bounds skater.\r\n\r\n6.11.18 An in bounds, upright and skating skater who has re-entered the track from out of bounds in front of multiple in-bounds skaters during a No Pack scenario, which results in her having bettered her position relative to those in bounds skaters.\r\n', 3),
(193, '50.52.12.141', 1339437005, 316, 0, 'Question #316: I\\\'m reporting question #316 because ... While I know it is not in the rule set as of yet, but WFTDA leagues are using three sets of four whistles to call off the jam.  For that reason, I understood this question as \\"does the jam end on the first whistle blast of four (as a set),\\" not literally the first whistle of only four.  \r\n\r\nThe question isn\\\'t technically wrong,but could be written more clearly.', 3),
(194, '12.13.14.15', 1339461781, 905, 0, 'Question #905: I\\\'m reporting question #905 because ... \r\n\r\nCorrect answer (B): A number, which must be between 1 and 4 numerical digits (no letters)\r\n\r\nSpecifically states \\"no letters\\"\r\n\r\nWFTDA rule 9.4.3.2.1 - If a referee chooses to wear both a name and a number, there are not any restrictions on the number (i.e., it may contain letters and symbols). \r\n\r\nstates \\"it may contain letters\\"\r\n\r\nThis appears contradictory to me. I apologise if I have misinterpreted the rule but the two highlighted sections seem to be in direct contradiction.\r\n\r\nThanks.\r\n\r\n', 1),
(195, '24.245.98.193', 1339489567, 694, 0, 'Question #694: I\\\'m reporting question #694 because ... \r\n\r\nYour use of the indefinite article \\"a\\" at the end of the question rules out the correct answer for grammatical reasons.\r\n\r\nSuggest \\"This is a/an:\\"\r\n\r\nhttp://owl.english.purdue.edu/owl/resource/540/01/', 3),
(196, '174.28.200.125', 1339505648, 833, 0, 'Question #833: I\\\'m reporting question #833 because ... the answer clearly contradicts 8.6.5', 1),
(197, '70.173.61.248', 1339549504, 820, 0, 'Question #820: I\\\'m reporting question #820 because ... \r\n\r\nI\\\'m fresh meat, so I may be reading this incorrectly but, according to the rule (posted below) the points will be awarded when the penalized jammer legally returns to in bounds, so the answer would be B.\r\n\r\nThanks and this is really a great site!\r\n\r\nSam\r\n\r\n8.5.6 - Points for opponents who have not yet been scored upon in an incomplete scoring pass by a penalized Jammer, who themselves are penalized while the Jammer is serving penalty time, will be awarded to the penalized Jammer upon her legal in bounds re-entry onto the track in the same jam. If the jam ends before the Jammer legally re-enters the track in bounds, or if the Jammer illegally re-enters play (e.g. leaves the box early, enters in front of pack skaters, etc.), points for those opponents will not be awarded. She may still earn those points by legally passing those opponents in the same jam.', 4),
(198, '207.177.17.31', 1339556327, 101, 0, 'Question #101: I\\\'m reporting question #101 because ... As the question is stated, a penalty box (not \\"the benches or seats\\") must be able to accommodate a jammer, two sitting blockers, and one standing blocker, from each team, per rule 7.3.2.3. \r\n\r\n\r\n7.3.2.3 If there are already two Blockers in the box from the penalized Blocker\\\'s team, the third Blocker will be waved off by the penalty timer. If there are less than ten (10) seconds left on penalties currently being served, the Penalty Timer will hold the third Blocker in the box and start timing the penalty. If the skater is waved off she must return to the track as described in Section 7.3.7. A Jammer can never be waved off from the penalty box.', 3),
(199, '67.128.73.34', 1339618185, 518, 0, 'Question #518: I\\\'m reporting question #518 because ... of rule 6.9.3. Wouldn\\\'t that be a major?', 3),
