(208, '221.134.76.25', 1340289452, 155, 0, 'Question #155: Sorry, I meant to address the other qutosien too: mixed gender roller derby leagues aren\\\'t recognized or insurable by the Flat Track Derby Association or Roller Sports Canada . so men and woman have to play on separate teams, not unlike most professional sports. I think having other leagues in the city would be awesome, and that working with a men\\\'s derby team (if someone wanted to start one) would be rad!', 4),
