(238, '72.214.121.164', 1340826642, 776, 0, 'Question #776: I\\\'m reporting question #776 because ... \r\n\r\nIt\\\'s a little unclear... according to 7.5.5.1, the penalty time begins when the skater is off the track and the Official advises the penalty box to start the time (technically she is serving it from off the track); once the jam is over, another skater would serve the _remainder_ of her time.\r\n\r\nAnswer C (time is being served, and the penalty box is available for 3 other skaters during the jam) or possibly a fourth answer would actually be more correct, or a rewording of the question might be best.\r\n\r\nps. Great work on the Test O\\\'Matic - is the comment in the html implying this site is completely javascript driven, or do you have a repo somewhere? Drop me a note.. RefShortFuse@gmail.com\r\n', 3),
(239, '72.214.121.164', 1340827387, 290, 0, 'Question #290: I\\\'m reporting question #290 because ... \r\n\r\nThe correct answer is not listed. 4.2.4 is Pre-Jam Positioning definitions, not a mandate that \\"must\\" be followed.\r\n\r\nAccording to 6.13.5.1, a Jammer must be in a position on or behind the Jammer starting line at the \\"Jammer starting whistle\\" (this is generally accepted to be in bounds but not between the pivot and jammer lines).\r\n\r\nAccording to 2.4.4.1, \\"Jammers are considered in position and ready if they are in bounds when the first whistle of the jam [. . .] is blown.\\"\r\n', 3),
(240, '72.214.121.164', 1340831023, 152, 0, 'Question #152: I\\\'m reporting question #152 because ... \r\n\r\nAccording 2.5.1, additional overtime jams will be played until the tie is broken.\r\n\r\nOf course, it also calls the first overtime jam a \\"final overtime jam\\", so it\\\'s not the question\\\'s fault....', 3),
