(242, '99.59.177.35', 1340848376, 960, 0, 'Question #960: I\\\'m reporting question #960 because ...4.2.3 is about pre-jam positioning not scoring. Maybe you meant 8.3.1.\r\n\r\n4.2.3 - Non-Pivot Blocker Starting Positions: Blockers line up behind the Pivots as demarked by the hips. If a Pivot is not on the Pivot line, Non-Pivot Blockers are not required to line up behind her.', 2),
