(245, '70.95.144.207', 1341304876, 461, 0, 'Question #461: I\\\'m reporting question #461 because ... The question is asked from the perspective of the skater receiving the block and being driven out of bounds.   She is thus counter blocking the initiating skaters block.  6.8.15 states that the minor penalty is drawn when any part of the initiating skater\\\'s skate touches out of bounds.    Since the initiating skater owns the block \r\n\r\n6.8.3 If a skater forces an opponent out of bounds while blocking, the initiating Blocker must cease blocking before her own skates touch outside the track boundary. No part of the initiating Blocker’s skate may touch the ground outside the track boundary.\r\n\r\nI selected \\\'No Impact/No Penalty\\\'', 3),
