(280, '192.94.31.2', 1343133032, 226, 0, 'Question #226: I\\\'m reporting question #226 because ... It\\\'s a bit vague. I answered D, as the question doesn\\\'t state whether the skater is on the track or not. If they\\\'re not on the track (as is possible within the scope of the question) then D is technically correct. It might be better to word it \\"If Jammers are in bounds, but are no on or...\\" or something similar.', 3),
