(282, '90.204.110.172', 1343394999, 438, 0, 'Question #438: I\\\'m reporting question #438 because ... it\\\'s a bit oddly phrased. \r\n\r\n\\"To remain in the pack skaters may change location and skate ... \\" \\"...within \\\'the pack\\\'\\" - a bit weird? It just answers itself with itself', 4),
(283, '91.179.103.188', 1343478049, 683, 0, 'Question #683: I\\\'m reporting question #683 because ...\r\n\r\nThis is a wrong answer. The right answer is : Majour Penalty', 1),
(284, '82.41.167.161', 1343671019, 592, 0, 'Question #592: I\\\'m reporting question #592 because ... it is a major penalty not a minor, even the part in the WFTDA rules that you send us to says its amajor', 1),
(285, '192.94.31.2', 1343725178, 418, 0, 'Question #418: I\\\'m reporting question #418 because ... Typo on an/ann', 3),
(286, '86.160.108.84', 1343815953, 947, 0, 'Question #947: I\\\'m reporting question #947 because ... it needs a question mark at the end :)', 3),
(287, '86.160.108.84', 1343816104, 135, 0, 'Question #135: I\\\'m reporting question #135 because ... \\"A. Skaters are not limited in the number of positions they can play during a bout, and can play many position at a time\\" should say \\"many positions\\" not \\"many position\\"', 3),
(288, '86.160.108.84', 1343817164, 632, 0, 'Question #632: I\\\'m reporting question #632 because ... it\\\'s not clear whether the skaters are on track before the jam starts, or after the starting whistle :)', 3),
(289, '86.160.108.84', 1343817895, 478, 0, 'Question #478: I\\\'m reporting question #478 because ...  it doesn\\\'t say whether the skater being counter-blocked has fallen/lost relative position', 3),
(290, '50.43.31.230', 1343833995, 600, 0, 'Question #600: I\\\'m reporting question #600 because ... it says whilst passing the foremost opposing blocker (who is not the foremost blocker). It\\\'s confusingly written.', 3),
(291, '50.43.31.230', 1343834531, 796, 0, 'Question #796: I\\\'m reporting question #796 because ... it\\\'s confusing about whether or not it refers to ghost points.', 3),
(292, '85.27.110.141', 1343842283, 441, 0, 'Question #441: I\\\'m reporting question #441 because ... \\"forcefull\\" is not clear!', 1),
(293, '122.57.163.164', 1343987159, 464, 0, 'Question #464: I\\\'m reporting question #464 because ... should this say out-of-bounds not out-of-play? Thanks heaps, this site is awesome!!!!', 2),
(294, '12.54.94.23', 1344279397, 378, 0, 'Question #378: I\\\'m reporting question #378 because ... \r\n\r\nThere\\\'s no indication that there was contact below the legal blocking zone:\r\n\r\n6.3.6 - Any contact outside of the normal skating motion which lands below the legal target zone that causes an opposing skater to fall or lose her relative position.\r\n\r\n\\"Outside of normal skating motion\\" includes legal blocking, which can cause an opposing skater to fall or lose relative position, legally.  The question should state:\r\n\r\nIf, outside of normal skating motion, Skater A contacts Skater B below the legal target zone and causes her to fall or lose relative position, Skater A is subject to...\r\n\r\nKeep up the great work!  Thanks!', 3),
(295, '184.100.39.9', 1344470222, 842, 0, 'Question #842: I\\\'m reporting question #842 because ... \r\n\r\nWhen I read WFTDA rules 9.1.1 it states \\"It is strongly encouraged that at least one referee be WFTDA Certified.\\"   \r\n\r\n\\"strongly encouraged\\" doesn\\\'t read like \\"must be\\".  The question is how many refs \\"must be\\" WFTDA certified.  I think the correct answer according to 9.1.1 is \\"none\\".  However, that is not an option.  The options I see are a) 1; b) 2; c) 7; d) 4.', 1),
(296, '90.204.110.172', 1344613739, 596, 0, 'Question #596: I\\\'m reporting question #596 because ... I think the rule reference is wrong? Maybe 6.11.16?', 3),
(297, '86.129.65.0', 1344938785, 785, 0, 'Question #785: I\\\'m reporting question #785 because ... testing', 4),
(298, '86.129.65.0', 1345117947, 385, 0, 'Question #385: I\\\'m reporting question #385 because ... testing the report function', 4),
(299, '80.221.103.79', 1345426611, 551, 0, 'Question #551: I\\\'m reporting question #551 because of it is Not related to rules.', 4),
(300, '90.204.110.146', 1346102068, 817, 0, 'Question #817: I\\\'m reporting question #817 because ... I think the term \\\'extra point\\\' is misleading :) \r\n\r\nI know the jammer gets a point for opposing skaters returning from the penalty point behind them, but \\\'extra point\\\' kinda sounds like they\\\'re getting two points for those skaters.', 3),
(301, '12.54.94.21', 1346271609, 543, 0, 'Question #543: I\\\'m reporting question #543 because ... \r\n\r\nThe word \\"optional\\" has connotation in this question.  Standard Practices dictate that the referee *should* give the warning when capable.  The rules simply say that it doesn\\\'t take priority over penalties, and doesn\\\'t *have* to be given prior to giving penalties.  That doesn\\\'t mean the referee can decide to *never* give the warning, because it\\\'s their option.\r\n\r\nI think a better way of wording this question might be:\r\n\\"Out of play skaters may be warned that they are out of play, however, the referee doesn\\\'t need to warn the skaters prior to issuing Out Of Play penalties.\\"\r\n\r\nKeep up the good work!\r\n-Bob', 3),
(302, '124.169.222.16', 1346895108, 84, 0, 'Question #84: I\\\'m reporting question #84 because ... the correct answer is wrong, there are 30seconds between jams not 1 minute.', 1),
(303, '90.204.110.146', 1347010558, 393, 0, 'Question #393: I\\\'m reporting question #393 because ... Shoulsnt this be an expulsion if it was intentional?', 3),
(304, '24.97.125.18', 1347294917, 510, 0, 'Question #510: I\\\'m reporting question #510 because ... Both B and C mean the same, correct? If skater B receives an assist, then skater A is the initiator.', 2),
(305, '99.88.132.198', 1347372325, 201, 0, 'Question #201: I\\\'m reporting question #201 because ... States \\"True or False:\\" but is not a true or false question.', 3),
(306, '27.33.159.87', 1347764816, 480, 0, 'Question #480: I\\\'m reporting question #480 because ... I understand the rule behind this question is talking about contact made as the skater is re-entering. The wording of the question makes it unclear whether the re-entering of the track and the contact are sequential or simultaneous.', 3),
(307, '90.204.110.146', 1347875771, 634, 0, 'Question #634: I\\\'m reporting question #634 because ... The question is fine, but could you please add the link to the clarification for this one? It\\\'d be an awesome help :) Thank you! :D', 3),
(308, '81.136.225.110', 1347978680, 68, 0, 'Question #68: I\\\'m reporting question #68 because ... \r\nI think there is a typo in answer D.  It reads \\"If there is no jam cover currently in the jam\\"  Shouldn\\\'t it say helmet cover?', 3),
(309, '149.135.145.22', 1348207736, 85, 0, 'Question #85: I\\\'m reporting question #85 because ... \r\nRule 2.3.4 stipulates that if there is 30sec or less on the period clock then there will not be an overtime jam. It does not say if there is less than 30 sec. Therefore the best answers in this case would be any amount of seconds over 30sec, in this multi choice 50sec was the closest and it comes up as incorrect. I had the same question twice once with 49sec as an option and this too was states to be incorrect with 30sec being the said correct answer.\r\n\r\n\r\nThank you SOOO much for this quite. It has been very very useful as a learning tool! :)', 2),
(310, '91.176.126.93', 1348425071, 95, 0, 'Question #95: I\\\'m reporting question #95 because ... \r\n\r\nWhat about overtime jams?', 3),
(311, '109.145.172.196', 1348660813, 568, 0, 'Question #568: I\\\'m reporting question #568 because its true when the iniating when the initiating skater downs herself or falls at any time after the initiating block a skater may  return in bounds in front of the skater who blocked her out of bounds, and no penalty is to be issued.', 3),
(312, '58.168.94.112', 1348757765, 670, 0, 'Question #670: I\\\'m reporting question #670 because ... The wording is confusing. It implies the real question is \\"what is the penalty for intentionally committing an illegal procedure.\\"\r\n\r\nIt should read something like \\"in relation to calling insubordination, what should be given to a player who intentionally commits an illegal procedure?\\"', 3),
(313, '86.129.65.0', 1349174273, 250, 0, 'Question #250: I\\\'m reporting question #250 because ... testing again', 4),
(314, '86.129.65.0', 1349273483, 668, 0, 'Question #668: I\\\'m reporting question #668 because ... testing', 4),
(315, '130.88.99.231', 1349444196, 467, 0, 'Question #467: I\\\'m reporting question #467 because ... \r\n\r\nHi sausage it\\\'s Don G.\r\n\r\nI think the question needs to be changed to Downed skater who is out of bounds as that is what the rules say. \r\n\r\n\\"6.8.20 - A downed skater re-entering the track from out of bounds who forces any opposing in-play skaters to fall or lose relative position.\\"\r\n\r\nWhile a downed skater could be one that just fell over, and when they get up everyone loses position as they have re-entered. \r\n\r\nHowever, if this is wrong just ignore me.\r\n\r\n\r\n\r\nGunna go all youtube feedback now!\r\n\r\nThis is bullshit you ruined my streak!!! \r\n\r\n\r\nDon G\r\n\r\n', 2),
(316, '101.170.127.251', 1349530217, 378, 0, 'Question #378: I\\\'m reporting question #378 because ... The word them is spelt athem.', 2),
(317, '99.249.69.135', 1349751483, 833, 0, 'Question #833: I\\\'m reporting question #833 because it seems poorly written. There are 2 answers that have initial pass on them but the one says can score points and cannot score points. During a initial pass you can never score points so reading this question I read it assuming this was already known and thought about the next lap around as for scoring points... Donno if its just me but the wording threw me off on this one. ', 3),
(318, '88.182.102.22', 1349955136, 500, 0, 'Question #500: You never told of the impact. it\\\'s impossible to know\r\nBy the way, awesome job!', 3),
(319, '75.159.165.25', 1350145300, 885, 0, 'Question #885: I\\\'m reporting question #885 because ... \r\nThe wording is wrong. \r\nAll refferees will conference with both team captains.\r\nIn a bout only the head ref will \\"talk\\" to the captains.', 2),
(320, '81.106.158.227', 1350239518, 67, 0, 'Question #67: I\\\'m reporting question #67 because ... Answers 1 and 3 are the same.. difference is start and starting.', 1),
(321, '208.54.32.249', 1350591829, 676, 0, 'Question #676: I\\\'m reporting question #676 because ... due to a rule clarification on Sept 9th, 2012, initiating contact with a teammate while in the air is not a major (despite how many of us refs feel about that). ', 2),
(322, '83.70.216.122', 1350676879, 67, 0, 'Question #67: I\\\'m reporting question #67 because ... C and D are the same answer. Whats the difference between Jammer start whistle and jam starting whistle?', 1),
(323, '24.21.212.159', 1351192196, 704, 0, 'Question #704: I\\\'m reporting question #704 because it doesn\\\'t reference an actual gameplay rule. Slang isn\\\'t relevant to the WFTDA ruleset.', 4),
(324, '213.42.182.194', 1351728842, 930, 0, 'Question #930: I\\\'m reporting question #930 because ... The question is worded such that it implies that Jammer B has not yet legitimately passed an in bounds blocker when they lap Jammer A who is in the box. Would the Jammer Lap Point not be applied until Jammer B scores on the first blocker?\r\n\\"8.5 - The Jammer earns a point for each opposing skater who is not on the track immediately upon scoring her first point on an opposing blocker in each scoring pass\\"\r\n', 3),
(325, '67.193.181.146', 1352243177, 568, 0, 'Question #568: I\\\'m reporting question #568 because \r\n\r\nThis is a bit of a trick question. If you remove the word only (which I would do), then the correct answer is B.  Otherwise, the question is ambiguous.', 3),
(326, '46.7.230.171', 1353022487, 39, 0, 'Question #39: I\\\'m reporting question #39 because ... \r\n\r\nIt makes no sense.', 4),
(327, '46.7.230.171', 1353022659, 143, 0, 'Question #143: I\\\'m reporting question #143 because ... \r\n\r\nA and C are both valid in terms of rules. I haven\\\'t seen a pivot line start in weeks.', 4),
(328, '46.7.230.171', 1353022896, 147, 0, 'Question #147: I\\\'m reporting question #147 because ... Both B and D are valid answers. It is very rare these days to see a \\"normal\\" pivot line start, or even a start where the pivot\\\'s position makes a difference.', 4),
(329, '86.178.1.32', 1356779820, 1099, 0, 'Question #1099: I\\\'m reporting question #1099 because ... it should say \\"post scores\\" not \\"post score\\". :)', 3),
(330, '86.178.1.32', 1356780057, 438, 0, 'Question #438: I\\\'m reporting question #438 because ... it is worded to make it far too easy (to remain in the pack you must skate within the pack...)', 4),
(331, '213.120.90.59', 1356785205, 28, 0, 'Question #28: I\\\'m reporting question #28 because ... \r\n\r\nIt should state \\"Wide/Tall\\".', 2),
(332, '86.178.1.32', 1356797724, 1468, 0, 'Question #1468: I\\\'m reporting question #1468 because ... Testing', 4),
(333, '78.149.1.128', 1356806382, 39, 0, 'Question #39: I\\\'m reporting question #39 because ... It seems incomplete', 4),
(334, '50.43.31.230', 1356811499, 1308, 0, 'Question #1308: I\\\'m reporting question #1308 because ... it says angagement instead of engagement.', 3),
(335, '81.156.246.42', 1356823536, 1493, 0, 'Question #1493: I\\\'m reporting question #1493 because I think some words are missing? True or False: A Fouled Out skater can be substituted in the jam <if> they Foul Out in <order> to prevent their team skating short. P.S. I love Roller Derby Test O\\\'Matic! x\r\n\r\n\r\n', 3),
(336, '222.155.83.163', 1356830110, 1077, 0, 'Question #1077: I\\\'m reporting question #1077 because ... 3.3.3 - An inactive Jammer has the advantage of all Jammer abilities except scoring points (Section 8 - Scoring) and earning Lead Jammer status (Section 3.4 - Lead Jammer).', 3),
(337, '99.37.64.202', 1356847619, 533, 0, 'Question #533: If a skater\\\'s or group of skaters\\\' actions create a no-pack situation via \\"gradually deviating from the speed of the pack as established through game play,\\" \\"illegally destroying the pack penalties shall not be given.\\"\r\n\r\nSo the answer to this question should be false. Because they aren\\\'t always penalized for their actions. (See: Power jam \\"passive offense\\")\r\n\r\n6.10.2.1.1 - The rules do not define pack speed. Illegally destroying the pack penalties shall not be given for gradually deviating from the speed of the pack as established through game play, unless said deviation is sudden, rapid, and marked, leaving the opposing team no opportunity to adjust and maintain a pack.', 3),
(338, '80.229.2.190', 1356859529, 1130, 0, 'Question #1130: I\\\'m reporting question #1130 because ... \r\n\r\nGrammar rather than incorrect. The pack \\\'may\\\' start rolling, the question states \\\'does\\\'.\r\nThey don\\\'t have to. They can remain stopped after the whistle, or they can be moving before it.', 3),
(339, '87.194.199.126', 1356877264, 1221, 0, 'Question #1221: I\\\'m reporting question #1221 because ... the listed answer is Delay of Game cannot be No Impact/No Penalty as per 6.15.1 while Expulsion is listed as an incorrect answer, but according to 6.15.5 Delay of Game is also not expulsion worthy. So both are correct answers.', 2),
(340, '87.194.199.126', 1356878541, 1111, 0, 'Question #1111: I\\\'m reporting question #1111 because ... the correct answer listed is \\\'Expulsion or Suspension\\\', while \\\'Gross Misconduct penalty\\\' is listed as incorrect. But the expulsion or suspension falls under the category of Gross Misconduct penalties so both answers are valid.', 2),
(341, '87.194.199.126', 1356879951, 1495, 0, 'Question #1495: I\\\'m reporting question #1495 because ... there won\\\'t be another Pivot available during that Jam because there is only one per Jam per team, so the answer has to be \\\'any other skater from her team who will then serve as the Pivot\\\'', 3),
(342, '87.194.199.126', 1356880650, 1366, 0, 'Question #1366: I\\\'m reporting question #1366 because ... Major Cutting, yes, unless it\\\'s a team mate in which case NI/NP. :-)', 2),
(343, '90.38.118.163', 1356886298, 35, 0, 'Question #35: I\\\'m reporting question #35 because ... \\"2.1.5 - There will be a 10-foot (3 meter) clearance around the outside of the track for safety. If there is a rail, wall, or barrier between the track and the crowd that completely prevents contact between spectators and contestants, a 5-foot (1.5 meter) clearance is permissible. Referees may skate in this area, and/or the infield of the track. The clearance cannot be less than 5 feet (1.5 meters).\\"\r\n\r\nAnd especially this : \\"The clearance cannot be less than 5 feet (1.5 meters).\\"', 1),
(344, '82.38.253.42', 1356888662, 1083, 0, 'Question #1083: I\\\'m reporting question #1083 because ... it provides an incorrect answer. You\\\'ve quoted 3.5.5 which states \\"Jammer status is transferred when the Pivot is wearing the Jammer helmet cover on their helmet with the stars visible.\\" This would make the correct answer selection A.', 2),
(345, '86.81.234.202', 1356893709, 872, 0, 'Question #872: I\\\'m reporting question #872 because ... There are no longer any minors therefore the selection \\"vocally call out munors\\" could also be deemed correct.', 2),
(346, '74.84.93.228', 1356899426, 291, 0, 'Question #291: I\\\'m reporting question #291 because ... I think this needs to be re worded a little bit.  By what you say in the question alone, it implies blockers can line up anywhere on the track and in front of the pivot if they are on the line.  Also the rule you site does mention lining up behind a pivot.  Perhaps ad the phrase \\"between the pivot and jammer line and behind the pivot if they are on the line.\\" ', 3);
INSERT INTO `rdtom_reports` (`ID`, `IP`, `Timestamp`, `Question_ID`, `User_ID`, `Text`, `Status`) VALUES
(347, '2.25.121.220', 1356900061, 1367, 0, 'Question #1367: I think 6.11.3.2 gives this scenario as an explicit example of cutting - you can still cut track in a no pack situation. I think this is a problem in the wording of rule 6.11.10/11. In fact the opening paragraph of section 6.11 makes reference only to \\\'in bounds\\\' skaters, not \\\'in play\\\'. \r\n\r\n', 3),
(348, '74.198.150.145', 1356904666, 871, 0, 'Question #871: I\\\'m reporting question #871 because ... It refers to calling out minor penalties when the rule noted refers to major penalties ', 2),
(349, '74.84.93.228', 1356908366, 1474, 0, 'Question #1474: I\\\'m reporting question #1474 because ... I believe the rule is 7.3.3, not 7.2.3.', 3),
(350, '118.209.142.242', 1356914466, 871, 0, 'Question #871: I\\\'m reporting question #871 because ... there are no longer any minor penalties which makes D more correct than C.', 2),
(351, '50.43.31.230', 1356916760, 795, 0, 'Question #795: I\\\'m reporting question #795 because ... it should specify in a non overtime jam.', 3),
(352, '66.140.33.57', 1356922680, 1413, 0, 'Question #1413: I\\\'m reporting question #1413 because ... The rule says to penalize the skater who is most responsible or the pivot, not all skaters.  The part about the further penalties using 6.10.12 and 6.10.16 does not necessarily apply based on the limited information of the question.  Maybe add a D answer saying, \\"The skater most responsible or the pivot.\\"\r\n\r\nThanks!  Awesome test questions otherwise!', 2),
(353, '50.43.31.230', 1356924588, 86, 0, 'Question #86: I\\\'m reporting question #86 because ... a new jam could also be declared at the head referees discretion in the case of an injury.', 3),
(354, '120.151.24.33', 1356933143, 1093, 0, 'Question #1093: I\\\'m reporting question #1093 because ... It doesn\\\'t mention centimeters, only inches. One of the major changes was to metric-ize everything, and everywhere EXCEPT for the US is now treating the metric measurements as gospel.  I got that one wrong because I was thinking \\\'shit, how big is 5cm in inches?\\\'', 3),
(355, '120.151.24.33', 1356935389, 258, 0, 'Question #258: I\\\'m reporting question #258 because ... This one also doesn\\\'t have the metric numbers, it\\\'s only in inches. ', 3),
(356, '120.151.24.33', 1356936574, 1072, 0, 'Question #1072: I\\\'m reporting question #1072 because ... another one without metric values in it.', 3),
(357, '120.151.24.33', 1356936737, 276, 0, 'Question #276: I\\\'m reporting question #276 because ... another one with no metric entries. Sorry for all of these, but it\\\'s better to tell you about them..', 3),
(358, '120.151.24.33', 1356937179, 1085, 0, 'Question #1085: I\\\'m reporting question #1085 because ... \r\n\r\nI think the wording is poor of this one. It\\\'s just saying that the jammer is NOT being sent to the penalty box. Not saying that she is.\r\n\r\nSuggested alternate wording: (And yeah. This is hard)\r\n\r\nDuring a star pass, if a helmet cover is dropped or falls to the floor, and the jammer is sent to the bin, when does the Pivot get Lead Jammer status\r\n\r\n[maybe?]', 3),
(359, '120.151.24.33', 1356943860, 23, 0, 'Question #23: I\\\'m reporting question #23 because ... another one with no metric distances in it.', 3),
(360, '193.67.231.30', 1356963723, 1530, 0, 'Question #1530: I\\\'m reporting question #1530 because ... \r\n\r\nA team forgets (not forget), typo\r\n\r\nLove this test BTW, derby love from Amsterdam!', 3),
(361, '193.67.231.30', 1356964091, 1441, 0, 'Question #1441: I\\\'m reporting question #1441 because ... \r\n\r\nCommonly confused verbs: it should be waived off (not wave off, as in hand gesture).\r\n\r\n6.13.11 - A skater, after being waived off of a full penalty box, re-entering the track in front of one pack skater of the same team.\r\n\r\nOddly, 7.2.2.3 reads - If there are already two Blockers in the box from the penalized Blocker’s team, the third Blocker will be waved off by the penalty timer.\r\n\r\nI think I just found a mistake in the official rules :)\r\n\r\n\r\n\r\n', 3),
(362, '193.67.231.30', 1356966825, 1085, 0, 'Question #1085: I\\\'m reporting question #1085 because ... \r\n\r\nMe again :)\r\n\r\nfor an an unrelated. One too many \\\'an\\\'', 3),
(363, '90.38.118.163', 1356971035, 1351, 0, 'Question #1351: I\\\'m reporting question #1351 because ... \\"BUT\\" does not cause the opposing skater to lose relative position.', 3),
(364, '212.68.222.236', 1356971875, 1476, 0, 'Question #1476: I\\\'m reporting question #1476 because ... MINOR PENALTY !', 2),
(365, '66.172.96.138', 1356975606, 1216, 0, 'Question #1216: I\\\'m reporting question #1216 because ... doesn\\\'t make sense. seats? wtf? needs to include the reference to to penalty box.', 3),
(366, '24.72.91.74', 1356990611, 1110, 0, 'Question #1110: I\\\'m reporting question #1110 because ... the 3rd and 4th answers are BOTH 100% correct!', 2),
(367, '120.151.24.33', 1357016822, 544, 0, 'Question #544: I\\\'m reporting question #544 because ... \r\n\r\nThat should be true. On a No Pack call, if they immediately attempt to reform the pack, they will not get a penalty. 6.10.7 says that. \r\n\r\nUnless there\\\'s a double negative in there that I\\\'m not seeing?  [Changing \\\'but\\\' to \\\'And\\\'?]\r\n\r\n(Also messaged wardrox on reddit)', 3),
(368, '62.16.170.100', 1357065927, 1452, 0, 'Question #1452: I\\\'m reporting question #1452 because 7.2.6 says you says can remove your mouth guard', 1),
(369, '120.151.24.33', 1357077409, 798, 0, 'Question #798: I\\\'m reporting question #798 because ... you might want to clarify that the jammer has not left the engagement zone in this one. ', 3),
(370, '203.134.157.153', 1357080470, 496, 0, 'Question #496: I\\\'m reporting question #496 because ... Rule 6.9.2.1 \\\' A stopped or counter clockwise stepping/skating skater may legally assist a stopped or downed teammate.\\\' So it\\\'s okay to stop to assist a downed team mate.', 3),
(371, '90.15.211.201', 1357086994, 1070, 0, 'Question #1070: I\\\'m reporting question #1070 because it\\\'s not really clear. the jam timer can call off the jam after 2min.\r\nAnd the referee too for a official time out.', 3),
(372, '203.184.29.82', 1357116308, 1012, 0, 'Question #1012: I\\\'m reporting question #1012 because ... \r\nThe whistle signal for Jam Start is one short blast, one long blast is for a major penalty.', 2),
(373, '87.194.199.126', 1357124719, 1378, 0, 'Question #1378: I\\\'m reporting question #1378 because ... being a little petty here but \\\'the\\\' pivot gets to keep their helmet cover on because they are the pivot. The wording is slightly misleading. Perhaps it could say \\\' all four skaters will be allowed to remain on track if the last Pivot to enter the track removes their helmet cover.\\\' or  \\\'all four skaters will be allowed to remain on track if the last Blocker to enter the track wearing the Pivot helmet cover removes their helmet cover.\\\'\r\n\r\nLoving the site, by the way. Thank you.', 3),
