(387, '92.17.253.68', 1357220223, 1346, 0, 'Question #1346: I\\\'m reporting question #1346 because ... \r\n\r\nHi, I didn\\\'t think we has refs had to issue a warning, although it is preferable to do so.  That was because of the following section of the rules :\r\n\r\n6.10.1 - A skater who is more than 20 feet (6 m) in front of or behind the pack may receive an out of play warning by a referee. A referee is not required to issue a warning prior to giving a penalty. Issuing penalties takes priority over issuing warnings. A warning does not have to be issued in order for a penalty to be given (see Section 9.3.1.1).\r\n\r\nI\\\'m happy to be proven wrong though.  \r\nThanks for making this resource available to the community though, it really is invaluable!\r\nCheers,\r\nAdrian \\"Screeching Whistle\\" Frisby - Brighton Rockers', 3),
