(437, '68.52.44.120', 1357593872, 1367, 0, 'Question #1367: I\\\'m reporting question #1367 because ... \r\n\r\nThe answer is wrong. I see why you came to that conclusion. What is really important is this line in the beginning of section 6:\r\n\r\n\\"The following penalties are addressed in detail in the sections listed below. These sections hold specific examples that are to be followed explicitly. Illegal actions not specified below must be penalized using these specifics as guiding examples.\\"\r\n\r\nWhat you have pointed out is 6.11.3.2. This states that it is illegal. There is no specific example for a cut during a no pack situation, but we know that it is illegal. That means that we must use 6.11.10 and 6.11.11 to guide us.\r\n\r\nDuring a no pack situation, cutting a single opponent, or multiple teammates is a major penalty.\r\n\r\nIf you have further questions, you can contact me at wood@zebrahuddle.com', 2),
