(448, '131.130.15.0', 1357818528, 191, 0, 'Question #191: I\\\'m reporting question #191 because ... \r\n\r\nFirst of all, thanks for this amazing tool! I\\\'m training to become a ref and use it a lot. Now about this question:\r\n\r\nIn the new rule set, there\\\'s nothing against a pivot becoming jammer then earning lead. Transferring lead jammer status is not the same as transferring eligibility to become lead jammer. See discussion here: http://www.zebrahuddle.com/index.php?topic=3136.0\r\nApparently the wftda intention is still to forbid that pivots can become lead jammer, but as the rules are formulated now it\\\'s easier to argue that they can.\r\n', 3),
