(460, '216.187.168.68', 1358205095, 1171, 0, 'Question #1171: I\\\'m reporting question #1171 because ... \r\n rule 6.3.10 states:  A skater who habitually falls in front of opposing skaters, causing them to stumble or fall or lose relative position, even if the skater “falls small.” The intent is to penalize a skater who repeatedly falls as the skater is a danger to opponents. A single skater who repeatedly low blocks other skaters, even when “falling small” is adversely affecting game play and safety.\r\n\r\nI believe this needs to be reworded because no where does it say \\"after falling in this unsafe way three times or more\\".  It states repeatedly falls which an be two - twenty times...  unless you can tell me where the magical number of three comes from I would say this question needs to corrected.', 1),
(461, '64.134.222.2', 1358229962, 471, 0, 'Question #471: I\\\'m reporting question #471 because ... isn\\\'t in play out of play status in limbo until they land?', 3),
(462, '131.130.15.0', 1358349098, 1114, 0, 'Question #1114: I\\\'m reporting question #1114 because ... \r\n\r\nThere\\\'s a typo on choice D, \\"Explusion\\"', 3),
(463, '142.196.22.188', 1358381458, 1374, 0, 'Question #1374: I\\\'m reporting question #1374 because ... \r\n\r\n6.11.9 states that the infraction is No PASS/No Penalty, not No IMPACT/No Penalty. This is a small yet important distinction. There is still no penalty called, but neither does the skater get credit for passing that player (which may mean she does not get lead jammer).\r\n\r\nThis quiz is awesome, by the way :)', 3),
(464, '141.14.139.44', 1358421482, 1266, 0, 'Question #1266: I\\\'m reporting question #1266 because ... \r\n\r\nof a grammar mistake:\r\n\r\n\\"Skater C then proceed to re-enter the Jam\\"\r\n\r\nshould read:\r\n\r\n\\"Skater C then proceeds to re-enter the Jam\\"', 3),
(465, '24.68.213.94', 1358496208, 164, 0, 'Question #164: I\\\'m reporting question #164 because ... It\\\'s difficult to understand. Seems like a word or two might have been missed.', 3),
(466, '174.47.194.11', 1358532112, 1469, 0, 'Question #1469: I\\\'m reporting question #1469 because ... according to the cited rule, the Blue jammer still only has to serve out the time that the red jammer sat initially. I would view this as \\"required\\" but not necessarily \\"full\\" penalty time. ', 3),
(467, '68.43.117.40', 1358561890, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... there was a clarification released yesterday or today which says that a skater must land in bounds, but whether or not they then fall is irrelevant -- so as long as they land in bounds they earn the points, regardless of whether they REMAIN upright and skating.\r\n\r\nPS: also, as long as I\\\'m here, anywhere there\\\'s the phrase \\"Expulsion and ______\\" or maybe it\\\'s \\"Expulsion or _____\\" (can\\\'t remember what the second thing is) Expulsion is spelled \\"Explusion\\".', 2),
(468, '101.175.165.177', 1358584820, 925, 0, 'Question #925: I\\\'m reporting question #925 because ... YOU NEED TO REVIEW THIS QUESTION AS THE ANSWER TO IT SHOULD BE FALSE, IF YOU REFER TO 10.3.4.1 - A skater may not wear an appliance, cast, or brace that causes a danger to other skaters (as determined by the Head Referee). ALTHOUGH OPEN TO FURTHER DISCUSSION COMMON SENSE WOULD PREVAIL THESE CASTS ETC WOULD NEVER BE  TAKEN ONTO A TRACK REGARDLESS OF THE REFS RECOMMENDATIONS DUE TO TO THE POSSIBILITY OF INJURY IT COULD CAUSE. ', 3),
(469, '173.74.31.131', 1358640734, 1490, 0, 'Question #1490: I\\\'m reporting question #1490 because ... OFFENCES is misspelled.  ', 1),
(470, '93.220.116.130', 1358786787, 1528, 0, 'Question #1528: I\\\'m reporting question #1528 because ... \r\n\r\nof a typo.\r\n\r\nI believe \\"as oppose to\\" should be changed to \\"as opposed to.\\"', 3),
(471, '93.220.116.130', 1358786930, 1268, 0, 'Question #1268: I\\\'m reporting question #1268 because ... \r\n\r\nof a typo/grammar mistake:\r\n\r\n\\"can re-entering the track\\"\r\n\r\nshould read\r\n\r\n\\"can re-enter the track \\"', 3),
(472, '65.7.4.186', 1358812052, 1492, 0, 'Question #1492: I\\\'m reporting question #1492 because ... The skater would foul out from seven consecutive TRIPS to the penalty box, not seven MINUTES', 3),
(473, '84.212.21.101', 1358820408, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \r\n\r\nThe rules states that they need to be upright. ', 1),
(474, '173.74.31.131', 1358905591, 1225, 0, 'Question #1225: I\\\'m reporting question #1225 because - it should read \\"A team has ...\\" ', 3),
(475, '70.182.246.183', 1358953027, 158, 0, 'Question #158: I\\\'m reporting question #158 because ... the word stray, to me stray means you can skate out of bounds anytime you want, thats a major. maybe change to can be hit out of bounds', 3),
(476, '70.197.194.207', 1358964697, 953, 0, 'Question #953: I\\\'m reporting question #953 because ... it states in the rules, if you are \\"stopped\\" on the track you are not \\"in play\\".  It also states \\"out of play skaters cannot assist teammates\\" if you are truly \\"stopped\\" you are out of play, and cannot  whip a teammate as it\\\'s an assist.', 4),
(477, '98.232.193.99', 1358982997, 901, 0, 'Question #901: I\\\'m reporting question #901 because ... This question is correct now but I had answered the question before and with false and it allowed it.', 4),
(478, '24.32.68.9', 1359009317, 1493, 0, 'Question #1493: I\\\'m reporting question #1493 because ... it is written in a confusing manner and can be interpreted incorrectly:\r\n\r\n True or False: A Fouled Out skater can be substituted in the jam if they Foul Out in order to prevent their team skating short.\r\n\r\nI know that another skater from the team of the fouled out skater can not be substituted during an on-going jam, but it sounds like the question is asking if a skater can foul out in order to prevent their team from skating short-which is not helping their team because now thier team is short one skater.  :)  I know that\\\'s not what the question is asking, but I had to re-read it a couple times to understand that the question was asking about substitutions during a jam for a fouled out skater.', 3),
(479, '98.232.193.99', 1359061228, 1280, 0, 'Question #1280: I\\\'m reporting question #1280 because ... I clicked next question this pooped up and it selected for me.', 4),
(480, '98.232.193.99', 1359061379, 1136, 0, 'Question #1136: I\\\'m reporting question #1136 because ... it took me a while to answer and it selected for me', 4),
(481, '124.168.37.218', 1359081499, 1119, 0, 'Question #1119: I\\\'m reporting question #1119 because ... 6.17 is gross misconduct and all GM penalties are expulsion/suspensions. There are two correct answers.', 3),
(482, '72.234.105.223', 1359089149, 1328, 0, 'Question #1328: I\\\'m reporting question #1328 because ... I think this should be a major because it doesn\\\'t include this wording. 6.9.23 - Intentional, negligent, or reckless contact with an opponent while stopped on the track in an illegal manner.', 3),
(483, '84.251.182.237', 1359148306, 295, 0, 'Question #295: I\\\'m reporting question #295 because ... It\\\'s poorly written, a word missing.', 4),
(484, '24.98.104.71', 1359186012, 1487, 0, 'Question #1487: I\\\'m reporting question #1487 because the note that appears when the question has been answered is misleading and can easily be read as contradicting 7.3.1.', 3),
(485, '68.54.59.142', 1359240488, 1221, 0, 'Question #1221: I\\\'m reporting question #1221 because ...6.15.5 says expulsion is non-applicable for Delay of Game ', 4),
(486, '62.254.19.176', 1359285864, 1203, 0, 'Question #1203: I\\\'m reporting question #1203 because ... It says \\"another skater\\", and should say \\"an opposing skater\\"', 2),
(487, '108.181.222.46', 1359348245, 1326, 0, 'Question #1326: I\\\'m reporting question #1326 because ... \r\n\r\nIt\\\'s badly written. Instead of \\"out of\\" it should say \\"to lose.\\"', 3),
(488, '124.168.37.218', 1359361753, 964, 0, 'Question #964: I\\\'m reporting question #964 because ... I\\\'d like to see evidence for this. I\\\'ve always thought of it as no impact therefor no penalty. ', 2),
(489, '173.162.134.101', 1359388018, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \r\n\r\n8.3.1.2 - In order to earn points for passing while airborne, the Jammer must continue an in bounds and upright status at the moment of landing (see Section 6.8 - Out of Bounds Blocking).', 1),
(490, '212.23.9.225', 1359395012, 1124, 0, 'Question #1124: I\\\'m reporting question #1124 because ... \r\n\r\nI would have thought starting on one knee might count as delaying the formation of a pack, if to causes a no pack at jam start. Obviously I\\\'ve read the rule now and see being 1 knee down is allowed (4.2.1.2) but I think the wording is a bit grey, perhaps using \\"delay the formation or re-formation of a pack\\" though that might be giving away the answer.\r\n\r\n-Yousiff', 4),
(491, '70.89.177.125', 1359410537, 1566, 0, 'Question #1566: I\\\'m reporting question #1566 because ... \r\n\r\nAnswers A and B are both correct. Answer B return a \\"wrong result\\" please refer to rule 3.4.7.3\r\n\r\n3.4.7 - Once a Jammer has been declared Lead Jammer, Lead Jammer status is retained for the duration of the jam unless the status is forfeited by:\r\n \r\n\r\n3.4.7.1 - Jammer removing the helmet cover for any reason.\r\n \r\n\r\n3.4.7.2 - Committing a major penalty.\r\n \r\n\r\n3.4.7.3 - Having the helmet cover removed by a teammate.\r\n', 2),
(492, '166.137.209.174', 1359417387, 165, 0, 'Question #165: I\\\'m reporting question #165 because ... Option A & C are redundant....aren\\\'t they??', 3),
(493, '124.168.37.218', 1359432281, 197, 0, 'Question #197: I\\\'m reporting question #197 because ... Should read \\\'on route to the penalty box\\\'', 3),
(494, '97.88.26.198', 1359461720, 443, 0, 'Question #443: I\\\'m reporting question #443 because ... It\\\'s confusing how a skater could be on the track, but not in bounds, unless you are referencing straddling skaters. It\\\'s just confusing wording even though the answer asked for is verbatim from the rules. The on the track answer is just misleading. ', 3),
(495, '110.32.193.201', 1359637985, 920, 0, 'Question #920: I\\\'m reporting question #920 because ... The question should be \\"When a  jam is called off by a referee due to a skater injury for the second time the skater must sit out\\" A,B,c or D.\r\n\r\nThe question itself eliminates option A, unless you want this to be a trick question.', 3),
(496, '91.231.90.90', 1359642482, 1170, 0, 'Question #1170: I\\\'m reporting question #1170 because ... 6.3.9 uses the term \\"habitual\\" and no specific numerical value is given.', 1),
(497, '24.32.68.9', 1359664559, 1188, 0, 'Question #1188: I\\\'m reporting question #1188 because ... \r\n\r\nIt would be more correct if it said A skater intentionally uses their elbow to make contact with an opposing skater in an illegal manner. This is a/an:\r\n\r\nThe original rule states:\r\n6.4.10 - Intentional, negligent, or reckless contact with an opponent by using the elbow in an illegal manner.\r\n\r\nI would like to include:\r\n6.4.6 - Any illegal contact with the elbow or swinging motion of the elbow that forces the receiving opposing skater off balance, forward, and/or sideways but does not cause the opposing skater to lose relative position.\r\n\r\n6.4.6 is a no impact/no penalty if the receiving opposing skater is forced off balance, forward, and/or sideways but does not cause the opposing skater to lose relative position. So, unless the elbow was intentional and illegal it might be a no impact/no penalty if the receiving opposing skater did not lose their relative position. Also, according to 9.3.4 - If the referee is not sure whether an action warrants a major or a no impact/no penalty, it must be called as no impact/no penalty. So It depends on whether the elbow contact was illegal to decide what penalty would be given.\r\n\r\nThanks! I\\\'m not trying to be rude, but make the question more clear and irrefutable.', 3),
(498, '24.32.68.9', 1359665104, 1237, 0, 'Question #1237: I\\\'m reporting question #1237 because ... \r\n\r\nThere\\\'s a word missing that could throw people off:\r\nOriginal question:\r\nA skater repeated use obscene, profane, or abusive language or gestures directed at an official will be subjected to a/an:\r\n\r\nFixed versions (corrected/added word(s) in capital letters):\r\n-A skater THAT repeatedLY useS obscene, profane, or abusive language or gestures directed at an official will be subjected to a/an:\r\n-A skater repeatedLY useS obscene, profane, or abusive language or gestures THAT ARE directed at an official will be subjected to a/an: \r\n\r\nHope this helps. :)', 3),
(499, '166.147.121.160', 1359666975, 1219, 0, 'Question #1219: I\\\'m reporting question #1219 because ...  It has some pretty ambiguous language. A misconduct act does not necessarily mean a Misconduct penalty. I would change \\"act\\" to \\"penalty\\". ', 2),
(500, '98.24.134.118', 1359674411, 1153, 0, 'Question #1153: I\\\'m reporting question #1153 because ... \\"Conscious effort\\" isn\\\'t a phrase used in the rules. While I understand you tend to mean \\"intentional\\", this is effectively a trick question because it uses language not related to the rules. \r\n\r\nRDRotD\r\n', 3),
(501, '142.196.22.188', 1359675348, 1279, 0, 'Question #1279: I\\\'m reporting question #1279 because ... \r\n\r\nRule 6.7.8 no longer requires loss of position, and no longer specifies a time limit. It is any impedance of an opponent \\"for any amount of time\\".', 3),
(502, '24.178.52.246', 1359758077, 1516, 0, 'Question #1516: I\\\'m reporting question #1516 because ... \r\n\r\n\\"can now not passed them\\" is not grammatically correct.', 3),
(503, '99.62.232.189', 1359823499, 1328, 0, 'Question #1328: I\\\'m reporting question #1328 because ...  the wording is very confusing.  Do you mean blocks an opponent in an ADDITIONAL illegal manner on top of the illegal stop block?  The way this is worded a player would be expelled for every stop block, which clearly isnt the case in the rules.', 3),
(504, '81.136.185.125', 1359839698, 372, 0, 'Question #372: I\\\'m reporting question #372 because ... If they\\\'re UP and then Re-entering the track, they aren\\\'t \\"Downed\\" and re-entering the track therefore will not be subject to low block penalties specifically but any penalty as a whole.\r\n\r\nIf they were down and re-entering the wording of the question makes sense. If they are up and re-entering then not.', 3),
(505, '81.136.185.125', 1359841536, 271, 0, 'Question #271: I\\\'m reporting question #271 because ... So What if they\\\'re plastic skates with hard outers?? \\"Any quads\\" seems to vague? I understand that it\\\'s how the RULES are worded, but I\\\'d struggle to find many refs that would approve hard outered skates etc', 4),
(506, '118.209.29.241', 1359964211, 272, 0, 'Question #272: I\\\'m reporting question #272 because ... \r\nThis question is irrelevant ', 4),
(507, '101.162.139.38', 1359986687, 1287, 0, 'Question #1287: I\\\'m reporting question #1287 because ... I don\\\'t believe this interpretation is correct - what about 6.8.7?', 3),
(508, '24.47.115.124', 1360164212, 1346, 0, 'Question #1346: I\\\'m reporting question #1346 because ... I believe 9.3.3 overrides this and that a warning is not always required when issuing any OOP penalty. ', 4),
(509, '24.47.115.124', 1360209791, 1420, 0, 'Question #1420: I\\\'m reporting question #1420 because ... It says clearly that only the Captain may explain the grievance not the DA. The DA may request one however.', 3),
(510, '10.9.14.75', 1360302622, 1523, 0, 'Question #1523: I\\\'m reporting question #1523 because ... part of the stated correct answer includes \\"foremost opposing blocker\\". I believe that should be replaced with \\"foremost in-play blocker\\" per 8.3.1.4.1.2.3', 2),
(511, '10.9.14.75', 1360303990, 1367, 0, 'Question #1367: I\\\'m reporting question #1367 because ... I think it requires clarification to whether re-entering in front of one team-mate only is a major CTT penalty.', 2),
(512, '213.112.36.10', 1360355434, 1409, 0, 'Question #1409: I\\\'m reporting question #1409 because it is unclear if the opposing skater is a pack skater. \r\n\r\nRule 6.13.18: \\"..., re-entering the track in front of one opposing pack skater.\\" \r\n\r\nThank you for making this quiz!', 3),
(513, '62.254.19.176', 1360412228, 1558, 0, 'Question #1558: I\\\'m reporting question #1558 because ... Answer A is correct, but is missing the word \\"Maintain\\" before upright status', 3),
(514, '24.155.245.181', 1360510149, 1607, 0, 'Question #1607: I\\\'m reporting question #1607 because ... 6.13.18 references a Major Penalty, not No Impact.  If it were a *teammate*, it would be a No Impact.', 1),
(515, '98.247.254.51', 1360540173, 1523, 0, 'Question #1523: I\\\'m reporting question #1523 because ... the correct answer should say \\"foremost in play blocker\\".  Thank you for your consideration.', 3),
(516, '76.106.29.242', 1360556596, 189, 0, 'Question #189: I\\\'m reporting question #189 because ...  If the opposing jammer has not completed her initial pass and the lead jammer gives up her status then she could still become lead. It is unlikely but it could happen.', 1),
(517, '68.46.129.112', 1360565230, 1093, 0, 'Question #1093: I\\\'m reporting question #1093 because ... \r\n\r\nSpelling mistake.  Option B says \\"one inche\\".  ', 3),
(518, '68.46.129.112', 1360565969, 1092, 0, 'Question #1092: I\\\'m reporting question #1092 because ... \r\n\r\nSpelling error.  Option B says \\"one inche\\".  Should read \\"inch\\".', 3),
(519, '86.168.108.90', 1360589883, 1009, 0, 'Question #1009: I\\\'m reporting question #1009 because ... ', 4),
(520, '86.168.108.90', 1360590002, 144, 0, 'Question #144: I\\\'m reporting question #144 because ... ', 4),
(521, '86.168.108.90', 1360590157, 1282, 0, 'Question #1282: I\\\'m reporting question #1282 because ... ', 4),
(522, '24.155.161.112', 1360602018, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... i think it is poorly written. the skater must land in bounds and upright as stated in the rule: \r\n\r\n8.3.1.2 - In order to earn points for passing while airborne, the Jammer must continue an in bounds and upright status at the moment of landing (see Section 6.8 - Out of Bounds Blocking).\r\n\r\nI think option A might be better written this way: land in bounds and upright, regardless of whether they stay inbounds, upright and skating.\\\'\r\n\r\nwhat do you think robot? thanks so much, i love this site! smarty pants', 3),
(523, '212.247.94.54', 1360606024, 1023, 0, 'Question #1023: I\\\'m reporting question #1023 because ... \r\n\r\nUnclear wording (answers B and C do not result in proper English), and IMO the second part of the answers are a bit inconsistent in bad ways, comparing severity (no penalty, NI/NP, major penalty) to a specific category of penalties (illegal procedure penalty) which you won\\\'t *get* but *can get*. It\\\'s a hard question to understand.', 2);
INSERT INTO `rdtom_reports` (`ID`, `IP`, `Timestamp`, `Question_ID`, `User_ID`, `Text`, `Status`) VALUES
(524, '71.233.157.43', 1360689656, 1420, 0, 'Question #1420: I\\\'m reporting question #1420 because ... the head ref and captain discuss the grievance during an official review.  They both explain what happened and the resolution. Perhaps, \\"who initiates an Official Review?\\" would be a more precise way of asking the question.', 3),
(525, '71.233.157.43', 1360689751, 905, 0, 'Question #905: I\\\'m reporting question #905 because ... it says the ref MAY use, not the ref MUST use.  They MUST have at least a name.  They MAY use a name and number.', 3),
(526, '14.201.97.152', 1360752458, 1112, 0, 'Question #1112: I\\\'m reporting question #1112 because the question could be phrased better. The distance between the pack and the engagement zone is ZERO FEET. \\"The distance between the Pack and a skater in the Engagement Zone is measured as:\\" might be a better way to phrase it.', 3),
(527, '128.219.49.14', 1360855214, 1221, 0, 'Question #1221: I\\\'m reporting question #1221 because ... There are no expulsions for delay of game', 2),
(528, '128.219.49.14', 1360855561, 1594, 0, 'Question #1594: I\\\'m reporting question #1594 because ... It needs clarification. Where is the blocker standing? It is missing the key word \\\'proximity\\\'', 3),
(529, '50.92.73.112', 1360906164, 1215, 0, 'Question #1215: I\\\'m reporting question #1215 because ... \r\n\r\nIt\\\'s just missing a word. Instead of \\"where proper precaution is shown...\\" it should read \\"where proper precaution is NOT shown...\\"\r\n\r\nThe word \\"not\\" is present in the wording of the specific rule referenced, looks like it was just a wee typo in this question. \r\n\r\nThanks for running Test O\\\'Matic!\r\n\r\n', 3),
(530, '90.206.45.77', 1360953362, 1357, 0, 'Question #1357: I\\\'m reporting question #1357 because ... Not sure if this is right? \r\n\r\nThe penalty applies if there is not an immediate ATTEMPT to reform a pack. If the skaters are moving together then by definition they\\\'re making an attempt so I don\\\'t think this would be a major? :) ', 3),
(531, '176.24.89.8', 1360976822, 1215, 0, 'Question #1215: I\\\'m reporting question #1215 because ... ', 4),
(532, '176.24.89.8', 1360977067, 1054, 0, 'Question #1054: I\\\'m reporting question #1054 because ... \r\n\r\nMaybe should be changed to behind the pivots hips...?\r\n\r\nThank you for the site!', 4),
(533, '176.24.89.8', 1360977372, 1354, 0, 'Question #1354: I\\\'m reporting question #1354 because ... \r\n\r\nNot reform but return?', 3),
(534, '176.24.89.8', 1360978236, 1081, 0, 'Question #1081: I\\\'m reporting question #1081 because ... \r\n\r\nNeeds dating or clarifying, the hammer to them emerge first.', 4),
(535, '118.209.39.139', 1361055933, 308, 0, 'Question #308: I\\\'m reporting question #308 because ... Doesn\\\'t state if the skater is blocker or jammer which would be 2 different answers ', 3),
(536, '124.171.31.33', 1361056430, 1325, 0, 'Question #1325: I\\\'m reporting question #1325 because ... Should read \\\'causing the opposing skater to go out of bounds\\\'.', 3),
(537, '68.115.97.196', 1361206688, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... C was probably meant to read Land with an upright status, regardless of whether they land in bounds. ... Right now it\\\'s a bit contradictory, making the question fairly easy.', 3),
(538, '68.37.10.167', 1361233810, 1127, 0, 'Question #1127: I\\\'m reporting question #1127 because ... There is more than 1 correct answer.', 2),
(539, '62.254.19.176', 1361259615, 1607, 0, 'Question #1607: I\\\'m reporting question #1607 because ... it asks about cutting in front of an opponent after equipment malfunction, which is a major penalty, then says It\\\'s no impact by rule 6.13.18. Rule 6.13.12 is no impact for cutting one teammate, rule 6.13.18 is a major for an opponent. Rules reference/wording of question/answer wrong.', 3),
(540, '77.250.202.249', 1361280002, 1591, 0, 'Question #1591: I\\\'m reporting question #1591 because ... \r\n\r\nBad grammar: 4.9 meter\r\n\r\nmeters (plural)', 3),
(541, '77.250.202.249', 1361280729, 1457, 0, 'Question #1457: I\\\'m reporting question #1457 because ... \r\n\r\nmeter should be meters (plural)', 3),
(542, '74.79.96.73', 1361300449, 1463, 0, 'Question #1463: I\\\'m reporting question #1463 because ... 7.2.7.3 is in reference to players who are out of play, there is no reference to no pack. Players are still subject to cutting penalties when there is no pack (6.11.3.2)', 3),
(543, '205.250.4.86', 1361346557, 1070, 0, 'Question #1070: I\\\'m reporting question #1070 because ... \r\n\\"...off the jam is the the Jammer designated Lead Jammer.\\"\r\n\r\nthe the :)\r\n\r\nthank you!!', 3),
(544, '192.197.82.203', 1361462433, 946, 0, 'Question #946: I\\\'m reporting question #946 because ... In the Glossary the WFTDA definition of out of bounds is \\"A skater is out of bounds when any part of the skater’s body or equipment is touching the ground beyond the track boundary.\\"\r\n\r\nWhile the answer is technically correct, it gives the impression that you need two skates off the track to be considered out of bounds. It\\\'s a good trick question, but may add to some general confusion about \\"out of bounds\\" status as well.', 3),
(545, '71.216.40.171', 1361475634, 1057, 0, 'Question #1057: I\\\'m reporting question #1057 because ... \r\n\r\nIt seems that this question is contextual in that it depends on where the player is lined up. see below \r\n\r\n3.2.2.3 - A skater lined up in the Pivot starting position will not be considered a Pivot unless the skater is wearing or holding a helmet cover with a visible stripe.', 3),
(546, '174.236.0.110', 1361492618, 551, 0, 'Question #551: I\\\'m reporting question #551 because ... It\\\'s not actually rules related', 4),
(547, '174.236.0.110', 1361493083, 14, 0, 'Question #14: I\\\'m reporting question #14 because ... Not actually rules related', 4),
(548, '72.203.154.253', 1361493946, 401, 0, 'Question #401: I\\\'m reporting question #401 because ... it is oversimple and misleading, like the rule it references (6.5.1).  It implies that all such contact is a Major penalty, ignoring the impact of this contact.', 3),
(549, '87.22.233.49', 1361508786, 551, 0, 'Question #551: I\\\'m reporting question #551 because ... The first rule of Roller Derby is Don\\\'t be a Douchebag', 4),
(550, '213.113.2.114', 1361872760, 1156, 0, 'Question #1156: I\\\'m reporting question #1156 because secondary contact with hands or forearms or elbow isn\\\'t always a NI/NP. It can be a major penalty. \r\n\r\nBoth below paragraphs are major penalties:\r\n\r\n\\"6.5.7 - Any illegal contact with hands or forearms above the shoulders.\\"\r\n\r\n\\"6.4.7 - Any illegal contact with the elbow or swinging motion of the elbow that lands above the shoulders.\\"', 1),
(552, '68.83.53.111', 1362326136, 291, 0, 'Question #291: I\\\'m reporting question #291 because ...  it seems a little unclear with the end \\"and behind the pivot if they are on the line\\" since there IS a rule about blockers lining up behind the pivot if the pivot is on the pivot line. Maybe the question is just referring to inside/outside position when behind the pivot (who is on the pivot line), but the wording seems a tiny bit confusing.', 3),
(553, '68.83.53.111', 1362326653, 1224, 0, 'Question #1224: I\\\'m reporting question #1224 because ...   it should read \\"a team neglects\\" ', 3),
(554, '124.171.224.125', 1362349210, 1076, 0, 'Question #1076: I\\\'m reporting question #1076 because ... It\\\'s poorly worded. There are actually times that a jammer is still considered a jammer even if they don\\\'t have the helmet cover with them.', 2),
(555, '86.168.108.90', 1362673759, 1062, 0, 'Question #1062: I\\\'m reporting question #1062 because ... Testing the report function', 4),
(556, '87.195.189.205', 1362688718, 1223, 0, 'Question #1223: I\\\'m reporting question #1223 because ... I think it should include \\\'for the next jam\\\'. Thanks for making this test, by the way. \r\n', 3),
(557, '150.226.95.18', 1362775755, 1037, 0, 'Question #1037: I\\\'m reporting question #1037 because ... 1 inside pack ref is permitted. C & B are both correct.', 3),
(558, '92.26.173.122', 1362957814, 1524, 0, 'Question #1524: I\\\'m reporting question #1524 because ... \r\nThe jammer is lapped by the pack, then they engage and pass through in derby direction - that is their initial pass, so they pass through once. Immediately they exit the front engagement zone their next pass begins which would be a scoring one. \r\n\r\nPut another way, the pack passing the jammer doesn\\\'t count i.e. jammer can\\\'t fail to move off the line, be lapped by the pack then skate forward and start scoring but the first time the jammer makes their way legally through the pack is their initial pass.', 1),
(559, '178.27.186.135', 1363036606, 1157, 0, 'Question #1157: I\\\'m reporting question #1157 because ... \r\n\r\nA Skater who is not wearing a helmet, would never be on the track!', 4),
(560, '80.11.191.240', 1363267395, 1457, 0, 'Question #1457: I\\\'m reporting question #1457 because ... 7.2.7 doesn\\\'t state a Skater may NOT skate clockwise 15 feet away from the Track. For example, if she wants to get back to her Bench Aera quickly.\r\n\r\nThis question would rather be spelled \\"After exiting the penalty box a skater is compeleld to skate 15 feet away from the Track\\" (Or something like that?).\r\n\r\nBtw, thank you for the Test O\\\'Matic.', 3),
(561, '80.11.191.240', 1363269753, 1142, 0, 'Question #1142: I\\\'m reporting question #1142 because ... You may want to add a reference to \\"6.13.34 - A skater initiating contact or engaging an opponent before the jam-starting whistle that forces the receiving opposing skater out of their established starting position. This includes forcing a skater down or out of bounds.\\" + A Skater may always do something... But she\\\'ll get a penalty if it\\\'s illegal and has impact. So, in a certain way, you may engage an opposing player before the Jam starting whistle and then, you\\\'ll go to the Penalty Box... Your choice, the Track is a free country (Kind of!).', 3),
(562, '150.226.95.18', 1363269921, 1545, 0, 'Question #1545: I\\\'m reporting question #1545 because ... if said Blockers were previously scored on during that scoring pass, they do not get the points just for being in the pack.', 3),
(563, '80.11.191.240', 1363270301, 958, 0, 'Question #958: I\\\'m reporting question #958 because ... If you look at \\"9.2.6.3 - In the event that a referee must call off a jam prior to its natural conclusion (per Sections 9.2.6.2.3–9.2.6.2.8) with time remaining on the jam clock but not on the period clock, the points from the jam will remain and an additional jam may occur at the Head Referee’s discretion.\\"... \\"C. Yes – But at the discretion of the head referee\\" is not a bad answer since 0 is fewer than 30 seconds.', 3),
(564, '80.11.191.240', 1363271101, 338, 0, 'Question #338: I\\\'m reporting question #338 because ... Wording. A Skater may always do something, even if it\\\'s prohibited. She\\\'ll just get a penalty for doing it. Sometimes, some Skaters think it\\\'s worh it (Says the Penalty Box Official who heard this statement more than once!).', 3),
(565, '80.11.191.240', 1363271390, 1589, 0, 'Question #1589: I\\\'m reporting question #1589 because ... According to the WFTDA (See Glossary), 20 ft are 6 meters... Yeah, WTDA doesn\\\'t know its conversion table.', 3),
(566, '80.11.191.240', 1363274684, 1033, 0, 'Question #1033: I\\\'m reporting question #1033 because ... You do know that when a Jammer\\\'s in the Pack, the OPR usually observes her. The OPR is the \\"Outside set of eyes of the Jammer Referee\\". So, yeah, the Rules say something... But Standard Practices kind of work differently - Me thinks.\r\n\r\nLike the IPR Back is usually defining the Pack - And that\\\'s its primary mission - so the other Pack Referees can correctly call Penalties... Even if the Rules say \\"9.1.4 - Pack Referees. The remaining referees observe the pack. The primary responsibility for Pack Referees is to call penalties.\\"', 3),
(567, '80.11.191.240', 1363274887, 1476, 0, 'Question #1476: I\\\'m reporting question #1476 because ... As in some other questions, you should specify \\"(Without being ordered by a Penalty Box Official)\\".', 3),
(568, '80.11.191.240', 1363275342, 1272, 0, 'Question #1272: I\\\'m reporting question #1272 because ... Well, \\"6.13.13 - A skater initiating contact or engaging an opponent before the jam-starting whistle that forces the receiving opposing skater off balance, forward, or sideways, but does not cause the opposing skater to lose the established starting position.\\" - So, what if the receiving Skater goes Out Of Bounds (Lost of established position) without falling? It is a situation that suits your question but that is a Major Penalty (And your answer is C. NI/NP).', 3),
(569, '80.11.191.240', 1363275514, 1447, 0, 'Question #1447: I\\\'m reporting question #1447 because ... You may want to add the new \\"Color, #, Timing Stopped\\" Verbal Cue somewhere... It\\\'ll help us, NSOs :).', 4),
(570, '150.226.95.18', 1363284167, 1561, 0, 'Question #1561: I\\\'m reporting question #1561 because ... Using the word \\"MUST\\" when there are exceptions is deceiving even though it is that way in the rules.', 4),
(571, '87.213.111.124', 1363355741, 1569, 0, 'Question #1569: I\\\'m reporting question #1569 because ... 0.05 inches equals 0.127 cm / 1.27 mm, not 13 cm (which is 5.12 inches)', 2),
(572, '213.100.5.95', 1363462716, 39, 0, 'Question #39: I\\\'m reporting question #39 because ... The question isn\\\'t complete?', 4),
(573, '24.62.243.126', 1363820504, 1540, 0, 'Question #1540: I\\\'m reporting question #1540 because ...\r\n\r\nThe question is worded poorly.  The scenario seems detached from the question at the end leading me to select that she would have received the points for the penalised blocker had the jammer re-entered play in the same jam.  Obviously she doesn\\\'t get the points in the scenario but the question and scenario seem disconnected to me.  ', 3),
(574, '118.208.239.218', 1363861713, 1414, 0, 'Question #1414: I\\\'m reporting question #1414 because ... you should define what \\"not in the correct position\\" is, i.e \\"...not in position between the Pivot and Jammer lines, such that a pack will form behind the Pivot Line and in front of the Jammer Line at the time of the jam-starting whistle or immediately after the jam-starting whistle\\" It\\\'s currently worded as if the blockers could be just moving around between the pivot and jammer lines, and therefore not yet in \\\'correct\\\' position. Perhaps.', 3),
(575, '150.226.95.18', 1363971661, 1419, 0, 'Question #1419: I\\\'m reporting question #1419 because ... this should read \\"captains from both teams\\". It almost seems like two captains means from one team and is a trick question :)', 3),
(576, '150.226.95.18', 1363971728, 270, 0, 'Question #270: I\\\'m reporting question #270 because ... jewelry does not have two \\\'l\\\'s', 4),
