(578, '108.203.25.125', 1364240302, 905, 0, 'Question #905: I\\\'m reporting question #905 because ... \r\n\r\nA) applies as well as per 9.4.3.3.1 - If a referee chooses to be identified solely by a number, that number must be a numeral of no more than four digits (i.e., it may not contain letters and symbols, regardless of their size).', 3),
(579, '66.87.86.107', 1364319585, 1426, 0, 'Question #1426: I\\\'m reporting question #1426 because ... rule 6.10.2.4 states \\"when no single skater or team can be clearly found responsible for illegally destroying the pack...\\" (which is an out of play major)...no penalty shall be enforced.  \r\n\r\nThis rule was the first thing I thought of when reading the question... it should worded differently to exclude this circumstance. (There\\\'s always SOME circumstance isn\\\'t there?) \r\n\r\nThanks & high five, \r\n~Dinah Wont\\\'Cha Blow\r\n', 3),
(580, '66.87.86.107', 1364327454, 1426, 0, 'Question #1426: I\\\'m reporting question #1426 because ... rule 6.10.2.4 states \\"when no single skater or team can be clearly found responsible for illegally destroying the pack...\\" (which is an out of play major)...no penalty shall be enforced.  \r\n\r\nThis rule was the first thing I thought of when reading the question... it should worded differently to exclude this circumstance. (There\\\'s always SOME circumstance isn\\\'t there?) \r\n\r\nThanks & high five, \r\n~Dinah Wont\\\'Cha Blow\r\n', 3),
(581, '150.226.95.18', 1364563798, 323, 0, 'Question #323: I\\\'m reporting question #323 because ... Out of play skaters are allowed to counter block unpenalized if they are illegally blocked, so this is an exception which means they are not held to the same rules.', 4),
