(583, '150.226.95.18', 1364568479, 1168, 0, 'Question #1168: I\\\'m reporting question #1168 because ... This should specify who the \\"downed\\" skater is because a sprawled skater and a skater who has fallen are both downed skaters.', 3),
(584, '50.96.210.112', 1364586178, 1303, 0, 'Question #1303: I\\\'m reporting question #1303 because ... contact between members of the same team can\\\'t be called a \\"block\\". 5.1.1 says blocking is only vs an \\"opponent\\" not \\"skater\\". \r\nThank you for making Testomatic. And for letting people give nitpicky feedback like this. ', 3),
(585, '14.201.97.152', 1364902644, 1554, 0, 'Question #1554: I\\\'m reporting question #1554 because the wording on answer C is misleading. The term \\"can\\\'t score on any blockers\\" isn\\\'t qualified and makes it sound like they can\\\'t score indefinitely. Completing an initial pass is of course a prerequisite to scoring on blockers, the additional wording on answers C and D just causes confusion. Which jam are they on when they return to the track? Their initial one. No more information is necessary.', 3),
(586, '14.201.97.152', 1364907164, 1153, 0, 'Question #1153: I\\\'m reporting question #1153 because 6.1.3 states CONTACT. This question gives no information on contact or impact.', 3),
(587, '14.201.97.152', 1364907488, 1510, 0, 'Question #1510: I\\\'m reporting question #1510 because neither of these answers is 100% correct. 7.4.5.1.2 is the correct answer.', 3),
(588, '14.201.97.152', 1364986260, 1306, 0, 'Question #1306: I\\\'m reporting question #1306 because what is the point of all the other rules in 6.8 if an intentional block to an OOB player immediately gets you expelled? Also, all the Intentional/Negligent/Reckless rules are regarded as requiring two out of the three to be present before the rule is enforced.', 3),
(589, '150.226.95.18', 1364999089, 444, 0, 'Question #444: I\\\'m reporting question #444 because ... A & D are the same answer because to be completely out of bounds your skates would have had to cross the outside track boundary.', 4),
(590, '150.226.95.18', 1365002786, 1007, 0, 'Question #1007: I\\\'m reporting question #1007 because ... B is worded as if the clock would not stop if a timeout is called between jams when it would stop. C is the best answer, but B could be worded better.', 3),
(591, '166.205.55.21', 1365012715, 344, 0, 'Question #344: I\\\'m reporting question #344 because ... It\\\'s wrong.', 1),
(592, '121.221.86.208', 1365046648, 288, 0, 'Question #288: I\\\'m reporting question #288 because ... C should be the answer?!', 1),
(593, '203.59.154.224', 1365068252, 1353, 0, 'Question #1353: I\\\'m reporting question #1353 because ... \r\n\r\nDoes not mention most responsible.  Only the most responsible (the skater who has to make the least effort to reform a pack) is assessed the penalty. Other skaters who do not attempt to reform are not liable for this penalty (but are liable for different penalties of course)', 3),
(594, '207.231.89.111', 1365206580, 998, 0, 'Question #998: I\\\'m reporting question #998 because ... \r\n\r\nThe \\"Correct\\" answer:\r\n\r\n\\"Each Jammer must have their helmet cover in hand before the jam-starting whistle\\"\r\n\r\nThe clause from 2.4.4.1:\r\n\r\n\\"...each Jammer must have their helmet cover *on their head* or in hand before the jam-starting whistle\\"\r\n\r\nThe statement that the Jammer must have their helmet cover in their hand before the whistle is false, which threw me off on this question.', 3),
(595, '82.169.198.80', 1365280422, 1069, 0, 'Question #1069: I\\\'m reporting question #1069 because ... \\"... pivileges...\\" = privileges. Much love!', 3),
(596, '121.44.86.54', 1365319754, 1498, 0, 'Question #1498: I\\\'m reporting question #1498 because ... as a result of action in a game a suspension can only be recommended. Question is misleading.', 4),
(597, '121.44.86.54', 1365320532, 486, 0, 'Question #486: I\\\'m reporting question #486 because ... no rules reference provided.', 4),
(598, '81.110.222.189', 1365455980, 1190, 0, 'Question #1190: I\\\'m reporting question #1190 because ... although it quotes the rules exactly, it just doesn\\\'t seem as though it\\\'s phrased as a question, e.g. \\\'A skater enters the penalty box in a way that causes another person to vacate their position [etc]... This skater is then subjected to a/an:\\\'\r\n\r\nPS. The rest of the questions that I\\\'ve had have been awesome and thank you /so much/ for making this, it\\\'s brill!', 3),
(599, '170.11.30.141', 1365630365, 1037, 0, 'Question #1037: I\\\'m reporting question #1037 because it appears to be missing a word.\r\n\\"What\\\'s the largest number of Pack Referees who be stationed inside the track?\\"  seems like it could use a \\"can\\" or \\"may\\" in \\"who be\\"', 3),
(600, '207.231.89.111', 1365636454, 793, 0, 'Question #793: I\\\'m reporting question #793 because ... \r\n\r\nA small point, but 8.1 states \\"Only skaters wearing the designated Jammer’s star helmet cover...\\" rather than \\"Any\\"\r\n\r\nThe correct answer in this question makes it sound like, for instance, a blocker could take the cover off her jammer\\\'s head, put it on, and then score points.', 3),
(601, '124.197.43.26', 1365647240, 1076, 0, 'Question #1076: I\\\'m reporting question #1076 because ... the jammer must be wearing the cover with visible stars to be considered active.  \r\n\r\n\\"3.3.2.3 - A skater lined up in the Jammer Starting Position will not be considered an active Jammer unless the skater is wearing a helmet cover with visible stars\\"', 3),
(602, '71.79.38.119', 1365821313, 1458, 0, 'Question #1458: I\\\'m reporting question #1458 because ... 7.2.7 seems to counterdict 6.13.16 and 6.13.10  I believe D. should be the correct answer because a returning skater may enter the pack in front of one pack skater belonging to the same team.  Thus if the reamost pack skater is from the same team the returning skater may enter the pack in front of that skater.  However they cannot return to the track in front of the rearmost opposing pack skater.\r\n\r\nYes? No?', 3),
(603, '24.72.92.165', 1366205087, 199, 0, 'Question #199: I\\\'m reporting question #199 because ... While I may be wrong here, I had an earlier question about an \\"out of play\\" pivot being in-eligible for a star-pass.  I interpreted the words \\"if applicable\\" to refer to a situation where the jammer wants to pass the star...but it would not be an \\"appicable\\" situation if their pivot was out of play.\r\nJust my two-cents.\r\n\r\n I was scored as wrong for choosing answer \\"C\\".', 3),
(604, '96.35.104.250', 1366244049, 1056, 0, 'Question #1056: I\\\'m reporting question #1056 because ... it is unclear as to whether or not said Pivot is holding the Pivot helmet cover or not. Rules clearly state that a Pivot can be holding or wearing the cover.', 3),
(605, '58.7.117.127', 1366288159, 1346, 0, 'Question #1346: I\\\'m reporting question #1346 because ... 6.10.1 doesn\\\'t seem to make a distinction between any of the OOP penalties, and states that issuing penalties is priority over given warnings. So, a warning is preferred, but isn\\\'t the be all and end all?\r\n\r\n6.10.1 - A skater who is more than 20 feet (6 m) in front of or behind the pack may receive an out of play warning by a referee. A referee is not required to issue a warning prior to giving a penalty. Issuing penalties takes priority over issuing warnings. A warning does not have to be issued in order for a penalty to be given (see Section 9.3.1.1).', 3),
(606, '68.46.129.112', 1366465165, 1127, 0, 'Question #1127: I\\\'m reporting question #1127 because ... \r\n\r\nIt has answers for both \\"Major Misconduct Penalty\\" and \\"Misconduct Penalty\\".  With the removal of minors there is no longer a distinction between the two.', 3),
(607, '68.171.76.136', 1366479670, 1524, 0, 'Question #1524: I\\\'m reporting question #1524 because ... of the wording', 3),
(608, '24.78.240.251', 1366511863, 1209, 0, 'Question #1209: I\\\'m reporting question #1209 because ... In the question it states that what is being contacted is the teammate\\\'s head, not that the initiator is blocking with their head. But, a wrong answer redirects you back to WFTDA rule 6.6, which is blocking WITH the head, not TO the head.', 2),
(609, '96.35.104.250', 1366558577, 1132, 0, 'Question #1132: I\\\'m reporting question #1132 because ... C. Moving could be considered an acceptable answer since Accelerating *is* moving.', 3),
(610, '108.239.221.174', 1367087456, 1217, 0, 'Question #1217: I\\\'m reporting question #1217 because ... Expulsion is the correct answer. ', 1),
(611, '108.239.221.174', 1367088687, 953, 0, 'Question #953: I\\\'m reporting question #953 because ... An assist cannot be given by a stopped skater. ', 4),
(612, '58.7.75.195', 1367140297, 1568, 0, 'Question #1568: I\\\'m reporting question #1568 because ...It is a bit misleading, because a jammer can not be a jammer without the star cover on her helmet. I may be wrong because I am new to this; but it seems to me A & B are required for a jammer to be ready? \r\nThank you for your site, it is really helping me prepare for testing.\r\nCheers Thea (freshmeat)', 3),
(613, '96.35.104.250', 1367679639, 1463, 0, 'Question #1463: I\\\'m reporting question #1463 because ... rule 6.11.3.2 states - An in-bounds, upright, and skating skater who returns completely in-bounds (having previously been either out-of-bounds or straddling), who does so in front of one or more in-bounds skaters during a no-pack scenario, which results in the offending skater having bettered their position relative to that/those in-bounds skater(s) will receive a cutting penalty. The rule used for the question and the ruled I have cited are in direct opposition.', 1),
(614, '75.85.86.29', 1367721962, 1187, 0, 'Question #1187: I\\\'m reporting question #1187 because ... 6.4.10 requires contact.  (Intentional, negligent, or reckless contact) This question implies the initiating skater tries, but fails to make contact. So that should be a no impact/no penalty. You broke my perfect answer streak!', 1),
(615, '82.17.194.253', 1367948230, 1120, 0, 'Question #1120: I\\\'m reporting question #1120 because ... \r\n\r\nI may have misunderstood the rules, but in this question \\"enough blockers\\" should read \\"enough on-track blockers\\". The rules suggest that by \\\'enough\\\' they mean the majority of on-track blockers, whereas this question suggests that there has to be a specific number, rather than a majority.\r\n\r\nBasically, this is asking \\"Are there enough blockers in the correct position?\\" whereas the rules are asking \\"Are there enough of the on-track blockers in the correct position\\"', 3),
(616, '137.191.230.165', 1368201595, 1222, 0, 'Question #1222: I\\\'m reporting question #1222 because ... \\"waived\\" should be \\"waved\\". ', 3),
(617, '137.191.230.165', 1368203408, 1398, 0, 'Question #1398: I\\\'m reporting question #1398 because ... \\\'waived\\\' should be \\\'waved\\\' here. ', 3),
(618, '96.35.104.250', 1368321715, 1108, 0, 'Question #1108: I\\\'m reporting question #1108 because ... it doesn\\\'t make any sense. What does this question even mean?', 3),
(619, '81.56.1.251', 1368612407, 1487, 0, 'Question #1487: I\\\'m reporting question #1487 because I find the note below is misleading. It says that one should deal with multiple penalties as individual penalties, but does not explain the difference with 7.3.1', 3),
(620, '8.22.0.61', 1368649085, 854, 0, 'Question #854: I\\\'m reporting question #854 because ... I have never encountered a scoreboard that tracks penalties.', 1),
(621, '5.243.204.173', 1368774134, 1263, 0, 'Question #1263: I\\\'m reporting question #1263 because ... you should say if the jam was called off or not. Its only a major if it is called off.', 3),
(622, '96.35.104.250', 1368999368, 1518, 0, 'Question #1518: I\\\'m reporting question #1518 because ... it is unclear whether the jammer is simply passing the blocker again on the same pass or has begun a new pass through the pack. This detail is over important in the interpretation of the question and selection of the answer.', 3),
(623, '96.35.104.250', 1368999788, 1463, 0, 'Question #1463: I\\\'m reporting question #1463 because ... normal cutting rules apply during a no pack situation.', 1),
(624, '70.194.0.27', 1369163341, 545, 0, 'Question #545: I\\\'m reporting question #545 because ... please clarify \\\'assist\\\' - it can be interpreted as helping a skater to their feet or something of a similar nature based on the language of the other questions.', 4),
(625, '131.130.15.0', 1369241283, 1581, 0, 'Question #1581: I\\\'m reporting question #1581 because ... \r\n\r\nAlthough it is consistent with the wording of rule 3.4.2.3, it is not true generally: to earn lead it is sufficient to pass legally all in-play blockers. So it is possible to pass only some blockers legally (those that are in play) then earn lead. It is mentioned in rule 3.4.1.\r\n\r\nAdditionally, the word \\"blockers\\" should be used instead of \\"players\\", otherwise it implies that the opposing jammer must also be passed legally. I don\\\'t think you can fail to earn lead because of a no pass/no penalty on the opposing jammer.', 2),
(626, '165.189.65.28', 1369255918, 1120, 0, 'Question #1120: I\\\'m reporting question #1120 because...\r\n\r\nIt\\\'s a little confusing as it\\\'s written.  Unless I\\\'m wrong, a team will simply skate short if they don\\\'t have enough Blockers on the track at the start of a jam.  The question would be clearer if it said, \\"If there are not enough on-track Blockers from one team in correct pre-jam positioning...\\" or something to that effect.  Thanks! ', 3),
