(749, '173.8.178.12', 1387495880, 1498, 0, 'Question #1498: I\\\'m reporting question #1498 because the wording seems a bit off. If the rule is 7.4.2.2, the wording should be similar to that rule. The rule states, \\"Depending on the severity of the incident, an expulsion may result in the skater being suspended from their next game.\\" The question doesn\\\'t mention expulsion, even though this section is about expulsions. I would suggest this wording instead: \\"True or False: the incident leading to an expulsion may be deemed so severe that the skater in question is suspended from their next game.\\"', 3),
