(751, '24.68.34.157', 1387783167, 137, 0, 'Question #137: I\\\'m reporting question #137 because ... \r\nMy opinion...3.4.2 and 3.5.5 refer to a position a player is playing, such as Jammer as a STATUS, and or transferring a STATUS to a PIVOT.\r\nIf you look at 4.2, it refers to where skaters are POSITIONED on the track.\r\nOf course, according to rule 3. It is in fact referencing JAMMER, PIVOT, or BLOCKER as position.', 3),
(752, '78.69.56.85', 1388429585, 1109, 0, 'Question #1109: I\\\'m reporting question #1109 because both answers \\"Expulsion or Suspension\\" and \\"Gross Misconduct\\" are correct. The offence is a gross misconduct which will give you an expulsion/suspension. If only one of them should be correct I think it should be \\"Gross Misconduct\\" since it is the more specific answer.', 3),
