(764, '173.8.178.12', 1389635451, 1659, 0, 'Question #1659: I\\\'m reporting question #1659 because both the question and the correct answer could be worded better. For the question, I would suggest wording it to more closely match the rule: \\"During a no-pack scenario in which there are more than two groups of skaters, the skaters who are in neither the front-most or rear-most groups must...\\"; and for the correct answer, similarly, I would suggest \\"may choose for themselves whether to speed up or slow down\\".', 3),
