(766, '173.8.178.12', 1389728006, 1627, 0, 'Question #1627: I\\\'m reporting question #1627 because it references rule 3.4.2.3, but rule 3.4.2.3 does not address the question. Rule 3.4.2.3 states, \\"Once the Jammer has exited the front of the Engagement Zone that Jammer is no longer eligible to re-pass. If the Jammer has not passed all of the Blockers on both teams in bounds, upright, and legally, the Jammer will be declared NOT Lead Jammer at this point.\\" Rule 3.4.2.3 doesn\\\'t say anything about the Jammer exiting the Engagement Zone from the rear -- only from the front.', 1),
(767, '173.8.178.12', 1389815371, 1163, 0, 'Question #1163: I\\\'m reporting question #1163 because the wording isn\\\'t great. For one thing, there\\\'s rule 6.3.10 (\\"A skater who habitually falls in front of opposing skaters, causing them to stumble or fall or lose relative position, even if the skater \\\'falls small.\\\' The intent is to penalize a skater who repeatedly falls as the skater is a danger to opponents. A single skater who repeatedly low blocks other skaters, even when \\\'falling small\\\' is adversely affecting game play and safety.\\"). Perhaps a better wording for the question might be something like, \\"If a skater falls one time, and \\\'falls small\\\' to avoid tripping other players, the skater is assessed a/an...\\"', 3),
(768, '71.6.86.243', 1389899118, 560, 0, 'Question #560: I\\\'m reporting question #560 because ... I think the wording might be poor in this question. It says \\"a skater who is skating out of bounds is eligible...\\" If their skating out of bounds they will get called for a skating of bounds even if they do end up cutting someone.  They will be called for the first infraction. Maybe change it to just \\"a skater who is out of bounds is eligible...\\"', 3),
(769, '77.97.179.116', 1389915555, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \r\n\r\nI believe the current correct answer of \\"Land on their skate in bounds and continue upright and skating\\" is incorrect.\r\n\r\nThe specific rule (8.3.1.2) doesn\\\'t state the jammer has to be skating afterwards. The WFTDA Q&A section has a question about this (http://wftda.com/rules/qa/passing-while-airborne--updated-62613) and that states the jammer can still receive the point(s) as long as the initial point of landing is in bounds. \r\n\r\nI believe the correct answer for this should be \\"Land on their skate, in bounds and with upright status at the moment of landing, regardless of whether they stay upright and skating\\". \r\n\r\nIf you could check this it would be appreciated.  Thank you. ', 2),
(770, '173.8.178.12', 1389998338, 1620, 0, 'Question #1620: I\\\'m reporting question #1620 because it has the world\\\'s most minor typo. \\"Offical\\" should be \\"Official\\".', 3),
(771, '68.113.165.220', 1390243840, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \r\nWFTDA Rules Publication\r\nPASSING WHILE AIRBORNE - UPDATED 6/26/13\r\n\r\nJanuary 17, 2013\r\n\r\nQ:\r\nIn order to score points while airborne, does a Jammer need to \\"stick\\" the landing?\r\n\r\nA:\r\nIn order to score points while airborne, the Jammer must establish contact feet-first and in-bounds at the moment of landing. A Jammer satisfies this requirement if any part of their foot or skate is the first point of contact upon landing, with no part of their body touching out of bounds at the point of initial contact with the track. Thus, if any part of the Jammer’s foot/skate has touched in-bounds at the moment of initial contact upon landing, the Jammer has immediately satisfied this requirement. Anything that happens after this point (falling, stepping out of bounds, etc.) is irrelevant to scoring, but will be taken into account for other rules purposes (such as cutting the track, low blocking, etc).\r\n\r\nExample:\r\nJammer is completely in-bounds and ceases contact with the track as part of an apex jump. The first part of the Jammer’s body to contact the floor is their right foot, which makes contact in-bounds. The Jammer’s left foot then lands out of bounds. This Jammer will be eligible to receive points for all opposing skaters passed while airborne, but will also be eligible for a cut track should they re-enter play in front of opposing skaters passed while airborne.', 2),
(772, '143.235.186.74', 1392835775, 1332, 0, 'Question #1332: I\\\'m reporting question #1332 because ... \r\n\r\nIt\\\'s not clear without the context of being in the OOB section that the question is asking about a penalty on the skater being forced out rather than on the skater forcing them out.\r\n\r\nThere isn\\\'t enough information to know if the skater initiating the block did so legally, but with only answers that assume the block was illegal, it can be read to be talking about assigning a penalty to a skater who blocks another skater out of bounds with an illegal block.', 3),
(773, '184.36.14.12', 1392841153, 55, 0, 'Question #55: I\\\'m reporting question #55 because ... I was under the understanding that if the jam ends, for example, for being called off for an injury, the head ref has the discretion of whether or not have another jam. ', 4),
(774, '10.229.26.202', 1392846553, 534, 0, 'Question #534: I\\\'m reporting question #534 because ... The question is too vague, because 6.10.2.3.2 specifically contemplates a scenario where the pack is destroyed when a block is attempted and the blocking skater misses and GOES OUT OF BOUNDS, THEREBY DESTROYING THE PACK (as opposed to intentionally going out of bounds to destroy the pack). The scenario here doesn\\\'t embody the example of 6.10.2.3.2, and is therefore subject to misinterpretation (i.e. dopes like me reading something else into it.) P.S. Love the quiz, glad to see you\\\'re back.  ;)', 3),
(775, '216.239.45.84', 1392848926, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \r\n\r\n8.3.1.2 - In order to earn points for passing while airborne, the Jammer’s skate must be the first part of the Jammer to make contact with the track. This contact must be in-bounds and must occur prior to the end of the jam \r\n\r\nThis was changed during the 2013 season, You no longer have to \\\'stick the landing\\\' The correct answer is now B', 2),
