(788, '80.71.135.20', 1393319734, 1607, 0, 'Question #1607: I\\\'m reporting question #1607 because ... \r\n\r\nAccording to WFDTA rule 6.13.18 is a Major Penalty. ', 1),
(789, '88.114.43.180', 1393422970, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because it offers C as a right answer. This would\\\'ve been the case with the 1.1.2013 ruleset, but it all changed with the June update in favor of the A answer. Here\\\'s the clarification regarding the situation.\r\nhttp://wftda.com/rules/qa/passing-while-airborne--updated-62613\r\n\r\nBest regards\r\nUruk-ho', 2),
(790, '184.71.101.30', 1393452793, 1290, 0, 'Question #1290: I\\\'m reporting question #1290 because ... I feel like the question is too ambiguous and not clear, as there are a variety where this could be considered a major penalty. Does the contact with the OOB skater improve the initiators relative position, regardless of whether it affects that skaters ability to re enter?  ', 3),
(791, '184.71.101.30', 1393455797, 873, 0, 'Question #873: I\\\'m reporting question #873 because ... If there are too few skaters on the track and a pack can not be formed - they can call off a jam ', 3),
(792, '184.71.101.30', 1393624841, 137, 0, 'Question #137: I\\\'m reporting question #137 because ... Answer C and D are too similar to be separate answers. The only difference is a little bit of wording. \r\n\r\nIf you were to ask me to define \\"my position\\" I would say it is where I am in relation to others on the track during a given jam.  \r\n\r\n', 3),
(793, '213.205.240.137', 1393853747, 953, 0, 'Question #953: I\\\'m reporting question #953 because ... 6.9.2.1. Allows for a legal stopped assist, and 6.9.10 allows a specific example where it would be ni/np.', 3),
(794, '68.46.129.112', 1394653238, 1109, 0, 'Question #1109: I\\\'m reporting question #1109 because ... \r\n\r\nIt has two correct answers.\r\n\r\n\\"Gross Misconduct\\" is inherently an \\"Expulsion or Suspension\\".  And the described offense is listed in the gross misconduct section.', 3),
(795, '153.90.1.53', 1394836274, 1323, 0, 'Question #1323: I\\\'m reporting question #1323 because ... changed in 2014 ruleset.', 4),
(796, '172.30.170.43', 1395063527, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because the rules no longer require the skater to stay upright and skating, only that their skate is the first thing to land: 8.3.1.2 - In order to earn points for passing while airborne, the Jammer’s skate must be the first part of the Jammer to make contact with the track. This contact must be in-bounds and must occur prior to the end of the jam ', 2),
(797, '108.162.72.17', 1395249897, 1466, 0, 'Question #1466: I\\\'m reporting question #1466 because ... it needs to be updated for the 2014 rule set.', 4),
(798, '108.162.72.17', 1395250196, 1489, 0, 'Question #1489: I\\\'m reporting question #1489 because ... it needs to updated for the 2014 rule set.', 4),
(799, '86.168.108.38', 1395436443, 95, 0, 'Question #95:  Hey,\r\n\r\n Since, according to WFTDA\\\'s Officiating Standardized Practices (pages 6 & 7), Jam Timers (NSO\\\'s) are empowered to signal the beginning of a Team Timeout (if they check to see that the team has any remaining), and stop the game clock, perhaps you could modify the \\\'only a Referee\\\' wording in the question.\r\n\r\n Jam Timers are also allowed make their own decision to begin an Official Timeout; e.g.: when the Refs aren\\\'t quite ready for an imminent Jam.\r\n\r\n http://wftda.com/rules/wftda-officiating-standardized-practices.pdf\r\n\r\n\r\n Thanks for reading my run-on sentence(s),\r\n El Beau', 4),
(800, '108.217.108.147', 1395470158, 429, 0, 'Question #429: I\\\'m reporting question #429 because ... only because of rules changes. I understand this has yet to be updated. ', 4),
(801, '96.245.229.16', 1395679610, 1466, 0, 'Question #1466: I\\\'m reporting question #1466 because the question is not updated for 2014 rules.', 4),
(802, '132.3.21.79', 1395749388, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... answers C and D are exactly the same word for word.  If you selected C it\\\'s wrong, but D is right.', 2),
(803, '1.178.239.231', 1395806471, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... Answers c&d are edntical, yet c is incorrect & d is correct', 2),
(804, '50.37.89.65', 1395958652, 1515, 0, 'Question #1515: I\\\'m reporting question #1515 because ... \\"8.5.8 - In order to earn points for passing while airborne, the Jammer must maintain in bounds and upright status after landing\\"', 2),
(805, '50.37.89.65', 1395960143, 1515, 0, 'Question #1515: Answers C and D are identical in wording, yet if you pic the \\"wrong\\" one you get an incorrect marked on your record.\r\n\r\nAlso, \\"8.5.8 - In order to earn points for passing while airborne, the Jammer must maintain in bounds and upright status after landing.\\" This requires the Jammer to \\"maintain\\" in bounds and upright status, meaning they must stay upright until they have established their position in-bounds and upright.', 2),
(806, '70.208.22.83', 1395983838, 240, 0, 'Question #240: I\\\'m reporting question #240 because ... any contact to the head should be a major penalty to the initiator.', 4),
(807, '216.197.143.239', 1396069119, 1515, 0, 'Question #1515: \\"A\\" is right too ', 2),
(808, '121.73.44.166', 1396247293, 1323, 0, 'Question #1323: I\\\'m reporting question #1323 because ... it is no longer current.', 4),
(809, '209.6.94.62', 1396714765, 1511, 0, 'Question #1511: I\\\'m reporting question #1511 because ... This question refers to the previous ruleset, not the current released on 4/01/2014. In fact, all questions\\\' answers are defined by and link to, the previous ruleset.', 4),
(810, '209.6.94.62', 1396715729, 1557, 0, 'Question #1557: I\\\'m reporting question #1557 because ... This question refers to the previous ruleset, not the current ruleset released on 4/1/2014, which says the jam ends on the first of the four whistles...', 4),
(811, '58.96.56.251', 1396822227, 210, 0, 'Question #210: I\\\'m reporting question #210 because ... It is no longer correct under the 2014 WFTDA ruleset. It also references the old ruleset.\r\n\r\nNigel NoMates - Ref Cairns Derby Dolls ', 4),
(812, '58.96.56.251', 1396822687, 1466, 0, 'Question #1466: I\\\'m reporting question #1466 because ... this question is referencing the 2013 ruleset. ( penalty time is  now 30 seconds )', 4),
(813, '174.63.118.208', 1396998986, 1509, 0, 'Question #1509: I\\\'m reporting question #1509 because ... I\\\'m sure you\\\'re busy changing the test to reflect the new rules, but I figured I\\\'d report it anyway. 30 second pentalties! Yay!', 4),
(814, '109.58.148.94', 1397291687, 953, 0, 'Question #953: I\\\'m reporting question #953 because ... No longer applicable. ', 4),
(815, '109.58.148.94', 1397291712, 1272, 0, 'Question #1272: I\\\'m reporting question #1272 because ... MAJOR PENALTY', 4),
(816, '109.58.148.94', 1397291789, 1669, 0, 'Question #1669: I\\\'m reporting question #1669 because ... MAJOR PENALTY', 4),
(817, '109.58.148.94', 1397292720, 1281, 0, 'Question #1281: I\\\'m reporting question #1281 because ... MAJOR PENALTY', 4),
(818, '109.58.148.94', 1397292740, 1152, 0, 'Question #1152: I\\\'m reporting question #1152 because ... MAJOR PENALTY', 4),
(819, '109.58.148.94', 1397292765, 1122, 0, 'Question #1122: I\\\'m reporting question #1122 because ... MAJOR PENALTY ', 4),
(820, '194.32.182.7', 1397469795, 133, 0, 'Question #133: I\\\'m reporting question #133 because ... No more major!', 4),
(821, '78.144.129.28', 1398172474, 1439, 0, 'Question #1439: I\\\'m reporting question #1439 because ... it states \\\'there IS space in the penalty box for the penalised skater´ however should it actually say \\\'there is NOT space in the Penalty box´ hence making the answer A :  as soon as  red blocker returns to the pack´ or am I misunderstanding the question. Thank you. ', 3),
(822, '68.83.168.173', 1398382847, 1425, 0, 'Question #1425: Penalties are no longer 1 minute. ', 4),
(823, '83.189.182.225', 1399144254, 1466, 0, 'Question #1466: I\\\'m reporting question #1466 because ... ', 4),
(824, '97.112.8.142', 1399425699, 1280, 0, 'Question #1280: I\\\'m reporting question #1280 because ... The latest rule revision 3/14/14 has changed this rule; the guidelines for Multi-player block are now parallel to those of other action penalties, requiring an initiator (or a teammate) to gain relative position or the blocked skater to loose relative position. (I think!)\r\n', 4),
(825, '97.112.8.142', 1399428411, 1527, 0, 'Question #1527: I\\\'m reporting question #1527 because ... According to your own note, which appeared at the end of the question, Team B\\\'s jammer should NOT get even one point since she has only gotten a point for passing a jammer, not a blocker in this situation.  She has not yet passed a blocker on this pass through the pack.', 1),
(826, '97.112.8.142', 1399429146, 210, 0, 'Question #210: I\\\'m reporting question #210 because ... I believe that in the 3/14 update revision of the rules, it was decided that the Pivot who has legally received the star in her grasp from the previous jammer becomes the new jammer immediately.  (I was puzzled by this since it seems she could get points without having the helmet on her head, but...) ', 4);
