INSERT INTO `rdtom_terms` (`ID`, `name`, `description`, `taxonomy`) VALUES
(1, 'WFTDA5', 'The fifth edition of the WFTDA rules for flat track derby, published in May 2010.', 'rule-set'),
(2, 'WFTDA6', 'The sixth edition of the WFTDA rules for flat track derby, published in fall 2012', 'rule-set'),
(3, 'Test Question', 'Questions tagged as Test Questions are for use when compiling Tests. This tag is used to exclude funny, very easy and pedantic questions.', 'tag'),
(4, 'Manchester Roller Derby', 'A co-ed roller derby league found in Manchester UK', 'source'),
(5, 'Beginner', 'Questions aimed at those just starting out learning the rules', 'difficulty'),
